(241, 'en', 'wpml-string-translation', '30c96b871948ee5fe334628e35f4b63c', 'WPML Package Translation is enabled but not effective. It requires <a href=\"%s\">WPML</a>, String Translation and Translation Management in order to work.', NULL, NULL, '', 'LINE', NULL, 10, '', '3e2253dba739cc4923fe28b50456e5b2', '', NULL),
