(244, 'en', 'wpml-string-translation', '66a6d6b2b2a6d1fb462747c264b9a641', 'WPML String Translation will send all strings to WPML’s Advanced Translation Editor and to the translation services which are used.', NULL, NULL, '', 'LINE', NULL, 10, '', '9a19296333e745f277699eb9dc7fd11e', '', NULL),
