(1539, 'en', 'default', '99e77b4ea57d035beec28a4aace328b5', 'Howdy USERNAME,\\n\\nYour new account is set up.\\n\\nYou can log in with the following information:\\nUsername: USERNAME\\nPassword: PASSWORD\\nLOGINLINK\\n\\nThanks!\\n\\n--The Team @ SITE_NAME', NULL, NULL, '', 'LINE', NULL, 10, '', '698d770c6d5bd26cb65845be0fdd43a3', '', NULL),
(1540, 'en', 'default', '97afb9087b3f49664dd863eaf8a09637', 'Howdy!\\n\\nSince WordPress 5.2 there is a built-in feature that detects when a plugin or theme causes a fatal error on your site, and notifies you with this automated email.\\n###CAUSE###\\nFirst, visit your website (###SITEURL###) and check for any visible issues. Next, visit the page where the error was caught (###PAGEURL###) and check for any visible issues.\\n\\n###SUPPORT###\\n\\nIf your site appears broken and you can\'t access your dashboard normally, WordPress now has a special \"recovery mode\". This lets you safely login to your dashboard and investigate further.\\n\\n###LINK###\\n\\nTo keep your site safe, this link will expire in ###EXPIRES###. Don\'t worry about that, though: a new link will be emailed to you if the error occurs again after it expires.\\n\\n###DETAILS###', NULL, NULL, '', 'LINE', NULL, 10, '', 'eb60647044fcbb9985941f3abf5b29ca', '', NULL),
(1541, 'en', 'default', '3a9c294343c5f8076a81c70a2e3df016', 'Howdy,\\n\\nA request has been made to perform the following action on your account:\\n\\n     ###DESCRIPTION###\\n\\nTo confirm this, please click on the following link:\\n###CONFIRM_URL###\\n\\nYou can safely ignore and delete this email if you do not want to\\ntake this action.\\n\\nRegards,\\nAll at ###SITENAME###\\n###SITEURL###', NULL, NULL, '', 'LINE', NULL, 10, '', 'c4fe39a207abd5cf1d7bdbea7c8fbd8f', '', NULL),
(1542, 'en', 'default', 'a3448d08f0fb51527fe3a8b4313869c8', 'Howdy,\\n\\nA user data privacy request has been confirmed on ###SITENAME###:\\n\\nUser: ###USER_EMAIL###\\nRequest: ###DESCRIPTION###\\n\\nYou can view and manage these data privacy requests here:\\n\\n###MANAGE_URL###\\n\\nRegards,\\nAll at ###SITENAME###\\n###SITEURL###', NULL, NULL, '', 'LINE', NULL, 10, '', 'c8c30e6dc1f7b6e1e74b1046aa55e8a5', '', NULL),
(1543, 'en', 'default', '45c6e468c22eeb80c1c730531caf17b1', 'Howdy,\\n\\nYour request to erase your personal data on ###SITENAME### has been completed.\\n\\nIf you have any follow-up questions or concerns, please contact the site administrator.\\n\\nFor more information, you can also read our privacy policy: ###PRIVACY_POLICY_URL###\\n\\nRegards,\\nAll at ###SITENAME###\\n###SITEURL###', NULL, NULL, '', 'LINE', NULL, 10, '', 'fc6d4b623463133874c256fe0e6aa334', '', NULL),
