INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `wrap_tag`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `translation_priority`, `word_count`) VALUES
(4100, 'en', 'default', '2e9457fe36435e48a296c4a614e71a4f', '<strong>%s</strong> &mdash; This allows you to associate an image with your post without inserting it. This is usually useful only if your theme makes use of the image as a post thumbnail on the home page, a custom header, etc.', NULL, NULL, '', 'LINE', NULL, 10, '', '3006d7934608817a28a556e753065609', '', NULL),
(4101, 'en', 'default', 'f067f6f2a07a9f28b8acd051de12bd8f', '<strong><em>Note that password</em></strong> carefully! It is a <em>random</em> password that was generated just for you.', NULL, NULL, '', 'LINE', NULL, 10, '', '667f6a0fa877d898323aca1fc507a99e', '', NULL),
(4102, 'en', 'default', 'ecdb52fb00d5aabe4e9d24b436f9b9fc', '<strong>Activity</strong> &mdash; Shows the upcoming scheduled posts, recently published posts, and the most recent comments on your posts and allows you to moderate them.', NULL, NULL, '', 'LINE', NULL, 10, '', '92492a427dfb72cd1b97719e8e35e896', '', NULL),
(4103, 'en', 'default', 'fded98eff7361ede97add64b23522e66', '<strong>Advice:</strong> Think very carefully about your site crashing if you are live-editing the theme currently in use.', NULL, NULL, '', 'LINE', NULL, 10, '', '15ddc9d8e549ea70f200b6c8f5f1f2eb', '', NULL),
(4104, 'en', 'default', 'a8f4d14621490c3a1b94015a6744f684', '<strong>At A Glance</strong> &mdash; Displays a summary of the content on your site and identifies which theme and version of WordPress you are using.', NULL, NULL, '', 'LINE', NULL, 10, '', '63cb0e79249a3955ef8698cb0ff6b575', '', NULL),
(4105, 'en', 'default', 'b65fa8d75f92ea10c226c9c9e107cfc6', '<strong>Box Controls</strong> &mdash; Click the title bar of the box to expand or collapse it. Some boxes added by plugins may have configurable content, and will show a &#8220;Configure&#8221; link in the title bar if you hover over it.', NULL, NULL, '', 'LINE', NULL, 10, '', '54545fe38eda999a7a67927af2e0e559', '', NULL),
(4106, 'en', 'default', '2bc2b92ef21e54b7d57719af3e03b906', '<strong>Clicking the arrow to the right of any menu item</strong> in the editor will reveal a standard group of settings. Additional settings such as link target, CSS classes, link relationships, and link descriptions can be enabled and disabled via the Screen Options tab.', NULL, NULL, '', 'LINE', NULL, 10, '', '44adfce5db156b9d67e7c275453a89b9', '', NULL),
(4107, 'en', 'default', 'b1223bca091660d2cb26c4403f354ea0', '<strong>Compatible</strong> with your version of WordPress', NULL, NULL, '', 'LINE', NULL, 10, '', '96c7d1203469aa395da152a984342fe8', '', NULL),
(4108, 'en', 'default', '019360949341be40f9abc62e0d947806', '<strong>Connection lost.</strong> Saving has been disabled until you&#8217;re reconnected.', NULL, NULL, '', 'LINE', NULL, 10, '', 'c7ad62cbc8e82263e1ecdbb66fe5fb52', '', NULL),
(4109, 'en', 'default', '009d122ea5b480829aa49478250882f2', '<strong>Delete</strong> brings you to the Delete Users screen for confirmation, where you can permanently remove a user from your site and delete their content. You can also delete multiple users at once by using Bulk Actions.', NULL, NULL, '', 'LINE', NULL, 10, '', '6f347940b95b62848846a02047a935e5', '', NULL),
(4110, 'en', 'default', '455ea6f84b4f4e0349d551dbb50d3a42', '<strong>Description</strong> &mdash; The description is not prominent by default; however, some themes may display it.', NULL, NULL, '', 'LINE', NULL, 10, '', 'bf0e83818cfea660dd6082860a6da784', '', NULL),
(4111, 'en', 'default', '72a914bd12c78373873416f57b033b13', '<strong>Discussion</strong> &mdash; You can turn comments and pings on or off, and if there are comments on the post, you can see them here and moderate them.', NULL, NULL, '', 'LINE', NULL, 10, '', 'feb178d959aae886b2dde85248492051', '', NULL),
(4112, 'en', 'default', '71ce1121b4c5579d8f2c8e71335b9a22', '<strong>Drag and Drop</strong> &mdash; To rearrange the boxes, drag and drop by clicking on the title bar of the selected box and releasing when you see a gray dotted-line rectangle appear in the location you want to place the box.', NULL, NULL, '', 'LINE', NULL, 10, '', '5152a8dbc58f8c3531ec3b414be417aa', '', NULL),
(4113, 'en', 'default', 'eb233701305e7a3f2c7906f8fc65e817', '<strong>Drag and drop</strong> your files into the area below. Multiple files are allowed.', NULL, NULL, '', 'LINE', NULL, 10, '', '8edfe8913a0e716cd74f3f38806c7700', '', NULL),
(4114, 'en', 'default', 'f62a6b681a08721ae6b0f640c11373e9', '<strong>ERROR:</strong> There was an error connecting to the server, Please verify the settings are correct.', NULL, NULL, '', 'LINE', NULL, 10, '', '4de9a113fcc64567a124a76f81341274', '', NULL),
(4115, 'en', 'default', '0926e3f2bf1eb6e20cf4939dd94012a0', '<strong>ERROR</strong>: \"Table Prefix\" can only contain numbers, letters, and underscores.', NULL, NULL, '', 'LINE', NULL, 10, '', 'b36eef92b13f4d300e9128fa8b829d8c', '', NULL),
(4116, 'en', 'default', '7d150f25e6563473ebc64666237efb54', '<strong>ERROR</strong>: \"Table Prefix\" is invalid.', NULL, NULL, '', 'LINE', NULL, 10, '', 'a8b0f7cfdec390a2a79211fa262fccd6', '', NULL),
(4117, 'en', 'default', '1328acea61550ff5ec2e3025f0815942', '<strong>ERROR</strong>: \"Table Prefix\" must not be empty.', NULL, NULL, '', 'LINE', NULL, 10, '', '1970080cb53ab0fef931dc3601e9fc13', '', NULL),
(4118, 'en', 'default', '881815006609d34e07215728019253f8', '<strong>ERROR</strong>: Passwords may not contain the character \"\\\".', NULL, NULL, '', 'LINE', NULL, 10, '', 'b8a94917e225393c809afc968a530c56', '', NULL),
(4119, 'en', 'default', '7015bce91212ccb97c01670ea4114bdb', '<strong>ERROR</strong>: Please enter a nickname.', NULL, NULL, '', 'LINE', NULL, 10, '', '90b0199963b37d6472a3ed4b7ae18e1f', '', NULL),
(4120, 'en', 'default', 'bea96aebb50c876c1a95f41c49a3f3c9', '<strong>ERROR</strong>: Please enter a password.', NULL, NULL, '', 'LINE', NULL, 10, '', 'e8c3c68119915112d4130386ab6bb97d', '', NULL),
(4121, 'en', 'default', 'd15b5951c64392d97ca1e69fbd5d974e', '<strong>ERROR</strong>: Please enter an email address.', NULL, NULL, '', 'LINE', NULL, 10, '', 'e9ef1e8b9360dfae53505fe12b26e711', '', NULL),
(4122, 'en', 'default', 'ee9cd024fec5f5c83e08caabf9662327', '<strong>ERROR</strong>: Please enter the same password in both password fields.', NULL, NULL, '', 'LINE', NULL, 10, '', '89b1f6507cedd33fe4572fda596030b1', '', NULL),
(4123, 'en', 'default', '044f46e52ac3d0ba7f6b83fc33fc1b9d', '<strong>ERROR</strong>: options page not found.', NULL, NULL, '', 'LINE', NULL, 10, '', 'cfde005e3ca61e0c36826e8c152eb5e4', '', NULL),
(4124, 'en', 'default', '9b0ce93b03db1e1cd98decc6387fa90c', '<strong>Edit</strong> takes you to the editable profile screen for that user. You can also reach that screen by clicking on the username.', NULL, NULL, '', 'LINE', NULL, 10, '', '11696b2610f2bbca1738397defd5ba29', '', NULL),
(4125, 'en', 'default', '0bdd62cf14b1ac2df851e97eed7faa8c', '<strong>Edit</strong> takes you to the editing screen for that post. You can also reach that screen by clicking on the post title.', NULL, NULL, '', 'LINE', NULL, 10, '', '74deb9541548900791736df7e47727d1', '', NULL),
(4126, 'en', 'default', '1f831b9d55db2b6a19cc0944b6c697b4', '<strong>Error:</strong> Current PHP version does not meet minimum requirements for %s.', NULL, NULL, '', 'LINE', NULL, 10, '', '66ed9f9b410c5bbcd39150bcb1cc10db', '', NULL),
(4127, 'en', 'default', 'ea38f26a5df08f7b3c4622740d1e44b6', '<strong>Error:</strong> Current WordPress and PHP versions do not meet minimum requirements for %s.', NULL, NULL, '', 'LINE', NULL, 10, '', '1a649da9c6ea2d1b26058e3f3d8c7315', '', NULL),
(4128, 'en', 'default', '9d72e71c84b805f1782da570bb7836b1', '<strong>Error:</strong> Current WordPress version does not meet minimum requirements for %s.', NULL, NULL, '', 'LINE', NULL, 10, '', 'af458d26e84844789112dd450f070987', '', NULL),
(4129, 'en', 'default', 'ed2374f9d3ff94bdb484133a38cc6393', '<strong>Error:</strong> This plugin <strong>requires a newer version of PHP</strong>.', NULL, NULL, '', 'LINE', NULL, 10, '', 'b260f6763d9647dfaec623538113acd5', '', NULL),
(4130, 'en', 'default', 'ee44ff298965d7b09993a67601184216', '<strong>Error:</strong> This plugin <strong>requires a newer version of WordPress</strong>.', NULL, NULL, '', 'LINE', NULL, 10, '', '996ea00609b9a7b86c4e6169a592120c', '', NULL),
(4131, 'en', 'default', '1d667c275a75b28bd9a3d3befcc8d270', '<strong>Format</strong> &mdash; Post Formats designate how your theme will display a specific post. For example, you could have a <em>standard</em> blog post with a title and paragraphs, or a short <em>aside</em> that omits the title and contains a short text blurb. Please refer to the Codex for <a href=\"https://codex.wordpress.org/Post_Formats#Supported_Formats\">descriptions of each post format</a>. Your theme could enable all or some of 10 possible formats.', NULL, NULL, '', 'LINE', NULL, 10, '', 'a802c479a057bc8c8d3892f320b37b76', '', NULL),
(4132, 'en', 'default', 'd063063893ef546d984b1fdf20dcb5f1', '<strong>Important:</strong> Before updating, please <a href=\"https://codex.wordpress.org/WordPress_Backups\">back up your database and files</a>. For help with updates, visit the <a href=\"https://codex.wordpress.org/Updating_WordPress\">Updating WordPress</a> Codex page.', NULL, NULL, '', 'LINE', NULL, 10, '', 'fb8ffcf8d4f086cf2f64a15ba0ad1dfe', '', NULL),
(4133, 'en', 'default', 'adc736d6139e1287f1d9baaf718f5522', '<strong>Incompatible</strong> with your version of WordPress', NULL, NULL, '', 'LINE', NULL, 10, '', '13e0073401d88b673152424e5da67e61', '', NULL),
(4134, 'en', 'default', '996b2b4aa8413fcd0f6d148b2af946a6', '<strong>Info</strong> &mdash; The site URL is rarely edited as this can cause the site to not work properly. The Registered date and Last Updated date are displayed. Network admins can mark a site as archived, spam, deleted and mature, to remove from public listings or disable.', NULL, NULL, '', 'LINE', NULL, 10, '', '3d34da6684f8784cc40405ae4bc6550d', '', NULL),
(4135, 'en', 'default', '1c8ad85a1a29170a2c98285371e4ac2d', '<strong>Name</strong> &mdash; The name is how it appears on your site.', NULL, NULL, '', 'LINE', NULL, 10, '', '5febbe59b4e8c2b38e143b3cff8ae190', '', NULL),
(4136, 'en', 'default', 'dac04065919539b3bb81eb4152251ca4', '<strong>Order</strong> &mdash; Pages are usually ordered alphabetically, but you can choose your own order by entering a number (1 for first, etc.) in this field.', NULL, NULL, '', 'LINE', NULL, 10, '', 'f11c47af7f98788ea05b855c41902aa2', '', NULL),
(4137, 'en', 'default', '4ea8e185f297fa1e5706a8337719effe', '<strong>Parent</strong> &mdash; Categories, unlike tags, can have a hierarchy. You might have a Jazz category, and under that have child categories for Bebop and Big Band. Totally optional. To create a subcategory, just choose another category from the Parent dropdown.', NULL, NULL, '', 'LINE', NULL, 10, '', 'eec619c60b3b0a3e38f0069c120d2602', '', NULL),
(4138, 'en', 'default', '8f6225bd7662575ef84d375fec88dbd4', '<strong>Parent</strong> &mdash; You can arrange your pages in hierarchies. For example, you could have an &#8220;About&#8221; page that has &#8220;Life Story&#8221; and &#8220;My Dog&#8221; pages under it. There are no limits to how many levels you can nest pages.', NULL, NULL, '', 'LINE', NULL, 10, '', 'a7d363674bc0d711d6d160e3dbf13846', '', NULL),
(4139, 'en', 'default', 'd1bb204120db5310aec8f2490431cb76', '<strong>Please Note:</strong> Any customizations you have made to theme files will be lost. Please consider using <a href=\"%s\">child themes</a> for modifications.', NULL, NULL, '', 'LINE', NULL, 10, '', '04573092292e1d20b219c5d37cabb34e', '', NULL),
(4140, 'en', 'default', '91cc965a84f790ad2906d697f3119a1d', '<strong>Post editor</strong> &mdash; Enter the text for your post. There are two modes of editing: Visual and Text. Choose the mode by clicking on the appropriate tab.', NULL, NULL, '', 'LINE', NULL, 10, '', 'a0bfc377e504c07ae3b7b4ee7eb27344', '', NULL),
(4141, 'en', 'default', 'b807523847b38ac8553394a6e915ef62', '<strong>Preview</strong> will show you what your draft post will look like if you publish it. View will take you to your live site to view the post. Which link is available depends on your post&#8217;s status.', NULL, NULL, '', 'LINE', NULL, 10, '', 'feb9ddd4b67850aee6a2151805f1dfa8', '', NULL),
(4142, 'en', 'default', 'ad831971b7a4b43e2ef0d627e297902a', '<strong>Publish</strong> &mdash; You can set the terms of publishing your post in the Publish box. For Status, Visibility, and Publish (immediately), click on the Edit link to reveal more options. Visibility includes options for password-protecting a post or making it stay at the top of your blog indefinitely (sticky). The Password protected option allows you to set an arbitrary password for each post. The Private option hides the post from everyone except editors and administrators. Publish (immediately) allows you to set a future or past date and time, so you can schedule a post to be published in the future or backdate a post.', NULL, NULL, '', 'LINE', NULL, 10, '', 'ffea9d2f9ee57d2e3ab4a669c39607c5', '', NULL),
(4143, 'en', 'default', '66c7115df99c78b479de41aa41c142ae', '<strong>Quick Draft</strong> &mdash; Allows you to create a new post and save it as a draft. Also displays links to the 3 most recent draft posts you\'ve started.', NULL, NULL, '', 'LINE', NULL, 10, '', '7aa1d766cbdc5f0cea76bf50db690844', '', NULL),
(4144, 'en', 'default', '099f3df0632488f2c47e2658d95e0e76', '<strong>Quick Edit</strong> provides inline access to the metadata of your post, allowing you to update post details without leaving this screen.', NULL, NULL, '', 'LINE', NULL, 10, '', 'aec7db39f9755f7c2dc6e2b37c8412c2', '', NULL),
(4145, 'en', 'default', 'b7afe14ef93e550358d9308fbcdf9df0', '<strong>Random:</strong> Show a different image on each page.', NULL, NULL, '', 'LINE', NULL, 10, '', 'ba08a9ca69ff15ee804b268fc9029e72', '', NULL),
(4146, 'en', 'default', 'a7e4d48c9f714a92b5b5beb3db05ad38', '<strong>Remove</strong> allows you to remove a user from your site. It does not delete their content. You can also remove multiple users at once by using Bulk Actions.', NULL, NULL, '', 'LINE', NULL, 10, '', '5fe47707a48d7746511ccf9843929025', '', NULL),
(4147, 'en', 'default', 'a98be58ec342822c43f9a60f423b1d2f', '<strong>Screen Options</strong> &mdash; Use the Screen Options tab to choose which Dashboard boxes to show.', NULL, NULL, '', 'LINE', NULL, 10, '', 'ed407f0af001c6226b4cc9be2875d701', '', NULL),
(4148, 'en', 'default', 'd6ce148cfd01c369f1b23045e489b491', '<strong>Send Trackbacks</strong> &mdash; Trackbacks are a way to notify legacy blog systems that you&#8217;ve linked to them. Enter the URL(s) you want to send trackbacks. If you link to other WordPress sites they&#8217;ll be notified automatically using pingbacks, and this field is unnecessary.', NULL, NULL, '', 'LINE', NULL, 10, '', '0671b4a2f6125c4f545933974afb647d', '', NULL),
(4149, 'en', 'default', '0d7d65c866eb8c69ac9cb51558adfa14', '<strong>Settings</strong> &mdash; This page shows a list of all settings associated with this site. Some are created by WordPress and others are created by plugins you activate. Note that some fields are grayed out and say Serialized Data. You cannot modify these values due to the way the setting is stored in the database.', NULL, NULL, '', 'LINE', NULL, 10, '', 'd354fd7e8af531c92dc88db3ef74cfe4', '', NULL),
(4150, 'en', 'default', '411d40a6a21e11c47ed8adb1c92f00b0', '<strong>Slug</strong> &mdash; The &#8220;slug&#8221; is the URL-friendly version of the name. It is usually all lowercase and contains only letters, numbers, and hyphens.', NULL, NULL, '', 'LINE', NULL, 10, '', '97af8d8b956434fb602f37b6e0e53e27', '', NULL),
(4151, 'en', 'default', '597ef2b39aedb4e7f14e838eed92b8f7', '<strong>Template</strong> &mdash; Some themes have custom templates you can use for certain pages that might have additional features or custom layouts. If so, you&#8217;ll see them in this dropdown menu.', NULL, NULL, '', 'LINE', NULL, 10, '', '62319763264b08b9688c6a9f025316ba', '', NULL),
(4152, 'en', 'default', 'ce993a5f75691ce7176e73214153f067', '<strong>The parent theme could not be found.</strong> You will need to install the parent theme, %s, before you can use this child theme.', NULL, NULL, '', 'LINE', NULL, 10, '', 'b7bcb279eab6de0e2f5af6b67f2c9a78', '', NULL),
(4153, 'en', 'default', '83898cec1dbe4f4586c8347c1ba46120', '<strong>Themes and Plugins</strong> &mdash; To update individual themes or plugins from this screen, use the checkboxes to make your selection, then <strong>click on the appropriate &#8220;Update&#8221; button</strong>. To update all of your themes or plugins at once, you can check the box at the top of the section to select all before clicking the update button.', NULL, NULL, '', 'LINE', NULL, 10, '', '98ac0766c2d6280e0f1ccde117bde100', '', NULL),
(4154, 'en', 'default', 'b23e308c3f8aaf77e0abb955c2b42721', '<strong>Themes</strong> &mdash; This area shows themes that are not already enabled across the network. Enabling a theme in this menu makes it accessible to this site. It does not activate the theme, but allows it to show in the site&#8217;s Appearance menu. To enable a theme for the entire network, see the <a href=\"%s\">Network Themes</a> screen.', NULL, NULL, '', 'LINE', NULL, 10, '', 'e27f32c9e1231c938c359bd433295481', '', NULL),
(4155, 'en', 'default', '2d08934c32876d0e82311f1741b4e5cb', '<strong>Title</strong> &mdash; Enter a title for your post. After you enter a title, you&#8217;ll see the permalink below, which you can edit.', NULL, NULL, '', 'LINE', NULL, 10, '', 'caebf199686f82f701abc47dd032baad', '', NULL),
(4156, 'en', 'default', 'da5abbe81c1b1941c214b1b4298822cb', '<strong>Translations</strong> &mdash; The files translating WordPress into your language are updated for you whenever any other updates occur. But if these files are out of date, you can <strong>click the &#8220;Update Translations&#8221;</strong> button.', NULL, NULL, '', 'LINE', NULL, 10, '', 'd5ff3112c75a90a53ba4a28d043eb4a7', '', NULL),
(4157, 'en', 'default', '1ac12183049e2cd887bb8ee6b488d5fb', '<strong>Trash</strong> removes your post from this list and places it in the trash, from which you can permanently delete it.', NULL, NULL, '', 'LINE', NULL, 10, '', 'fb4aa500e080edf20572554e14786e36', '', NULL),
(4158, 'en', 'default', '55c1d7dcd5c13ba5790cecd4c6cbd55f', '<strong>Users</strong> &mdash; This displays the users associated with this site. You can also change their role, reset their password, or remove them from the site. Removing the user from the site does not remove the user from the network.', NULL, NULL, '', 'LINE', NULL, 10, '', '97df9b3590027eed340d84b2abc5d08c', '', NULL),
(4159, 'en', 'default', '497641b5542b22dc5d6854613073ad40', '<strong>Version %1$s</strong> addressed %2$s bug.', NULL, NULL, '', 'LINE', NULL, 10, '', 'c13c1e08ef6aba59e1f4b7bc1ad35bf6', '', NULL),
(4160, 'en', 'default', 'ccb459ea6dea3238d4dd526be26dba4c', '<strong>Version %1$s</strong> addressed %2$s bugs.', NULL, NULL, '', 'LINE', NULL, 10, '', '89b615edaedeab58df789dd5e3a74e4a', '', NULL),
(4161, 'en', 'default', 'df609ba9ff6d652262e61c635fd87422', '<strong>Version %1$s</strong> addressed a security issue and fixed %2$s bug.', NULL, NULL, '', 'LINE', NULL, 10, '', '22c02e594d318ed13d65a617083a91d5', '', NULL),
(4162, 'en', 'default', '3cd6f317f07bc2911eac401ef22b1d3b', '<strong>Version %1$s</strong> addressed a security issue and fixed %2$s bugs.', NULL, NULL, '', 'LINE', NULL, 10, '', '702eec6470f8061630a737f38d53f062', '', NULL),
(4163, 'en', 'default', '1a58444df6e0a3d5033b661fa156d96b', '<strong>Version %1$s</strong> addressed some security issues and fixed %2$s bug.', NULL, NULL, '', 'LINE', NULL, 10, '', '3f38810d492ca368a186acfdb13b89a8', '', NULL),
(4164, 'en', 'default', '06235b6f29533b9b5969b12a8df162d6', '<strong>Version %1$s</strong> addressed some security issues and fixed %2$s bugs.', NULL, NULL, '', 'LINE', NULL, 10, '', '92da042deabc0a6a3b2479b8c699289e', '', NULL),
(4165, 'en', 'default', '900bc9524d36e0e13350b3400873564a', '<strong>Version %s</strong> addressed one security issue.', NULL, NULL, '', 'LINE', NULL, 10, '', '9e6ee027d8f8ef6ac3d2721e1a9ab052', '', NULL),
(4166, 'en', 'default', 'd237445cc6aef6932337c278ff66b5c4', '<strong>Version %s</strong> addressed some security issues.', NULL, NULL, '', 'LINE', NULL, 10, '', '28e16bb0ce72b142e79721534f1d11d4', '', NULL),
(4167, 'en', 'default', 'e835b8952a95ab3be7ed03ae1e9cef3f', '<strong>Warning:</strong> Making changes to active plugins is not recommended.', NULL, NULL, '', 'LINE', NULL, 10, '', '35a819b6497bd40c58749e0c37477771', '', NULL),
(4168, 'en', 'default', '098c48c5729f2c05969e76c83d7a78f1', '<strong>Warning:</strong> This plugin <strong>has not been tested</strong> with your current version of WordPress.', NULL, NULL, '', 'LINE', NULL, 10, '', '6255349ca348aa4c9a4f66e18dade5d2', '', NULL),
(4169, 'en', 'default', '30afe4bb9e679217d99baf456b9d5040', '<strong>Warning:</strong> these pages should not be the same!', NULL, NULL, '', 'LINE', NULL, 10, '', '4619e75ddd04e800d7455d2f073e5de9', '', NULL),
(4170, 'en', 'default', '949100024350856bb528b654ef53952d', '<strong>Welcome</strong> &mdash; Shows links for some of the most common tasks when setting up a new site.', NULL, NULL, '', 'LINE', NULL, 10, '', 'e66eb81986125f51d693abfb956c7f9c', '', NULL),
(4171, 'en', 'default', 'c218af871a6a22a7734d3ee3064a2f9a', '<strong>WordPress Events and News</strong> &mdash; Upcoming events near you as well as the latest news from the official WordPress project and the <a href=\"%s\">WordPress Planet</a>.', NULL, NULL, '', 'LINE', NULL, 10, '', '8d0a1cdda55b132500a06507c4006c83', '', NULL),
(4172, 'en', 'default', '16fd34c3de2b02f60c7813d5965faecb', '<strong>WordPress</strong> &mdash; Updating your WordPress installation is a simple one-click procedure: just <strong>click on the &#8220;Update Now&#8221; button</strong> when you are notified that a new version is available.', NULL, NULL, '', 'LINE', NULL, 10, '', 'a2c5ffc4b69c8d049bce519b8013c8cb', '', NULL),
(4173, 'en', 'default', '459529cb17a99023264d9b9b8e52807b', 'A <a href=\"%s\">static page</a> (select below)', NULL, NULL, '', 'LINE', NULL, 10, '', '2dae67149a0c83cafc62b410a003bdb7', '', NULL),
(4174, 'en', 'default', 'db634e627e0dab10a2c2c5bfd6dbfe5b', 'A WordPress Commenter', NULL, NULL, '', 'LINE', NULL, 10, '', '77778e3ac6cc342254126d436f98eaa3', '', NULL),
(4175, 'en', 'default', '8bc56041a7b8d37f96d33b8227481393', 'A comment is held for moderation', NULL, NULL, '', 'LINE', NULL, 10, '', '99b721a49dba40cee44debcdc719a8b5', '', NULL),
(4176, 'en', 'default', 'de063749d3eece31d00861a3fbe3312f', 'A new minor update is available for your site. Because minor updates often address security, it&#8217;s important to install them.', NULL, NULL, '', 'LINE', NULL, 10, '', 'dd286e0a62e75574dcfd76cece0376c7', '', NULL),
(4177, 'en', 'default', 'ca7caae8e8f7f4583f848e93f162e296', 'A new theme page template, a conditional function, and two CSS classes make designing and customizing the Privacy Policy page easier.', NULL, NULL, '', 'LINE', NULL, 10, '', '4dc0865bdb03a5da22eb133f298ff81c', '', NULL),
