(4377, 'en', 'default', 'a9aaa5a8c454b3604df40c08faf864cb', 'By default WordPress does not collect any analytics data. However, many web hosting accounts collect some anonymous analytics data. You may also have installed a WordPress plugin that provides analytics services. In that case, add information from that plugin here.', NULL, NULL, '', 'LINE', NULL, 10, '', 'bbb10dc461ad05c0ba1743dbb84c6a33', '', NULL),
(4378, 'en', 'default', 'a4de3012edb9e615cba657b2fb29dd24', 'By default WordPress does not collect any personal data about visitors, and only collects the data shown on the User Profile screen from registered users. However some of your plugins may collect personal data. You should add the relevant information below.', NULL, NULL, '', 'LINE', NULL, 10, '', 'eec5f990e54f0d488c9668381d51ec1c', '', NULL),
