(4380, 'en', 'default', 'bdcc5a96190089ab92a53a42910fc9d7', 'By default, WordPress does not include a contact form. If you use a contact form plugin, use this subsection to note what personal data is captured when someone submits a contact form, and how long you keep it. For example, you may note that you keep contact form submissions for a certain period for customer service purposes, but you do not use the information submitted through them for marketing purposes.', NULL, NULL, '', 'LINE', NULL, 10, '', '2f597e938edf13361bdf1cde1770b525', '', NULL),
