(4847, 'en', 'default', '7df8c03809c80a271f542c76f62d1d25', 'For most themes, the header text is your Site Title and Tagline, as defined in the <a href=\"%1$s\">General Settings</a> section.', NULL, NULL, '', 'LINE', NULL, 10, '', '82077081f37f84dc1106cdd57eb80624', '', NULL),
(4848, 'en', 'default', '8a9f8ce95fbcd456affde59d95cb711d', 'For optimal performance and security reasons, we recommend running %1$s version %2$s or higher. Contact your web hosting company to correct this.', NULL, NULL, '', 'LINE', NULL, 10, '', '0338cdd51a941acf99da57531306adf1', '', NULL),
(4849, 'en', 'default', '522aadf23f305abae106a83bf430576e', 'For users that register on our website (if any), we also store the personal information they provide in their user profile. All users can see, edit, or delete their personal information at any time (except they cannot change their username). Website administrators can also see and edit that information.', NULL, NULL, '', 'LINE', NULL, 10, '', 'e72f6eaabce2f1292d15c25394db0b83', '', NULL),
(4850, 'en', 'default', '32e5f7255250a5e23f4672a6f164bdc7', 'For users without a custom avatar of their own, you can either display a generic logo or a generated one based on their email address.', NULL, NULL, '', 'LINE', NULL, 10, '', '87ca0cc0d960d1d6488de47b7a94c570', '', NULL),
