(4925, 'en', 'default', '632c0917647dd5a8d9d2d13fd0a50715', 'Hovering over a row reveals action links: Edit, Delete Permanently, and View. Clicking Edit or on the media file&#8217;s name displays a simple screen to edit that individual file&#8217;s metadata. Clicking Delete Permanently will delete the file from the media library (as well as from any posts to which it is currently attached). View will take you to the display page for that file.', NULL, NULL, '', 'LINE', NULL, 10, '', '23728fec8d33e5d227e28bc54683c37a', '', NULL),
