(4930, 'en', 'default', 'c225085d6572d117fe4d677b76e52312', 'Howdy ###USERNAME###,\\n\\nYou recently clicked the \'Delete Site\' link on your site and filled in a\\nform on that page.\\n\\nIf you really want to delete your site, click the link below. You will not\\nbe asked to confirm again so only click this link if you are absolutely certain:\\n###URL_DELETE###\\n\\nIf you delete your site, please consider opening a new site here\\nsome time in the future! (But remember your current site and username\\nare gone forever.)\\n\\nThanks for using the site,\\nWebmaster\\n###SITE_NAME###', NULL, NULL, '', 'LINE', NULL, 10, '', '6f2fbe189c44ab8d50a5c0dfd718502f', '', NULL),
(4931, 'en', 'default', '6ac9551847a5df4e8a6ce78dcea1ae5b', 'Howdy ###USERNAME###,\\n\\nYou recently requested to have the administration email address on\\nyour site changed.\\n\\nIf this is correct, please click on the following link to change it:\\n###ADMIN_URL###\\n\\nYou can safely ignore and delete this email if you do not want to\\ntake this action.\\n\\nThis email has been sent to ###EMAIL###\\n\\nRegards,\\nAll at ###SITENAME###\\n###SITEURL###', NULL, NULL, '', 'LINE', NULL, 10, '', 'f8d4ed8542927878c766489d9084fda3', '', NULL),
