(4934, 'en', 'default', '60d97f3583f770229990ed5aeffaeb96', 'However, it is your responsibility to use those resources correctly, to provide the information that your Privacy Policy requires, and to keep that information current and accurate.', NULL, NULL, '', 'LINE', NULL, 10, '', '9f68c1ce495b76c67c63a4680e89b0de', '', NULL),
