(5030, 'en', 'default', 'e1dfb497476f0a6e455ddb6047f848b5', 'In Response To', NULL, NULL, '', 'LINE', NULL, 10, '', 'd425082429a45be4be9073e15857377f', '', NULL),
(5031, 'en', 'default', '17a1938167ced1f88fb79a72a323dd0e', 'In a few words, explain what this site is about.', NULL, NULL, '', 'LINE', NULL, 10, '', 'da803f748d1b750af858c087f83cd4f8', '', NULL),
(5032, 'en', 'default', 'ac9a4d2e8722460793b93d7d7ceeb7a5', 'In addition to listing what personal data you collect, you need to note why you collect it. These explanations must note either the legal basis for your data collection and retention or the active consent the user has given.', NULL, NULL, '', 'LINE', NULL, 10, '', 'adcb013b4f3ca5b3df135d1b9f0798fb', '', NULL),
(5033, 'en', 'default', '911b598e98c0d31c7e5bdfd6e1136dbc', 'In all likelihood, these items were supplied to you by your Web Host. If you don&#8217;t have this information, then you will need to contact them before you can continue. If you&#8217;re all ready&hellip;', NULL, NULL, '', 'LINE', NULL, 10, '', '01afe2a4a10214c1f8f359b9da7a694c', '', NULL),
(5034, 'en', 'default', '72247007ca8dd9d5b747cd2d13855ae4', 'In most cases, WordPress will automatically apply maintenance and security updates in the background for you.', NULL, NULL, '', 'LINE', NULL, 10, '', 'f608b0ae3b2099cd13950879df8872a3', '', NULL),
(5035, 'en', 'default', '0278248c794c7dd11a47837d5861ee71', 'In previous versions of WordPress, all importers were built-in. They have been turned into plugins since most people only use them once or infrequently.', NULL, NULL, '', 'LINE', NULL, 10, '', '43ae0cedba6e9504ba24d8691432a3a9', '', NULL),
(5036, 'en', 'default', '5c43aa88fc70f0b190b05aafdc6ba900', 'In reply to %s.', NULL, NULL, '', 'LINE', NULL, 10, '', '9ec9ce045b44687da826fd1655ccc31e', '', NULL),
(5037, 'en', 'default', '69321db1494e9c628339738471d30cd6', 'In reply to: %s', NULL, NULL, '', 'LINE', NULL, 10, '', 'e317e41d013bb01c8a6e55a8e04779ab', '', NULL),
(5038, 'en', 'default', 'd32e65d44fb05ccf2bed3709f468c87c', 'In response to: %s', NULL, NULL, '', 'LINE', NULL, 10, '', 'e5423df2364e9344c0a8102a2aee538a', '', NULL),
(5039, 'en', 'default', 'ddfa3b051bb82c9c70d438b8e5871308', 'In the <strong>Author</strong> column, in addition to the author&#8217;s name, email address, and blog URL, the commenter&#8217;s IP address is shown. Clicking on this link will show you all the comments made from this IP address.', NULL, NULL, '', 'LINE', NULL, 10, '', '944f932d0423b726bd23dab71fea8505', '', NULL),
(5040, 'en', 'default', '78516f0126f95864e9dd3d48b6d7504f', 'In the <strong>Comment</strong> column, hovering over any comment gives you options to approve, reply (and approve), quick edit, edit, spam mark, or trash that comment.', NULL, NULL, '', 'LINE', NULL, 10, '', '68411cf81ef029f42a0ec46594a3f9c0', '', NULL),
(5041, 'en', 'default', '6d7053230d152b1bbde8e0e11985e6cd', 'In the <strong>In Response To</strong> column, there are three elements. The text is the name of the post that inspired the comment, and links to the post editor for that entry. The View Post link leads to that post on your live site. The small bubble with the number in it shows the number of approved comments that post has received. If there are pending comments, a red notification circle with the number of pending comments is displayed. Clicking the notification circle will filter the comments screen to show only pending comments on that post.', NULL, NULL, '', 'LINE', NULL, 10, '', 'a0b6f98a1737347916c97d5e7392c2d6', '', NULL),
(5042, 'en', 'default', '75a9d96583454bb73d919516b14c1020', 'In the <strong>Submitted On</strong> column, the date and time the comment was left on your site appears. Clicking on the date/time link will take you to that comment on your live site.', NULL, NULL, '', 'LINE', NULL, 10, '', 'c7841636b76ce9101ba9cc808e1096e5', '', NULL),
(5043, 'en', 'default', 'a1e79989a368fffa040f3724cb25bb0a', 'In the Header Text section of this page, you can choose whether to display this text or hide it. You can also choose a color for the text by clicking the Select Color button and either typing in a legitimate HTML hex value, e.g. &#8220;#ff0000&#8221; for red, or by choosing a color using the color picker.', NULL, NULL, '', 'LINE', NULL, 10, '', 'bef7f0dcaa96c84388ca68674dbeea63', '', NULL),
(5044, 'en', 'default', 'bb1232b0272e71fd61576bb759fe4fcb', 'In this section you should explain how long you retain personal data collected or processed by the web site. While it is your responsibility to come up with the schedule of how long you keep each dataset for and why you keep it, that information does need to be listed here. For example, you may want to say that you keep contact form entries for six months, analytics records for a year, and customer purchase records for ten years.', NULL, NULL, '', 'LINE', NULL, 10, '', 'ab44f2d90a4122efb4d73b1271ddcd1e', '', NULL);
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `wrap_tag`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `translation_priority`, `word_count`) VALUES
(5045, 'en', 'default', '9f2feaf2b829a5c3749cb3a0dec950a7', 'In this section you should explain what measures you have taken to protect your users&#8217; data. This could include technical measures such as encryption; security measures such as two factor authentication; and measures such as staff training in data protection. If you have carried out a Privacy Impact Assessment, you can mention it here too.', NULL, NULL, '', 'LINE', NULL, 10, '', '447f7c9e79da2eaf80b14485c81eef4a', '', NULL),
(5046, 'en', 'default', 'cc868b88b34779f820016d60eeb4d13f', 'In this section you should explain what procedures you have in place to deal with data breaches, either potential or real, such as internal reporting systems, contact mechanisms, or bug bounties.', NULL, NULL, '', 'LINE', NULL, 10, '', '2e2f9f76d2e53db3e5050f6eed876131', '', NULL),
(5047, 'en', 'default', '7b43f0a3a9bad71b5515c3febf1c4e85', 'In this section you should explain what rights your users have over their data and how they can invoke those rights.', NULL, NULL, '', 'LINE', NULL, 10, '', '1d494e615fc6d7af13588575aa5f764a', '', NULL),
(5048, 'en', 'default', 'e033cd0f72a714684763bb3b10497ef1', 'In this section you should list all transfers of your site data outside the European Union and describe the means by which that data is safeguarded to European data protection standards. This could include your web hosting, cloud storage, or other third party services.', NULL, NULL, '', 'LINE', NULL, 10, '', '6bab02ff41df219f416fc29c55fd9271', '', NULL),
(5049, 'en', 'default', '88afac7dd32e40bf990b8d3423dfcb5e', 'In this section you should name and list all third party providers with whom you share site data, including partners, cloud-based services, payment processors, and third party service providers, and note what data you share with them and why. Link to their own privacy policies if possible.', NULL, NULL, '', 'LINE', NULL, 10, '', 'bc39528f72dd657a817abfe0e70fa67f', '', NULL),
(5050, 'en', 'default', 'afb5c651f25a99fe9dea21458989b965', 'In this section you should note what personal data you collect from users and site visitors. This may include personal data, such as name, email address, personal account preferences; transactional data, such as purchase information; and technical data, such as information about cookies.', NULL, NULL, '', 'LINE', NULL, 10, '', '55364a8c7c34dcaec179a49ce5feb8ac', '', NULL),
(5051, 'en', 'default', '36ce374000d338cd986460ce312bcae5', 'In this section you should note your site URL, as well as the name of the company, organization, or individual behind it, and some accurate contact information.', NULL, NULL, '', 'LINE', NULL, 10, '', '3ee9c2dd60584a7dde9b3eda4294c2d0', '', NULL),
(5052, 'en', 'default', '562b66a0805d1853fa06902cdb6774d5', 'In this section you should provide a contact method for privacy-specific concerns. If you are required to have a Data Protection Officer, list their name and full contact details here as well.', NULL, NULL, '', 'LINE', NULL, 10, '', 'b783b38f8b0382d31f2e0d6b68dc26ff', '', NULL),
(5053, 'en', 'default', 'ca3d5159accd9468729ea6a9aef4d58e', 'In this subsection you should list the cookies your web site uses, including those set by your plugins, social media, and analytics. We have provided the cookies which WordPress installs by default.', NULL, NULL, '', 'LINE', NULL, 10, '', 'a7aa56fcc29c49d74ac60bfadbb28ae7', '', NULL),
(5054, 'en', 'default', '48ac74d87e61fcb5c2adf64ca48cf64e', 'In this subsection you should note what analytics package you use, how users can opt out of analytics tracking, and a link to your analytics provider&#8217;s privacy policy, if any.', NULL, NULL, '', 'LINE', NULL, 10, '', 'ef6c1a3649fca4635c6d724a7e8e9440', '', NULL),
(5055, 'en', 'default', 'b619d7c9609b9d7b1ca3e6bfbcf5309e', 'In this subsection you should note what information is captured through comments. We have noted the data which WordPress collects by default.', NULL, NULL, '', 'LINE', NULL, 10, '', 'cdf36a9314632abfed28786bb7267047', '', NULL),
(5056, 'en', 'default', 'ec27ccde34cd289565d2db48b580f59b', 'In this subsection you should note what information may be disclosed by users who can upload media files. All uploaded files are usually publicly accessible.', NULL, NULL, '', 'LINE', NULL, 10, '', '2c605f73abd62a98d1527efab250fad6', '', NULL),
(5057, 'en', 'default', '1da0f24e118e98984a0dddbce260a839', 'Inactive <span class=\"count\">(%s)</span>', NULL, NULL, '', 'LINE', NULL, 10, '', '228fd3a7482d619ab08b0cc0d79bf92d', '', NULL),
(5058, 'en', 'default', 'e21472cab8e84362a190860f8d57200e', 'Inactive Plugins', NULL, NULL, '', 'LINE', NULL, 10, '', 'a890d783fc98916756c55879625ea9f8', '', NULL),
(5059, 'en', 'default', '2b255e45a58c340b56395c76e9221392', 'Inactive Sidebar (not used)', NULL, NULL, '', 'LINE', NULL, 10, '', '237b2839b63defb85f31315d3fcf1019', '', NULL),
(5060, 'en', 'default', 'ac6105c895cb6dcf75c78c53450b8a02', 'Inactive Widgets', NULL, NULL, '', 'LINE', NULL, 10, '', 'c522f6f2f38c5fe50947cad10691b443', '', NULL),
(5061, 'en', 'default', '5bfbab4b8ab39c894d2404942189c47c', 'Inactive plugins are tempting targets for attackers. If you&#8217;re not going to use a plugin, we recommend you remove it.', NULL, NULL, '', 'LINE', NULL, 10, '', 'b09fcb1b946fd60091a0bd0c8e2002e8', '', NULL),
