(5107, 'en', 'default', 'b6ebcb00f592534cb127c0e3d1520c72', 'Invitation email sent to new user. A confirmation link must be clicked before their account is created.', NULL, NULL, '', 'LINE', NULL, 10, '', '4d05c2e0b4d4bcfacb0fbfc0c0c317d8', '', NULL),
