(5109, 'en', 'default', '752c2496b46acd34c1fed7d8dfebb545', 'Is SUHOSIN installed?', NULL, NULL, '', 'LINE', NULL, 10, '', '100ae494e47db760ae9b592b32d387a8', '', NULL),
(5110, 'en', 'default', '6de04b798d1131b2afd72567ddca8548', 'Is the Imagick library available?', NULL, NULL, '', 'LINE', NULL, 10, '', 'ce9f9934cdccb36dd7cb79d488f9d09c', '', NULL),
(5111, 'en', 'default', 'f8719d9976aec6a9f7b9970f4f1e9dd0', 'Is this a multisite?', NULL, NULL, '', 'LINE', NULL, 10, '', 'c2133112bb13e1e474a92b628b2dd899', '', NULL),
(5112, 'en', 'default', 'cf5c9a91eb28225ab9b96bb23f30d0eb', 'Is this site using HTTPS?', NULL, NULL, '', 'LINE', NULL, 10, '', '7a91843354ed140f1b5e4d2f7ab1fb36', '', NULL),
(5113, 'en', 'default', '362a3f109b087a05aa2d582a0a5a66b9', 'It is possible for site maintainers to block all, or some, communication to other sites and services. If set up incorrectly, this may prevent plugins and themes from working as intended.', NULL, NULL, '', 'LINE', NULL, 10, '', '7e37c28b37a06531d8b7900c0ecb8eda', '', NULL),
(5114, 'en', 'default', '0faffb1c747898e4afa868bc8f21f2aa', 'It is up to search engines to honor this request.', NULL, NULL, '', 'LINE', NULL, 10, '', 'c72a8720da879c98db8a82f389bde2a9', '', NULL),
(5115, 'en', 'default', 'be29271b2c444adcbb3d4a177d896577', 'It is your responsibility to write a comprehensive privacy policy, to make sure it reflects all national and international legal requirements on privacy, and to keep your policy current and accurate.', NULL, NULL, '', 'LINE', NULL, 10, '', '86f5e107c5dcb7b5a7252b404751da5a', '', NULL),
(5116, 'en', 'default', 'e3e14c60ee779095c00b5ea7974e94e5', 'It looks like you\'re using an insecure version of %s. Using an outdated browser makes your computer unsafe. For the best WordPress experience, please update your browser.', NULL, NULL, '', 'LINE', NULL, 10, '', '175f70cc7ecf9778da276940cd1bd3fb', '', NULL),
(5117, 'en', 'default', 'd14a69e8400ff0a7bb4b6e59b1788f59', 'It looks like you\'re using an old version of %s. For the best WordPress experience, please update your browser.', NULL, NULL, '', 'LINE', NULL, 10, '', 'c38a9f0445fd5bcaedb4f7fbb353cebd', '', NULL),
