(5471, 'en', 'default', 'e1916cef029819b6d0ac661ba113c382', 'Plugins extend your site&#8217;s functionality with things like contact forms, ecommerce and much more. That means they have deep access to your site, so it&#8217;s vital to keep them up to date.', NULL, NULL, '', 'LINE', NULL, 10, '', 'fa2c9f8af01810e901c2d82a826cb1e8', '', NULL),
