(5858, 'en', 'default', 'eb75d61c0d32edf7f02ac4b9245e9066', 'Tap or hover on any theme then click the Live Preview button to see a live preview of that theme and change theme options in a separate, full-screen view. You can also find a Live Preview button at the bottom of the theme details screen. Any installed theme can be previewed and customized in this way.', NULL, NULL, '', 'LINE', NULL, 10, '', '6f6504bc3b2a415851941dc76f520261', '', NULL),
