(5860, 'en', 'default', '6f3dfb9b486505e02c34ff3f5f28c3da', 'Thank you for Updating! Please visit the <a href=\"%s\">Upgrade Network</a> page to update all your sites.', NULL, NULL, '', 'LINE', NULL, 10, '', '0bef3c48618fe1470758e2a5f2b75daf', '', NULL),
