(5896, 'en', 'default', '9056bf97881e293b7bb2104070a0ca56', 'The REST API is available', NULL, NULL, '', 'LINE', NULL, 10, '', '2abba9fcd17588afcaf425696445eb88', '', NULL),
(5897, 'en', 'default', '6a61a1c2681c9e2ac5b18075363064a1', 'The REST API is one way WordPress, and other applications, communicate with the server. One example is the block editor screen, which relies on this to display, and save, your posts and pages.', NULL, NULL, '', 'LINE', NULL, 10, '', '7be4a4e7fef38a46f204e6b6392eef75', '', NULL),
(5898, 'en', 'default', 'b4f56ad126d61efd33f4087d2db41180', 'The REST API request failed due to an error.', NULL, NULL, '', 'LINE', NULL, 10, '', 'f89e7725ee917abd8c34c4619442ec54', '', NULL),
(5899, 'en', 'default', '161eeb341bb2b52c23412256a4af2833', 'The SQL server is a required piece of software for the database WordPress uses to store all your site&#8217;s content and settings.', NULL, NULL, '', 'LINE', NULL, 10, '', '8ed56db5804a6f693492b7b8a78802d3', '', NULL),
(5900, 'en', 'default', 'bc102454910b3e9559abe6016a25550d', 'The Site Health check requires JavaScript.', NULL, NULL, '', 'LINE', NULL, 10, '', '6ecf812b234640a2ed8dbda2ef01e947', '', NULL),
(5901, 'en', 'default', '2bc6f983917576292a23bcbf9c5ecf74', 'The Text mode allows you to enter HTML along with your post text. Note that &lt;p&gt; and &lt;br&gt; tags are converted to line breaks when switching to the Text editor to make it less cluttered. When you type, a single line break can be used instead of typing &lt;br&gt;, and two line breaks instead of paragraph tags. The line breaks are converted back to tags automatically.', NULL, NULL, '', 'LINE', NULL, 10, '', '6822422cfd888b5560ab16ce486fcf0f', '', NULL),
(5902, 'en', 'default', '62457c7b06e9492db136c612087a8636', 'The Theme Installer screen requires JavaScript.', NULL, NULL, '', 'LINE', NULL, 10, '', 'ee81cae6fee978a72094c23881080975', '', NULL),
(5903, 'en', 'default', 'fa7710958d9308b31dfb35c7cd561c36', 'The Walker class named %s does not exist.', NULL, NULL, '', 'LINE', NULL, 10, '', '34054a8dc59b2133208d8c72fc61addb', '', NULL),
