(6068, 'en', 'default', '962c28891ea0971c27aec3bfc1781b57', 'These websites may collect data about you, use cookies, embed additional third-party tracking, and monitor your interaction with that embedded content, including tracking your interaction with the embedded content if you have an account and are logged in to that website.', NULL, NULL, '', 'LINE', NULL, 10, '', '07835bfb9b2600b722360fd372e71ff1', '', NULL),
(6069, 'en', 'default', '48d76421889fcdd81e6920d7875576cb', 'Thirteen new icons include Instagram, a suite of icons for BuddyPress, and rotated Earth icons for global inclusion. Find them in the Dashboard and have some fun!', NULL, NULL, '', 'LINE', NULL, 10, '', 'd6b442d3f6e0384310baa2e4ee470d5a', '', NULL),
