(6071, 'en', 'default', '8bdc95a2f11c754b36eef70a9946d3a3', 'This address is used for admin purposes. If you change this we will send you an email at your new address to confirm it. <strong>The new address will not become active until confirmed.</strong>', NULL, NULL, '', 'LINE', NULL, 10, '', 'c804e70303da038835cc1a8a2e3c3692', '', NULL),
(6072, 'en', 'default', '25ab9c32f964611f61b510b52a2d5031', 'This administrator-focused update will let you safely fix or manage fatal errors without requiring a developer. It features better handling of the so-called “white screen of death”, and a way to enter recovery mode, which pauses error-causing plugins or themes.', NULL, NULL, '', 'LINE', NULL, 10, '', '895ffb68ba5f7ad10d1e5d8ac114b9c7', '', NULL),
