(6164, 'en', 'default', '273ac586f8c89c098004a170ce915f8b', 'To reorganize menu items, <strong>drag and drop items with your mouse or use your keyboard</strong>. Drag or move a menu item a little to the right to make it a submenu', NULL, NULL, '', 'LINE', NULL, 10, '', 'dd26b4f2b1809abb4425114eedd4128c', '', NULL),
