(6169, 'en', 'default', 'b5f53d7f307b7ddcbbac8315d4ed8790', 'To use a background image, simply upload it or choose an image that has already been uploaded to your Media Library by clicking the &#8220;Choose Image&#8221; button. You can display a single instance of your image, or tile it to fill the screen. You can have your background fixed in place, so your site content moves on top of it, or you can have it scroll with your site.', NULL, NULL, '', 'LINE', NULL, 10, '', 'c22df4156e105bc49b789d0823f23726', '', NULL),
(6170, 'en', 'default', 'e51c94c86c384530e3ad332d097b6603', 'To use a subdomain configuration, you must have a wildcard entry in your DNS. This usually means adding a %s hostname record pointing at your web server in your DNS configuration tool.', NULL, NULL, '', 'LINE', NULL, 10, '', '64d9bea83b4e45f17b66cc34219d7594', '', NULL),
