(6393, 'en', 'default', 'a898fa08a0cadfff38577d1a8d36312d', 'What&#8217;s the difference between categories and tags? Normally, tags are ad-hoc keywords that identify important information in your post (names, subjects, etc) that may or may not recur in other posts, while categories are pre-determined sections. If you think of your site like a book, the categories are like the Table of Contents and the tags are like the terms in the index.', NULL, NULL, '', 'LINE', NULL, 10, '', '4d97505e61693c0a1aac1b958fe094ac', '', NULL),
(6394, 'en', 'default', '57be9d8bfc6aa5405ee07e7e6ea8b1db', 'When a comment contains any of these words in its content, name, URL, email, or IP address, it will be held in the <a href=\"edit-comments.php?comment_status=moderated\">moderation queue</a>. One word or IP address per line. It will match inside words, so &#8220;press&#8221; will match &#8220;WordPress&#8221;.', NULL, NULL, '', 'LINE', NULL, 10, '', '343323210a62576dc544083b735d8e11', '', NULL),
(6395, 'en', 'default', 'd21b8704fed13b5c39fc8a6550bc3d00', 'When a comment contains any of these words in its content, name, URL, email, or IP address, it will be put in the trash. One word or IP address per line. It will match inside words, so &#8220;press&#8221; will match &#8220;WordPress&#8221;.', NULL, NULL, '', 'LINE', NULL, 10, '', '5a3725e25fc2fad6528b6af775d54386', '', NULL),
(6396, 'en', 'default', '16eb38b0466b758e83ffc1afb65bc986', 'When adding a new category on this screen, you&#8217;ll fill in the following fields:', NULL, NULL, '', 'LINE', NULL, 10, '', '8348240c846a4cb879a67a7a1e6818ca', '', NULL),
(6397, 'en', 'default', '370c15874bf89814187701866c485c9e', 'When adding a new tag on this screen, you&#8217;ll fill in the following fields:', NULL, NULL, '', 'LINE', NULL, 10, '', '2c226506d0afbbba1a770a535751b268', '', NULL),
(6398, 'en', 'default', '7703983ef109c52a423492c4bfa5ffbe', 'When changing themes, there is often some variation in the number and setup of widget areas/sidebars and sometimes these conflicts make the transition a bit less smooth. If you changed themes and seem to be missing widgets, scroll down on this screen to the Inactive Widgets area, where all of your widgets and their settings will have been saved.', NULL, NULL, '', 'LINE', NULL, 10, '', 'a4018b4b9fa0ad74ac664770d4fa25bd', '', NULL),
(6399, 'en', 'default', '91015d74131523d75c8ee1d82db9e132', 'When previewing on smaller monitors, you can use the collapse icon at the bottom of the left-hand pane. This will hide the pane, giving you more room to preview your site in the new theme. To bring the pane back, click on the collapse icon again.', NULL, NULL, '', 'LINE', NULL, 10, '', 'ec0c3d224b684a115d955d14d78a3c2b', '', NULL),
(6400, 'en', 'default', '4210a86ca0a86ebdf5712c60c47a01ca', 'When this setting is in effect, a reminder is shown in the At a Glance box of the Dashboard that says, &#8220;Search Engines Discouraged,&#8221; to remind you that your site is not being crawled.', NULL, NULL, '', 'LINE', NULL, 10, '', '33960768ca0efb2109671f1ab02318f6', '', NULL),
(6401, 'en', 'default', '4fd5e879927f19de076cca45bc59434a', 'When using Bulk Edit, you can change the metadata (categories, author, etc.) for all selected posts at once. To remove a post from the grouping, just click the x next to its name in the Bulk Edit area that appears.', NULL, NULL, '', 'LINE', NULL, 10, '', 'd70e008926f797f7fa73820eeb9729d4', '', NULL),
(6402, 'en', 'default', 'b18d07e59a875a4350e8cfa10509c5d7', 'When visitors leave comments on the site we collect the data shown in the comments form, and also the visitor&#8217;s IP address and browser user agent string to help spam detection.', NULL, NULL, '', 'LINE', NULL, 10, '', 'da2d58e7f047ffb8843c16d6ddf10432', '', NULL),
(6403, 'en', 'default', 'cd8d1a19831be7da0547b6a5fcf33156', 'When you assign multiple categories or tags to a post, only one can show up in the permalink: the lowest numbered category. This applies if your custom structure includes <code>%category%</code> or <code>%tag%</code>.', NULL, NULL, '', 'LINE', NULL, 10, '', '898670c2e52a88ad0454c93711770605', '', NULL),
(6404, 'en', 'default', '2a668b1b4a5c8a0d7d6ccc363cf266a7', 'When you click the button below WordPress will create an XML file for you to save to your computer.', NULL, NULL, '', 'LINE', NULL, 10, '', '3d57ff833f4fae8a369e17d3f5cce00d', '', NULL),
(6405, 'en', 'default', '85540ae266a03383e65007e160616c39', 'When you log in, we will also set up several cookies to save your login information and your screen display choices. Login cookies last for two days, and screen options cookies last for a year. If you select &quot;Remember Me&quot;, your login will persist for two weeks. If you log out of your account, the login cookies will be removed.', NULL, NULL, '', 'LINE', NULL, 10, '', '82da5429bc5561bbe23b1b043e08de1a', '', NULL),
(6406, 'en', 'default', '1d7b8a30c545e74f35989943383cf0ca', 'When you publish a new post, WordPress automatically notifies the following site update services. For more about this, see <a href=\"%s\">Update Services</a> on the Codex. Separate multiple service URLs with line breaks.', NULL, NULL, '', 'LINE', NULL, 10, '', '74a6be1a7662948445cd005231dd2d0e', '', NULL),
(6407, 'en', 'default', 'f65db9877ae1e39281b94e525393d1a1', 'When you\'ve been able to update using the \"Update Now\" button on Dashboard > Updates, we\'ll clear this error for future update attempts.', NULL, NULL, '', 'LINE', NULL, 10, '', 'cd73932b110a44e84a737b62a820170b', '', NULL),
