(6410, 'en', 'default', 'a038eafad9e01988c1841de565372b3d', 'While you are editing your %1$s file, take a moment to make sure you have all 8 keys and that they are unique. You can generate these using the <a href=\"%2$s\">WordPress.org secret key service</a>.', NULL, NULL, '', 'LINE', NULL, 10, '', '8b4c653c9278b9bdbfe1b5afec5a7663', '', NULL),
