(6415, 'en', 'default', '5f71bda8d746f5a38f8be090639b5e2f', 'Widgets are independent sections of content that can be placed into any widgetized area provided by your theme (commonly called sidebars). To populate your sidebars/widget areas with individual widgets, drag and drop the title bars into the desired area. By default, only the first widget area is expanded. To populate additional widget areas, click on their title bars to expand them.', NULL, NULL, '', 'LINE', NULL, 10, '', '2628ac04367ef5339322e23a38240fb5', '', NULL),
(6416, 'en', 'default', '2a1b56a60634250cd6cf205c74ed00c6', 'Widgets may be used multiple times. You can give each widget a title, to display on your site, but it&#8217;s not required.', NULL, NULL, '', 'LINE', NULL, 10, '', 'cb26d608dcaf5e53bfdccbb076ee7f6b', '', NULL),
(6417, 'en', 'default', '575e46c5cef48f4edd8c7ee2f9162927', 'With the addition of webpack and Babel configurations in the @wordpress/scripts package, developers won&#8217;t have to worry about setting up complex build tools to write modern JavaScript.', NULL, NULL, '', 'LINE', NULL, 10, '', 'f04e2f7a9ebb1f98868f1fe74b06dc6d', '', NULL),
