(6434, 'en', 'default', '33c13135df9264a73a6958ca2ae370f5', 'WordPress can also attempt to optimize the database. This improves performance in some situations. Repairing and optimizing the database can take a long time and the database will be locked while optimizing.', NULL, NULL, '', 'LINE', NULL, 10, '', '83b16757e71c057b4ab547e2625df230', '', NULL),
