(6443, 'en', 'default', '924b4ada54bcaa491660c0f5f200b5dd', 'WordPress has been updated! Before we send you on your way, we have to update your database to the newest version.', NULL, NULL, '', 'LINE', NULL, 10, '', '3c03c037f9d0fb84ed283d222a10bfeb', '', NULL),
