(6445, 'en', 'default', 'c668e665e9e32510727aad114c1f4b31', 'WordPress has detected that your site is running on an outdated version of PHP.', NULL, NULL, '', 'LINE', NULL, 10, '', '7c0794e1735d0c79353b935f136b4896', '', NULL),
(6446, 'en', 'default', '87488821d95fad046e6934ba9a27f016', 'WordPress is Free and open source software, built by a distributed community of mostly volunteer developers from around the world. WordPress comes with some awesome, worldview-changing rights courtesy of its <a href=\"%s\">license</a>, the GPL.', NULL, NULL, '', 'LINE', NULL, 10, '', '32bda0a1395f3a803bf05a0164f36dee', '', NULL),
(6447, 'en', 'default', 'ba5a6fbddf1b8a34c5384891c777374f', 'WordPress is at the latest version.', NULL, NULL, '', 'LINE', NULL, 10, '', 'c4ecb640802ec497b6f8133c3ef076ff', '', NULL),
(6448, 'en', 'default', '98139c5279fc772772d86ebf86967fbf', 'WordPress is created by a <a href=\"%1$s\">worldwide team</a> of passionate individuals. <a href=\"%2$s\">Get involved in WordPress</a>.', NULL, NULL, '', 'LINE', NULL, 10, '', '3731b77e9b5aaccad48ba29b43de7270', '', NULL),
(6449, 'en', 'default', '82f771478b6cafba7b96c61a3299c075', 'WordPress is created by a worldwide team of passionate individuals.', NULL, NULL, '', 'LINE', NULL, 10, '', '01c7f502da6911611ca2c5ec1747b156', '', NULL),
(6450, 'en', 'default', '4b8a79aa611a3d5388694ff8ce54bdfb', 'WordPress is not notifying any <a href=\"%1$s\">Update Services</a> because of your site&#8217;s <a href=\"%2$s\">visibility settings</a>.', NULL, NULL, '', 'LINE', NULL, 10, '', 'ad7215a97613adc28341716934624415', '', NULL),
(6451, 'en', 'default', '002ed833af5d0c8a84bbc41ef94724dc', 'WordPress offers you the ability to create a custom URL structure for your permalinks and archives. Custom URL structures can improve the aesthetics, usability, and forward-compatibility of your links. A <a href=\"%s\">number of tags are available</a>, and here are some examples to get you started.', NULL, NULL, '', 'LINE', NULL, 10, '', '4ca5dedd93f643351f1ca0a14baf5b97', '', NULL),
(6452, 'en', 'default', '35075ebfb88a039c3b60fe4283948b31', 'WordPress requires %1$s version %2$s or higher. Contact your web hosting company to correct this.', NULL, NULL, '', 'LINE', NULL, 10, '', '3ae77c586b6b3df2fd082ca559c6a26b', '', NULL),
(6453, 'en', 'default', 'c1f30757544463210a8bbdd9ce2b3a98', 'WordPress security and maintenance releases are blocked by %s.', NULL, NULL, '', 'LINE', NULL, 10, '', 'e7d7ef9e61bb6e02d96703951a8a9618', '', NULL),
(6454, 'en', 'default', 'a14d9e5e4155f1be815c48a099297535', 'WordPress security and maintenance releases are blocked by the %s filter.', NULL, NULL, '', 'LINE', NULL, 10, '', '929c81bb8931e4e2f22ce9af6c8e4677', '', NULL),
(6455, 'en', 'default', '145e951a918d629a05851929a786f394', 'WordPress should correct invalidly nested XHTML automatically', NULL, NULL, '', 'LINE', NULL, 10, '', '2bd8338d56622879b225e000f36be25b', '', NULL),
