(6459, 'en', 'default', '5d125704820af3706084ab214495c191', 'WordPress version %s', NULL, NULL, '', 'LINE', NULL, 10, '', '0e779ee7804180445bb443d60b2625d9', '', NULL),
(6460, 'en', 'default', 'a763ee301ed6c50b308cb85e7c1e6458', 'WordPress&#8217; utf8mb4 support requires MariaDB version %s or greater. Please contact your server administrator.', NULL, NULL, '', 'LINE', NULL, 10, '', '739e7603541d6df858ca5746509be3f3', '', NULL),
(6461, 'en', 'default', '67d93d5146ac28da29e6214b196c58ea', 'WordPress&#8217; utf8mb4 support requires MySQL client library (%1$s) version %2$s or newer. Please contact your server administrator.', NULL, NULL, '', 'LINE', NULL, 10, '', 'ffc06fc338548599cb8c5c992db6b54b', '', NULL),
