(6596, 'en', 'default', '5e1d755e43145fcf50b50f74de799f9d', 'You have the latest version of WordPress.', NULL, NULL, '', 'LINE', NULL, 10, '', 'ff2d031a36ae6ec0c3e8a4fe8fffee07', '', NULL),
(6597, 'en', 'default', '8da867ed2d60f83f0a853175b9e845cc', 'You have themes waiting to be updated', NULL, NULL, '', 'LINE', NULL, 10, '', 'f114073ef9f46e084dde065406337aae', '', NULL),
(6598, 'en', 'default', '910de734a93033bfae5c872ab94014de', 'You have version %1$s installed. Update to %2$s.', NULL, NULL, '', 'LINE', NULL, 10, '', '0a67da94779d8b09e9a300e81f18970e', '', NULL),
(6599, 'en', 'default', '9afc94ea9920155044857e2a6f58559a', 'You may also browse based on the most popular tags in the Plugin Directory:', NULL, NULL, '', 'LINE', NULL, 10, '', 'b266bcecfb6fce486a0191acd42470dc', '', NULL),
(6600, 'en', 'default', 'b9209ebd71e334a6b5c114b956bd04ba', 'You must be a member of at least one site to use this page.', NULL, NULL, '', 'LINE', NULL, 10, '', '138a858bcaed698543f788e5f8bd74d4', '', NULL),
