(439, 446, 'he', 0, NULL, '<strong>Conflicting values for the constants VHOST and SUBDOMAIN_INSTALL.</strong> The value of SUBDOMAIN_INSTALL will be assumed to be your subdomain configuration setting.', NULL, '', 0, '2019-08-27 12:05:13'),
(440, 447, 'he', 0, NULL, '<strong>אתר %1$s לא נמצא.</strong> בוצע חיפוש טבלת %2$s במסד הנתונים %3$s. זה נשמע נכון?', NULL, '', 0, '2019-08-27 12:05:13'),
(441, 448, 'he', 0, NULL, '<strong>חסרות טבלאות במסד הנתונים.</strong> זה אומר ש-MySQL לא פועל, שוורדפרס לא הותקנה כהלכה, או שהטבלאות הבאות פשוט נמחקו: %s. כדאי לבדוק מה קורה עם מסד הנתונים בהקדם האפשרי.', NULL, '', 0, '2019-08-27 12:05:13'),
(442, 449, 'he', 0, NULL, '<strong>שגיאה</strong>: %1$s בקובץ %2$s יכול להכיל רק מספרים, אותיות וקווים תחתונים.', NULL, '', 0, '2019-08-27 12:05:13'),
(443, 450, 'he', 0, NULL, '<strong>שגיאה</strong>: העוגיות חסומות עקב פלט לא צפוי. לעזרה ראו <a href=\"%1$s\">תיעוד</a> או נסו את <a href=\"%2$s\">פורום התמיכה</a>.', NULL, '', 0, '2019-08-27 12:05:13'),
(444, 451, 'he', 0, NULL, '<strong>שגיאה</strong>: העוגיות חסומות או לא נתמכות על ידי הדפדפן. יש <a href=\"%s\">להפעיל עוגיות</a> כדי להשתמש בוורדפרס.', NULL, '', 0, '2019-08-27 12:05:13'),
(445, 452, 'he', 0, NULL, '<strong>שגיאה</strong>: הרישום נכשל&hellip; יש ליצור קשר עם <a href=\"mailto:%s\">מנהל האתר</a> !', NULL, '', 0, '2019-08-27 12:05:13'),
(446, 453, 'he', 0, NULL, '<strong>שגיאה</strong>: יש להזין שם משתמש או כתובת אימייל.', NULL, '', 0, '2019-08-27 12:05:13'),
