(1529, 1536, 'he', 0, NULL, 'שלום ###USERNAME###,\n\nלאחרונה ביקשת לשנות את כתובת האימייל בחשבונך.\n\nאם זה נכון, לחץ על הקישור הבא כדי לשנות אותו:\n###ADMIN_URL###\n\nאם אינך רוצה לנקוט בפעולה, ניתן להתעלם בבטחה מהאימייל ולמחוק אותו.\n\nאימייל זה נשלח אל ###EMAIL###\n\nבברכה,\nצוות ###SITENAME###\n###SITEURL###', NULL, '', 0, '2019-08-27 12:05:13'),
