(1533, 1540, 'he', 0, NULL, 'שלום,\n\nהחל מגרסה 5.2 של וורדפרס קיים מנגנון המזהה כאשר תוספים או תבניות גורמות לשגיאות חמורות באתר, ומודיע באמצעות הודעת אימייל אוטומטית.\n\n###CAUSE###\n\nתחילה יש לבקר באתר (###SITEURL###) ולבדוק בעיות בצורה ויזואליות. בשלב הבא יש לגשת לעמוד בו התרחשה השגיאה (###PAGEURL###) ולבדוק בעיות בצורה ויזואליות.\n\n###SUPPORT###\n\nאם האתר לא עובד ולא ניתן לגשת ללוח הבקרה, וורדפרס מציע \"מצב התאוששות\" המאפשר להתחבר בצורה בטוחה ללוח הבקרה ולחקור את הבעיה.\n\n###LINK###\n\nכדי לשמור על אתר מאובטח, קישור זה יפוג תוך ###EXPIRES###. אל תדאגו, קישור חדש ישלח באימייל אם השגיאה תתרחש שוב אחרי שהקישור יפוג.\n\n###DETAILS###', NULL, '', 0, '2019-08-27 12:05:13'),
(1534, 1541, 'he', 0, NULL, 'שלום,\n\nהתקבלה בקשה לביצוע הפעולה הבאה בחשבונך:\n\n     ###DESCRIPTION###\n\nלאישור, לחץ על הקישור הבא:\n###CONFIRM_URL###\n\nבאפשרותך להתעלם בבטחה מהודעה זו ולמחוק אותה אם אינך רוצה לבצע פעולה זו.\n\nבברכה, \nצוות ###SITENAME###\n###SITEURL###', NULL, '', 0, '2019-08-27 12:05:13'),
