(1550, 1557, 'he', 0, NULL, 'ID צריך להתחיל באות, אחריה אותיות, מספרים, מקפים, נקודות, נקודותיים, או קווים תחתונים.', NULL, '', 0, '2019-08-27 12:05:13'),
(1551, 1558, 'he', 0, NULL, 'אם לא רצית לאפס את סיסמתך, התעלם מהודעה זו ושום דבר לא יקרה.', NULL, '', 0, '2019-08-27 12:05:13'),
(1552, 1559, 'he', 0, NULL, 'אם משתמשים בוידאו, התמונה תוצג בזמן העלאת הוידאו.', NULL, '', 0, '2019-08-27 12:05:13'),
(1553, 1560, 'he', 0, NULL, 'אם הינך הבעלים של הרשת, אנא בדוק כי MySQL עובד כנדרש וכי אין בו שגיאות.', NULL, '', 0, '2019-08-27 12:05:13'),
(1554, 1561, 'he', 0, NULL, 'אם האתר לא יופעל בתוך יומיים, ההרשמה תבוטל - אבל תמיד אפשר להתחיל את ההרשמה מחדש.', NULL, '', 0, '2019-08-27 12:05:13'),
(1555, 1562, 'he', 0, NULL, 'אם החשבון לא יופעל בתוך יומיים, ההרשמה תבוטל - אבל תמיד אפשר להתחיל את ההרשמה מחדש.', NULL, '', 0, '2019-08-27 12:05:13'),
(1556, 1563, 'he', 0, NULL, 'אם אינך יודע איך ליצור מסדי נתונים, יש <strong>ליצור קשר עם ספק האיחסון</strong>. אם שום דבר לא עזר, ניתן למצוא עזרה <a href=\"%s\">בפורום התמיכה של וורדפרס</a>.', NULL, '', 0, '2019-08-27 12:05:13'),
(1557, 1564, 'he', 0, NULL, 'אם האימייל עדיין לא הגיע, יש כמה דברים שאפשר לעשות:', NULL, '', 0, '2019-08-27 12:05:13'),
(1558, 1565, 'he', 0, NULL, 'אם ברצונך להדביק טקסט עשיר מקובץ וורד, נסה לכבות את האפשרות הזו. העורך ינקה אוטומטית טקסט שמודבק מקובץ וורד.', NULL, '', 0, '2019-08-27 12:05:13'),
(1559, 1566, 'he', 0, NULL, 'אם יש לך דומיין טוב שלא נמצא בשימוש, אפשר לפנות אותו לטובת משתמשים אחרים.', NULL, '', 0, '2019-08-27 12:05:13'),
(1560, 1567, 'he', 0, NULL, 'יש לבדוק שהטבלאות הבאות קיימות במסד הנתונים:', NULL, '', 0, '2019-08-27 12:05:13'),
(1561, 1568, 'he', 0, NULL, 'אם אינך בטוח מה משמעות המונחים הללו, סביר להניח שאתה צריך ליצור קשר עם ספק האכסון שלך. אם אתה עדיין זקוק לעזרה אתה תמיד יכול לבקר <a href=\"%s\">פורום התמיכה של וורדפרס</a>.', NULL, '', 0, '2019-08-27 12:05:13'),
(1562, 1569, 'he', 0, NULL, 'אם האתר לא מוצג, יש ליצור קשר עם בעל הרשת.', NULL, '', 0, '2019-08-27 12:05:13'),
(1563, 1570, 'he', 0, NULL, 'אם התבנית כוללת תפריטים מרובים, מתן שמות ברורים יעזור לנהל אותם.', NULL, '', 0, '2019-08-27 12:05:13'),
(1564, 1571, 'he', 0, NULL, 'אם לתבנית יש אזורי וידג\'טים, ניתן להוסיף תפריטים מכאן. בקרו ב<a href=\"%s\">תפריט הוידג\'טים</a> והוסיפו \"וידג\'ט תפריטים\" כדי להציג תפריטים בסרגלי צד ובפוטר.', NULL, '', 0, '2019-08-27 12:05:13'),
