(4090, 4097, 'he', 0, NULL, '<code>_none</code> - אותו החלון או הלשונית.', NULL, '', 0, '2019-08-27 12:05:14'),
(4091, 4098, 'he', 0, NULL, '<code>_top</code> - החלון או הלשונים הנוכחיים, ללא מסגרות.', NULL, '', 0, '2019-08-27 12:05:14'),
(4092, 4099, 'he', 0, NULL, '<span>פעיל:</span> %s', NULL, '', 0, '2019-08-27 12:05:14'),
(4093, 4100, 'he', 0, NULL, '<strong>%s</strong> - בתיבה זו אפשר לשייך לפוסט תמונה מבלי להוסיף אותה לתוכן הפוסט. אפשרות זו שימושית רק אם התבנית תומכת בתמונות ראשיות, ומציגה אותן בעמוד הראשי, בעמודי ארכיון, בכותרת או במקומות אחרים.', NULL, '', 0, '2019-08-27 12:05:14'),
(4094, 4101, 'he', 0, NULL, '<strong><em>כדאי לזכור את הסיסמה</em></strong>. זאת סיסמה <em>אקראית</em> שנוצרה במיוחד עבורך.', NULL, '', 0, '2019-08-27 12:05:14'),
(4095, 4102, 'he', 0, NULL, '<strong>פעילות</strong> - מציג פוסטים מתוזמנים, פוסטים שפורסמו לאחרונה, תגובות אחרונות ומאפשר לאשר או למחוק אותן בקלות.', NULL, '', 0, '2019-08-27 12:05:14'),
(4096, 4103, 'he', 0, NULL, '<strong>שימו לב:</strong> ביצוע שינויים בתבנית שפועלת כרגע באתר עלולה להוביל לקריסת האתר.', NULL, '', 0, '2019-08-27 12:05:14'),
(4097, 4104, 'he', 0, NULL, '<strong>מבט כללי</strong> - מציג תקציר מסכם של התכנים באתר ומזהה את שם התבנית וגרסת הוורדפרס המפעילה את האתר.', NULL, '', 0, '2019-08-27 12:05:14'),
(4098, 4105, 'he', 0, NULL, '<strong>בקרת תיבות</strong> - לחיצה על שורת הכותרת של התיבה מרחיבה או מכווצת אותה. תיבות המתווספות על ידי תוספים חיצוניים עשויות להכיל אפשרויות להגדרות מתקדמות, במקרה כזה אם מרחפים על הכותרת יוצג קישור \"הגדרות\".', NULL, '', 0, '2019-08-27 12:05:14'),
(4099, 4106, 'he', 0, NULL, '<strong>לחיצה על החץ משמאל לכל פריט בתפריט</strong> יציג קבוצה של הגדרות בסיסיות. ניתן להפעיל הגדרות מתקדמות כגון יעד קישור, מחלקות CSS, יחסי קישור, ותיאורי קישור באמצעות כרטיסיית אפשרויות תצוגה.', NULL, '', 0, '2019-08-27 12:05:14'),
(4100, 4107, 'he', 0, NULL, '<strong>תואם</strong> לגרסת הוורדפרס הנוכחית.', NULL, '', 0, '2019-08-27 12:05:14'),
(4101, 4108, 'he', 0, NULL, '<strong>חיבור אבד.</strong> לא ניתן לשמור עד שהחיבור ישוב.', NULL, '', 0, '2019-08-27 12:05:14'),
(4102, 4109, 'he', 0, NULL, '<strong>מחיקה</strong> תוביל למסך מחיקת המשתמשים לאישור סופי, שם ניתן למחוק משתמש ואת כל התוכן שלו לצמיתות. ניתן למחוק גם מספר משתמשים בבת אחת על ידי שימוש בעריכה קבוצתית.', NULL, '', 0, '2019-08-27 12:05:14'),
(4103, 4110, 'he', 0, NULL, '<strong>תיאור</strong> - התיאור לא תמיד מוצג באתר, אבל תבניות מסויימות עשויות להציג אותו.', NULL, '', 0, '2019-08-27 12:05:14'),
(4104, 4111, 'he', 0, NULL, '<strong>דיון</strong> - ניתן לשלוט על אפשרויות הדיון בפוסט, ואם קיימות תגובות לפוסט ניתן לראות אותן ולערוך אותן.', NULL, '', 0, '2019-08-27 12:05:14'),
(4105, 4112, 'he', 0, NULL, '<strong>גרור ושחרר</strong> - כדי לארגן מחדש את תיבות התוכן, יש לגרור ולשחרר אותן על ידי לחיצה על שורת הכותרת של התיבה ולשחרר אותה במיקום הרצוי במלבן האפור עם המסגרת המנוקדות.', NULL, '', 0, '2019-08-27 12:05:14'),
(4106, 4113, 'he', 0, NULL, '<strong>גרור ושחרר</strong> את הקבצים לאזור למטה. ניתן לגרור מספר קבצים ביחד.', NULL, '', 0, '2019-08-27 12:05:14'),
(4107, 4114, 'he', 0, NULL, '<strong>שגיאה:</strong> אירעה שגיאה במהלך התחברות לשרת, יש לוודא שההגדרות נכונות.', NULL, '', 0, '2019-08-27 12:05:14'),
(4108, 4115, 'he', 0, NULL, '<strong>שגיאה</strong>: \"קידומת טבלה\" יכולה לכלול רק ספרות, אותיות באנגלית, וקוים תחתונים.', NULL, '', 0, '2019-08-27 12:05:14'),
(4109, 4116, 'he', 0, NULL, '<strong>שגיאה</strong>: \"קידומת טבלה\" שגויה.', NULL, '', 0, '2019-08-27 12:05:14'),
(4110, 4117, 'he', 0, NULL, '<strong>שגיאה</strong>: \"קידומת טבלה\" לא יכולה להיות ריקה.', NULL, '', 0, '2019-08-27 12:05:14'),
(4111, 4118, 'he', 0, NULL, '<strong>שגיאה</strong>: לא ניתן להשתמש בתו \"\\\" בסיסמאות.', NULL, '', 0, '2019-08-27 12:05:14'),
(4112, 4119, 'he', 0, NULL, '<strong>שגיאה</strong>: נא להזין כינוי.', NULL, '', 0, '2019-08-27 12:05:14'),
(4113, 4120, 'he', 0, NULL, '<strong>שגיאה</strong>: נא להזין סיסמה.', NULL, '', 0, '2019-08-27 12:05:14'),
(4114, 4121, 'he', 0, NULL, '<strong>שגיאה</strong>: נא להזין כתובת אימייל.', NULL, '', 0, '2019-08-27 12:05:14'),
(4115, 4122, 'he', 0, NULL, '<strong>שגיאה</strong>: נא להזין סיסמה זהה בשני השדות.', NULL, '', 0, '2019-08-27 12:05:14'),
(4116, 4123, 'he', 0, NULL, '<strong>שגיאה</strong>: עמוד ההגדות לא נמצא.', NULL, '', 0, '2019-08-27 12:05:14'),
(4117, 4124, 'he', 0, NULL, '<strong>עריכה</strong> מובילה למסך עריכת פרופיל המשתמש. ניתן להגיע למסך זה גם על ידי לחיצה על שם המשתמש.', NULL, '', 0, '2019-08-27 12:05:14'),
(4118, 4125, 'he', 0, NULL, '<strong>עריכה</strong> מובילה למסך עריכת הפוסט. ניתן להגיע למסך זה גם על ידי לחיצה עם כותרת הפוסט.', NULL, '', 0, '2019-08-27 12:05:14'),
(4119, 4126, 'he', 0, NULL, '<strong>שגיאה:</strong> הגירסה הנוכחית של PHP אינה עומדת בדרישות המינימום עבור %s.', NULL, '', 0, '2019-08-27 12:05:14'),
(4120, 4127, 'he', 0, NULL, '<strong>שגיאה:</strong> הגירסה הנוכחית של וורדפרס ו-PHP אינה עומדת בדרישות המינימום עבור %s.', NULL, '', 0, '2019-08-27 12:05:14'),
(4121, 4128, 'he', 0, NULL, '<strong>שגיאה:</strong> הגירסה הנוכחית של וורדפרס אינה עומדת בדרישות המינימום עבור %s.', NULL, '', 0, '2019-08-27 12:05:14'),
(4122, 4129, 'he', 0, NULL, '<strong>שגיאה:</strong> תוסף זה דורש <strong>גרסה חדשה של PHP</strong>.', NULL, '', 0, '2019-08-27 12:05:14'),
(4123, 4130, 'he', 0, NULL, '<strong>שגיאה:</strong> תוסף זה דורש <strong>גרסה חדשה של וורדפרס</strong>.', NULL, '', 0, '2019-08-27 12:05:14'),
(4124, 4131, 'he', 0, NULL, '<strong>פורמט</strong> - פורמט מגדיר איך התבנית תציג את תוכן. לדוגמא, בפוסט <em>רגיל</em> עם כותרת ופסקאות תוכן, או <em>הערה</em> המציג כותרת ותוכן מקוצר. למידע נוסף אודות <a href=\"https://codex.wordpress.org/Post_Formats#Supported_Formats\">הפורמטים השונים</a> ראו בקודקס. התבנית יכולה לתמוך בכל הפורמטים או רק בחלק מהפורמטים הזמינים.', NULL, '', 0, '2019-08-27 12:05:14'),
(4125, 4132, 'he', 0, NULL, '<strong>חשוב:</strong> לפני השדרוג, מומלץ <a href=\"https://codex.wordpress.org/WordPress_Backups\">לגבות את הקבצים ואת מסד הנתונים</a>. מידע נוסף על שדרוגים נמצא בעמוד <a href=\"https://codex.wordpress.org/Updating_WordPress\">Updating WordPress</a> בקודקס.', NULL, '', 0, '2019-08-27 12:05:14'),
(4126, 4133, 'he', 0, NULL, '<strong>אינו תואם</strong> לגרסת הוורדפרס הנוכחית.', NULL, '', 0, '2019-08-27 12:05:14'),
(4127, 4134, 'he', 0, NULL, '<strong>מידע</strong> &mdash; כתובת האתר של האתר משתנה לעתים נדירות, מכיוון שהדבר עלול לגרום לכך שהאתר יפסיק לפעול כשורה. תאריך הרישום והתאריך המעודכן האחרון מוצגים. מנהלי רשת יכולים לסמן כל אתר כשמור בארכיון (לא פעיל), תוכן זבל (ספאם), נמחק, או כמתאים למבוגרים בלבד על מנת להסיר אותו מרשימות ציבוריות או להשבית אותו.', NULL, '', 0, '2019-08-27 12:05:14'),
(4128, 4135, 'he', 0, NULL, '<strong>שם</strong> - השם שיוצג באתר.', NULL, '', 0, '2019-08-27 12:05:14'),
(4129, 4136, 'he', 0, NULL, '<strong>סדר</strong> - כברירת מחדל, עמודים מסודרים בסדר אלפביתי, לפי שמם. בשדה זה ניתן להגדיר סידור חלופי, בו העמודים יסודרו לפי המספר שיוגדר לכל אחד.', NULL, '', 0, '2019-08-27 12:05:14'),
(4130, 4137, 'he', 0, NULL, '<strong>הורה</strong> - קטגוריות, בניגוד לתגיות, תומכות במבנה היררכי. לדוגמה, יכולה להיות קטגוריה \"מוזיקה\", ותחתיה תת-קטגוריות \"רוק\" או \"פופ\". אופציונלי לחלוטין. כדי ליצור תת-קטגוריה, יש לבחור לה קטגוריית הורה.', NULL, '', 0, '2019-08-27 12:05:14'),
(4131, 4138, 'he', 0, NULL, '<strong>הורה</strong> - ניתן לסדר את העמודים בעץ היררכי. לדוגמה יכול להיות עמוד &quot;אודות&quot; שתחתיו עמוד &quot;סיפור חיי&quot; ותחתיו עמוד &quot;הכלב שלי&quot;. אין מגבלה על גודל העץ או עומק ההיררכיה.', NULL, '', 0, '2019-08-27 12:05:14'),
(4132, 4139, 'he', 0, NULL, '<strong>שימו לב:</strong> אם ביצעתם שינויים בקבצי התבנית, הם ימחקו במהלך השדרוג. לשינוי התבנית, מומלץ ליצור <a href=\"%s\">תבנית-בת</a>.', NULL, '', 0, '2019-08-27 12:05:14'),
(4133, 4140, 'he', 0, NULL, '<strong>עורך פוסטים</strong> - משמש להזנת תכנים. קיימים שני מצבי עריכה, עורך טקסט ועורך ויזואלי. ניתן לבחור את מצב העריכה באמצעות הקלקה על הטאב המתאים.', NULL, '', 0, '2019-08-27 12:05:14'),
(4134, 4141, 'he', 0, NULL, '<strong>תצוגה מקדימה</strong> מציגה את הטיוטה באתר כדי שנוכל לראות איך התוכן יראה באתר. הצג יעביר אותך לאתר כדי להציג את התוכן. איזה קישור, תצוגה מקדימה או הצג, תלוי במצב הפוסט.', NULL, '', 0, '2019-08-27 12:05:14'),
(4135, 4142, 'he', 0, NULL, '<strong>פרסום</strong> &mdash; תיבת הפרסום מאפשרת לקבוע את מאפייני הפוסט ותנאי הפרסום. להגדת מצב, תצוגה, פרסום (מיידי), יש ללחוץ על קישור העריכה כדי לחשוף אפשרויות נוספות. התצוגה כוללת אפשרויות שימוש בסיסמה להגנה על פוסט או להדביק אותו לחלק העליון של הבלוג. הגנה בסיסמה מאפשרת להגדיר סיסמא שרירותית להצגת התכנים. תצוגה פרטית מסתירה את ההודעה מכולם למעט עורכים ומנהלים. פרסום (מיידי) מאפשר להגדיר תאריך בעתיד או בעבר, לתזמן פוסט להתפרסם בעתיד או לתארך פוסטים לאחור.', NULL, '', 0, '2019-08-27 12:05:14'),
(4136, 4143, 'he', 0, NULL, '<strong>טיוטה מהירה</strong> - מאפשר ליצור פוסט חדש ולשמור אותו כטיוטה. כמו כן, מציג את שלושת הטיוטות האחרונות באתר.', NULL, '', 0, '2019-08-27 12:05:14'),
(4137, 4144, 'he', 0, NULL, '<strong>עריכה מהירה</strong> מאפשרת גישה מהירה למידע אודות הפוסט, כדי לעדכן אותו מבלי לעזוב מסך זה.', NULL, '', 0, '2019-08-27 12:05:14'),
(4138, 4145, 'he', 0, NULL, '<strong>אקראי</strong>: הצג בכל פעם תמונה אחרת.', NULL, '', 0, '2019-08-27 12:05:14'),
(4139, 4146, 'he', 0, NULL, '<strong>הסרה</strong> מאפשרת להסיר משתמש מהאתר. הפעולה אינה מוחקת את התוכן של המשתמש. ניתן גם להסיר משתמשים מרובים בבת אחת באמצעות עריכה קבוצתית.', NULL, '', 0, '2019-08-27 12:05:14'),
(4140, 4147, 'he', 0, NULL, '<strong>אפשרויות תצוגה</strong> - יש להשתמש בלשונית אפשרויות תצוגה כדי לבחור אילו וידג\'טים יופיעו בלוח הבקרה.', NULL, '', 0, '2019-08-27 12:05:14'),
(4141, 4148, 'he', 0, NULL, '<strong>לשלוח טראקבאקים</strong> - טראקבאקים מאפשרים להודיע לאתרים, שלא תומכים בפינגבאקים, שקישרת אליהם. אם קישרת לאתרים שפועלים על וורדפרס או על כל מערכת אחרת שתומכת בפינגבאקים, הם יקבלו פינגבאק באופן אוטומאטי. אין צורך לשלוח טראקבאקים לאתרים כאלה.', NULL, '', 0, '2019-08-27 12:05:14'),
(4142, 4149, 'he', 0, NULL, '<strong>הגדרות</strong>  &mdash; עמוד זה מציג רשימה של כל ההגדרות המשויכות לאתר זה. חלקם נוצרו על ידי וורדפרס ואחרים נוצרים על ידי תוספים הפעילים באתר. שימו לב שחלק מהשדות אפורים ומציינים שהנתונים שמורים בסדרה (Serialized). לא ניתן לשנות ערכים אלה עקב האופן שבו מאוחסנת ההגדרה במסד הנתונים.', NULL, '', 0, '2019-08-27 12:05:14'),
(4143, 4150, 'he', 0, NULL, '<strong>מזהה לכתובת</strong> - השם שיזהה את הפריט בכתובות ה-URL. המזהה יכול להכיל רק אותיות, מספרים, ומקפים.', NULL, '', 0, '2019-08-27 12:05:14'),
(4144, 4151, 'he', 0, NULL, '<strong>תבנית</strong> - לתבניות מסוימות יש עיצובים לעמודים מיוחדים, עם מאפיינים מיוחדים או תצוגה מותאמת. הם המכונים \"תבניות עמוד\". אם התבנית מגיעה עם \"תבניות עמוד\" כאלה, הן תופענה כאן.', NULL, '', 0, '2019-08-27 12:05:14'),
(4145, 4152, 'he', 0, NULL, '<strong>תבנית האם לא נמצאה.</strong> יש להתקין את תבנית האם, %s, לפני השימוש בתבנית בת.', NULL, '', 0, '2019-08-27 12:05:14'),
(4146, 4153, 'he', 0, NULL, '<strong>תבניות ותוספים</strong> &mdash; כדי לשדרג תבניות בודדות או תוספים ממסך זה, יש להשתמש בתיבות הסימון כדי לבצע את הבחירה, ואז <strong>ללחוץ על כפתור השדרוג</strong>. כדי לעדכן את כל התבניות והתוספים בפעם אחת, ניתן לסמן את התיבה בחלק העליון של הסעיף כדי לבחור את כל הפריטים וללחוץ על כפתור השדרוג.', NULL, '', 0, '2019-08-27 12:05:14'),
(4147, 4154, 'he', 0, NULL, '<strong>תבניות</strong> &mdash; אזור זה מציג תבינות שאינן פעילות עדיין ברשת האתרים. הפעלת תבנית בתפריט זה הופכת אותה לזמינה באתר זה, אך לא מפעילה את התבנית באתר, אלא מאפשרת לתבנית להופיע בתפריט \'עיצוב\' של האתר. להפעלת תבנית עבור כל הרשת, ראה את מסך <a href=\"%s\">תבניות ברשת</a>.', NULL, '', 0, '2019-08-27 12:05:14'),
(4148, 4155, 'he', 0, NULL, '<strong>כותרת</strong> - כותרת הפוסט. אחרי הזנת הכותרת, יופיע מתחתיה קישור ישיר לפוסט, אשר ניתן לעריכה גם הוא.', NULL, '', 0, '2019-08-27 12:05:14'),
(4149, 4156, 'he', 0, NULL, '<strong>קבצי תרגום</strong> &mdash;  קבצי תרגום בהתקנות וורדפרס מתעדכנים בכל פעם שמתרחש שדרוג כלשהו. אולם, אם קבצים אלה אינם מעודכנים, ניתן לבצע עדכון יזום תוך לחיצה על הכפתור <strong>שדרוג קבצי תרגום</strong>.', NULL, '', 0, '2019-08-27 12:05:14'),
(4150, 4157, 'he', 0, NULL, '<strong>פח</strong> מאפשר להעביר את הפוסטים מרשימה זו מבלי למחוק אותם. מחיקת הפוסטים לצמיתות מתבצעת מהפח.', NULL, '', 0, '2019-08-27 12:05:14'),
(4151, 4158, 'he', 0, NULL, '<strong>משתמשים</strong> &mdash; מסך זה מציג משתמשים המשוייכים לאתר. ניתן לשנות את התפקיד שלהם, לאפס את הסיסמה שלהם, או להסיר אותם מהאתר. הסרת משתמש מאתר מסוים אינו מסירה אותו מכל רשת האתרים.', NULL, '', 0, '2019-08-27 12:05:14'),
(4152, 4159, 'he', 0, NULL, '<strong>גרסה %1$s</strong> מטפלת בתקלה %2$s.', NULL, '', 0, '2019-08-27 12:05:14'),
(4153, 4160, 'he', 0, NULL, '<strong>גרסה %1$s</strong> מטפלת ב-%2$s תקלות.', NULL, '', 0, '2019-08-27 12:05:14'),
(4154, 4161, 'he', 0, NULL, '<strong>גרסה %1$s</strong> מטפלת בסוגיית אבטחה ובתקלה %2$s.', NULL, '', 0, '2019-08-27 12:05:14'),
(4155, 4162, 'he', 0, NULL, '<strong>גרסה %1$s</strong> מטפלת בסוגיית אבטחה וב-%2$s תקלות.', NULL, '', 0, '2019-08-27 12:05:14'),
(4156, 4163, 'he', 0, NULL, '<strong>גרסה %1$s</strong> מטפלת במספר סוגיות אבטחה ובתקלה %2$s.', NULL, '', 0, '2019-08-27 12:05:14'),
(4157, 4164, 'he', 0, NULL, '<strong>גרסה %1$s</strong> מטפלת במספר סוגיות אבטחה וב-%2$s תקלות.', NULL, '', 0, '2019-08-27 12:05:14'),
(4158, 4165, 'he', 0, NULL, '<strong>גרסה %s</strong> מטפלת בסוגיית אבטחה אחת.', NULL, '', 0, '2019-08-27 12:05:14'),
(4159, 4166, 'he', 0, NULL, '<strong>גרסה %s</strong> מטפלת במספר סוגיות אבטחה.', NULL, '', 0, '2019-08-27 12:05:14'),
(4160, 4167, 'he', 0, NULL, '<strong>אזהרה:</strong> לא מומלץ לבצע שינויים בתוספים פעילים.', NULL, '', 0, '2019-08-27 12:05:14'),
(4161, 4168, 'he', 0, NULL, '<strong>אזהרה:</strong> תוסף זה <strong>לא נבדק</strong> בגרסת הוורדפרס שמותקנת באתר.', NULL, '', 0, '2019-08-27 12:05:14'),
(4162, 4169, 'he', 0, NULL, '<strong>אזהרה:</strong> לא ניתן לבחור שני עמודים זהים.', NULL, '', 0, '2019-08-27 12:05:14'),
(4163, 4170, 'he', 0, NULL, '<strong>ברוכים הבאים</strong> - מציג קישורים למשימות הנפוצות ביותר אחרי הקמת אתר חדש.', NULL, '', 0, '2019-08-27 12:05:14'),
(4164, 4171, 'he', 0, NULL, '<strong>חדשות ואירועים של וורדפרס</strong> &mdash; אירועים קרובים באזורך וחדשות מפרויקט וורדפס הרשמי ומ<a href=\"%s\">עולם וורדפרס</a>.', NULL, '', 0, '2019-08-27 12:05:14'),
(4165, 4172, 'he', 0, NULL, '<strong>וורדפרס</strong> &mdash; שדרוג התקנת וורדפרס הוא תהליך פשוט המתבצע בלחיצה אחת: פשוט לחצו על כפתור העדכון כאשר מופיעה הודעה שקיימת גרסה חדשה.', NULL, '', 0, '2019-08-27 12:05:14'),
(4166, 4173, 'he', 0, NULL, '<a href=\"%s\">עמוד סטטי</a> (מהרשימה הבאה)', NULL, '', 0, '2019-08-27 12:05:14'),
(4167, 4174, 'he', 0, NULL, 'מגיב וורדפרס', NULL, '', 0, '2019-08-27 12:05:14'),
