(4169, 4176, 'he', 0, NULL, 'גרסת משנה חדשה זמינה להורדה. מאחר וגרסאות משנה מטפלות לעיתים קרובות בנושאי אבטחה, חשוב להתקין אותן.', NULL, '', 0, '2019-08-27 12:05:14'),
(4170, 4177, 'he', 0, NULL, 'תבנית עמוד חדשה, פונקציה מותנית ושני קלאסים של CSS הופכים את תהליך עיצוב וההתאמה של עמוד מדיניות הפרטיות לקלה יותר.', NULL, '', 0, '2019-08-27 12:05:14'),
(4171, 4178, 'he', 0, NULL, 'זמינה גרסה חדשה של וורדפרס.', NULL, '', 0, '2019-08-27 12:05:14'),
(4172, 4179, 'he', 0, NULL, 'מספר שינויים פועלים יחד כדי לשפר מודעות הקשרית ואת הניווט באמצעות המקלדת, לאלה המשתמשים בקוראי מסך ובטכנולוגיות מסייעות אחרות.', NULL, '', 0, '2019-08-27 12:05:14'),
