(4269, 4276, 'he', 0, NULL, 'חיבור HTTPS נחוץ עבור תכונות רבות באינטרנט, הוא גם מקבל את האמון של המבקרים על ידי עזרה בהגנה על הפרטיות המקוונת שלהם.', NULL, '', 0, '2019-08-27 12:05:14'),
(4270, 4277, 'he', 0, NULL, 'יתכן ונעביר מחרוזת אנונימית שנוצרה מכתובת הדואר האלקטרוני שלך (הנקראת גם hash) לשירות Gravatar כדי לראות אם הנך חבר/ה בשירות. מדיניות הפרטיות של שירות Gravatar זמינה כאן: https://automattic.com/privacy/. לאחר אישור התגובה שלך, תמונת הפרופיל שלך גלויה לציבור בהקשר של התגובה שלך.', NULL, '', 0, '2019-08-27 12:05:14'),
(4271, 4278, 'he', 0, NULL, 'השדרוג האוטומטי לא הושלם. <a href=\"%s\">אנא נסו לבצע זאת שנית</a>.', NULL, '', 0, '2019-08-27 12:05:14'),
