(4273, 4280, 'he', 0, NULL, 'צלמית משתמש היא תמונה המלווה את המשתמש באתרים שתומכים בשירות, היא מופיעה ליד שמו בתגובות שלו ובפוסטים שלו. הגדרות אלה מאפשרות להפעיל תמיכה בצלמיות משתמש למגיבים באתר זה.', NULL, '', 0, '2019-08-27 12:05:14'),
