(4293, 4300, 'he', 0, NULL, 'כתבות או פוסטים באתר זה עשויים לכלול תוכן מוטבע (לדוגמה, קטעי וידאו, תמונות, מאמרים, וכו\'). תוכן מוטבע מאתרי אינטרנט אחרים דינו כביקור הקורא באתרי האינטרנט מהם מוטבע התוכן.', NULL, '', 0, '2019-08-27 12:05:14'),
(4294, 4301, 'he', 0, NULL, 'כמשתמש וורדפרס חדש, כדאי לבקר <a href=\"%s\">בלוח הבקרה שלך</a> כדי למחוק את העמוד הזה, וליצור עמודים חדשים עבור התוכן שלך. שיהיה בכיף!', NULL, '', 0, '2019-08-27 12:05:14'),
(4295, 4302, 'he', 0, NULL, 'כמנהל/ת האתר, ייתכן ועליך לפעול לפי חוקים בינלאומיים או מקומיים בנושא פרטיות. לדוגמה, ייתכן שיהיה עליך ליצור ולהציג מדיניות פרטיות.', NULL, '', 0, '2019-08-27 12:05:14'),
