(4332, 4339, 'he', 0, NULL, 'נסייני בטא?\n========\n\nאימייל זה נשלח למי שמשתמש בגרסת הפיתוח של וורדפרס.\n\nאם לדעתך כשלים בוורדפרס נובעים מתקלות, ניתן לדווח על כך באמצעות:\n * פתיחת קריאה בפורום התמיכה: https://wordpress.org/support/forum/alphabeta\n * או כתיבת דיווח על התקלה: https://core.trac.wordpress.org/\n\nתודה,\nצוות וורדפרס', NULL, '', 0, '2019-08-27 12:05:14'),
