(4341, 4348, 'he', 0, NULL, 'מכיוון שזוהי התקנה של רשת אתרים, ניתן להוסיף משתמשים שכבר קיימים באתרים אחרים ברשת, תוך ציון שם במשתמש או אימייל, והגדרת תפקיד. למנהלי רשת יש אפשרויות נוספות, כגון ציון סיסמה. ריחוף מעל משתמש קיים מאפשר לערוך את פרופיל המשתמש מהתפריט מנהל רשת > כל המשתמשים.', NULL, '', 0, '2019-08-27 12:05:14'),
