(4345, 4352, 'he', 0, NULL, 'בתפריט בצד שמאל יש לבחור את התבנית ומתחת ניתן לבחור את הקובץ לעריכה. בסיום, יש לבצע שמירה, אחרת השינויים לא ישמרו.', NULL, '', 0, '2019-08-27 12:05:14'),
(4346, 4353, 'he', 0, NULL, 'יש להזין פרטי התחברות לשרת. אם אינך בטוח לגבי הפרטים, צור קשר עם חברת האכסון.', NULL, '', 0, '2019-08-27 12:05:14'),
