(4362, 4369, 'he', 0, NULL, 'בניית קבצי JavaScript', NULL, '', 0, '2019-08-27 12:05:14'),
(4363, 4370, 'he', 0, NULL, 'על סמך <a href=\"%1$s\">התכונות של בריאות אתר שהוצגו בוורדפרס 5.1</a>, גרסה זו מוסיפה שני עמודים חדשים המסייעים באיתור בעיות תצורה נפוצות. הדבר גם מוסיף מקום מרכזי שבו מפתחים יכולים לכלול מידע על תיקון באגים עבור מפעילי האתר.', NULL, '', 0, '2019-08-27 12:05:14'),
(4364, 4371, 'he', 0, NULL, 'עריכה קבוצתית', NULL, '', 0, '2019-08-27 12:05:14'),
