(4369, 4376, 'he', 0, NULL, 'מאת %s.', NULL, '', 0, '2019-08-27 12:05:14'),
(4370, 4377, 'he', 0, NULL, 'כברירת מחדל, אין בוורדפרס שירות ניתוח ואיסוף נתונים (analytics). עם זאת, חברות אכסון אתרים רבות אוספות נתונים מסוימים באופן אנונימי. יתכן וגם באתר זה מותקן תוסף וורדפרס המספק שירותי איסוף נתונים. במקרה זה, יש לציין את המידע הנאסף באמצעות התוסף כאן.', NULL, '', 0, '2019-08-27 12:05:14'),
(4371, 4378, 'he', 0, NULL, 'כברירת מחדל וורדפרס אינה אוספת נתונים אישיים על מבקרים, אלא רק את המידע המסופק על ידי המשתמשים הרשומים עצמם בעמוד הפרופיל שלהם. יחד עם זאת, חלק מהתוספים באתר עשויים לאסוף נתונים אישיים. יש להוסיף את המידע הרלוונטי להלן.', NULL, '', 0, '2019-08-27 12:05:14'),
(4372, 4379, 'he', 0, NULL, 'כברירת מחדל, וורדפרס אינה משתפת מידע אישי כלשהו עם אף אחד.', NULL, '', 0, '2019-08-27 12:05:14'),
(4373, 4380, 'he', 0, NULL, 'כברירת מחדל, אין בוורדפרס טופס יצירת קשר. אם באתר נעשה שימוש בתוסף לצורך הפעלת טופס יצירת קשר, יש לציין בסעיף זה אילו נתונים אישיים נשמרים כאשר מבקר שולח טופס יצירת קשר, ולכמה זמן נשמר מידע זה. לדוגמה, ניתן לציין שהמידע ישמר לתקופה מסוימת לצרכים של שירות לקוחות, אך לא יעשה בו שימוש למטרות שיווקיות.', NULL, '', 0, '2019-08-27 12:05:14'),
(4374, 4381, 'he', 0, NULL, 'משתמשים חדשים יקבלו אימייל המודיע להם פתיחת חשבון באתר. האימייל יכלול קישור לאיפוס שישמה. בטלו את סימון התיבה אם אינך רוצה לשלוח אימייל למשתמש.', NULL, '', 0, '2019-08-27 12:05:14'),
