(4388, 4395, 'he', 0, NULL, 'קטגוריות, בניגוד לתגיות, תומכות במבנה היררכי. לדוגמה, יכולה להיות קטגוריה &quot;מוזיקה&quot;, ותחתיה תת-קטגוריות &quot;רוק&quot; או &quot;פופ&quot;. זה שדה אופציונלי לחלוטין.', NULL, '', 0, '2019-08-27 12:05:14'),
