(4721, 4728, 'he', 0, NULL, 'כדי להזמין משתמש קיים ברשת לאתר, אפשר להזין כאן כתובת אימייל או שם משתמש. ההזמנה תשלח אל המשתמש באימייל, עם קישור לאישור.', NULL, '', 0, '2019-08-27 12:05:14'),
(4722, 4729, 'he', 0, NULL, 'יש להזין את המיקום בשרת היכן שנמצא המפתח הציבורי והפרטי. אם נדרשת סיסמת אימות, יש להזין אותה בשדה הסיסמה.', NULL, '', 0, '2019-08-27 12:05:14'),
