(4744, 4751, 'he', 0, NULL, 'חוק הגנת הנתונים האירופי מחייב להגן על נתונים של תושבים אירופיים המועברים מחוץ לאיחוד האירופי באותם סטנדרטים כאילו הנתונים היו באירופה. לכן, בנוסף לציון היכן הנתונים מועברים, עליך לתאר כיצד מובטח שהסטנדרטים אלה ישמרו, בן עם בעצמך או על ידי ספקי צד שלישי, ובין אם זה באמצעות הסכם כגון Privacy Shield, משפטי מגן בחוזים שלך, או כללי תאגיד מחייבים.', NULL, '', 0, '2019-08-27 12:05:14'),
