(4746, 4753, 'he', 0, NULL, 'כל התוספים והתבניות בספרייה הרשמית של וורדפרס מופצים תחת רישיון GPL או ברישיון מקביל, לכן ניתן להוריד משם <a href=\"%1$s\">תוספים</a> <a href=\"%2$s\">ותבניות</a> ללא חשש. אם הורדתם תוסף או תבנית ממקור אחר, כדאי לוודא שהם מופצים תחת <a href=\"%3$s\">תנאי רישיון GPL</a>. אנו לא ממליצים להשתמש בתוספים ותבניות שלא מכבדים רישיון GPL.', NULL, '', 0, '2019-08-27 12:05:14'),
