(4904, 4911, 'he', 0, NULL, 'אהלן! אני סטודנט לכלכלה ביום, אך מבלה את הלילות בהגשמת החלום שלי להיות שחקן תאטרון. אני גר ביפו, יש לי כלב נהדר בשם שוקו, אני אוהב ערק אשכוליות בשישי בצהריים (במיוחד תוך כדי משחק שש-בש על חוף הים). ברוכים הבאים לאתר שלי!', NULL, '', 0, '2019-08-27 12:05:14'),
(4905, 4912, 'he', 0, NULL, 'היי,\n\nהצטרפת אל \'%1$s\' בכתובת %2$s בתפקיד %3$s.\n\nעל מנת לאשר את ההצטרפות יש לאשר אותה על ידי לחיצה על הקישור הבא:\n%4$s', NULL, '', 0, '2019-08-27 12:05:14'),
(4906, 4913, 'he', 0, NULL, 'שלום,\n\nהוזמנת להצטרף אל \'%1$s\' בכתובת %2$s בתפקיד %3$s.\nאם אינך מעוניין להצטרף לאתר אנא התעלם מהמייל הזה. ההזמנה תפוג באופן אוטומטי תוך מספר ימים.\n\nכדי להפעיל את החשבון, לחץ על הקישור הבא:\n%%s', NULL, '', 0, '2019-08-27 12:05:14'),
(4907, 4914, 'he', 0, NULL, 'היי, זו תגובה.\nכדי לשנות, לערוך, או למחוק תגובות, יש לגשת למסך התגובות בלוח הבקרה.\nצלמית המשתמש של המגיב מגיעה מתוך <a href=\"https://gravatar.com\">גראווטר</a>.', NULL, '', 0, '2019-08-27 12:05:14'),
