(4916, 4923, 'he', 0, NULL, 'כשהעכבר נמצא מעל אחד הפוסטים ברשימה, תוצגנה כל הפעולות שניתן לבצע על הפוסט הזה:', NULL, '', 0, '2019-08-27 12:05:14'),
