(4923, 4930, 'he', 0, NULL, 'שלום ###USERNAME###,\n\nלאחרונה ביקשת למחוק את האתר שלך ומילאת את הטופס הנדרש.\n\nיש לאמת את הפעולה על ידי לחיצה על הקישור הבא:\n###URL_DELETE###\n\nאם תחליט למחוק את האתר, אנא שקול לחזור ולפתוח אתר חלופי בעתיד!\n(רק תיקח בחשבון שהאתר הנוכחי והמשתמש שלך ימחקו לצמיתות)\n\nבברכה,\n###SITE_NAME###', NULL, '', 0, '2019-08-27 12:05:14'),
(4924, 4931, 'he', 0, NULL, 'שלום ###USERNAME###,\n\nלאחרונה ביקשת להחליף את כתובת האימייל של חשבון המנהל.\n\nיש לאמת את הפעולה על ידי לחיצה על הקישור הבא:\n###ADMIN_URL###\n\nאם לא ביקשת לבצע פעולה זו, או ששינית את דעתך, ניתן להתעלם מהודעה זו.\n\nאימייל זה נשלח אל ###EMAIL###\n\nבברכה,\n###SITE_NAME###\n###SITEURL###', NULL, '', 0, '2019-08-27 12:05:14'),
