(4926, 4933, 'he', 0, NULL, 'שלום,‬\n\n‫‫בקשתך לייצוא נתונים אישיים הושלמה. ניתן להוריד את הנתונים האישיים על ידי לחיצה על הקישור. מסיבות של פרטיות‬ ‫‫ואבטחה, הקובץ ימחק באופן אוטומטי בתוך ###EXPIRATION###, לכן יש להוריד אותו לפני.‬\n‬\n‫‏‫###LINK###‬\n‬\n‫‫בברכה,‬\n‫‫צוות ###SITENAME###‬\n‫‏‫###SITEURL###', NULL, '', 0, '2019-08-27 12:05:14'),
(4927, 4934, 'he', 0, NULL, 'עם זאת, באחריותך להשתמש בהצעות אלו בצורה נכונה, כדי לספק את המידע שמדיניות הפרטיות שלך מחייבת. עליך להקפיד לשמור על מידע זה מעודכן ומדויק.', NULL, '', 0, '2019-08-27 12:05:14'),
