(4929, 4936, 'he', 0, NULL, 'אני בטוח שאני מעוניין למחוק את האתר, ואני מודע לכך כי לא אוכל לקבל אותו בחזרה או להשתמש שוב %s.', NULL, '', 0, '2019-08-27 12:05:14'),
