(4933, 4940, 'he', 0, NULL, '&rlm;Identicon (אוטומטי)', NULL, '', 0, '2019-08-27 12:05:14'),
(4934, 4941, 'he', 0, NULL, 'אם קובץ המדיה לא שוייך לשום תוכן, יהיה ניתן לראות זאת בטור נפרד. על מנת לשייך את הקובץ, ניתן ללחוץ על הקישור \"לשייך\" אשר מקפיץ חלון קטן המאפשר לבחור את התוכן אליו ישוייך הקובץ.', NULL, '', 0, '2019-08-27 12:05:14'),
(4935, 4942, 'he', 0, NULL, 'אם קיים עדכון זמין למערכת, תופיע הודעה בסרגל הכלים ובתפריט הניווט.', NULL, '', 0, '2019-08-27 12:05:14'),
(4936, 4943, 'he', 0, NULL, 'אם תרצה, וורדפרס תשלח באופן אוטומטי התראה לשירותים שונים על פרסום פוסטים חדשים.', NULL, '', 0, '2019-08-27 12:05:14'),
(4937, 4944, 'he', 0, NULL, 'אם מסיבה כלשהי יצירת הקבצים האוטומטית אינה עובדת, אל דאגה. כל שהפעולה עושה היא להוסיף את פרטי מסד הנתונים לקובץ ההגדרות. באפשרותך לפתוח את הקובץ %1$s בכל עורך טקסט, להוסיף את ההגדרות, ולשמור את הקובץ בשם %2$s.', NULL, '', 0, '2019-08-27 12:05:14'),
(4938, 4945, 'he', 0, NULL, 'אם אחד התוספים משתבש ומקלקל את וורדפרס, יש למחוק את הקבצים שלו מהספרייה %s. המערכת תכבה את התוסף הסורר ותחזור לפעול כרגיל.', NULL, '', 0, '2019-08-27 12:05:14'),
(4939, 4946, 'he', 0, NULL, 'אם המייבא הנדרש לא נמצא ברשימה, ניתן <a href=\"%s\">לחפש בספריית התוספים</a> כדי לראות את כל המייבאים הזמינים.', NULL, '', 0, '2019-08-27 12:05:14'),
(4940, 4947, 'he', 0, NULL, 'אם זה קישור לאתר או אתר אישי, ניתן להגדיר את הקשר שלך עם בעלי האתר באמצעות הטופס. פרטים נוספים באתר של <a href=\"http://gmpg.org/xfn/\">XFN</a>.', NULL, '', 0, '2019-08-27 12:05:14'),
(4941, 4948, 'he', 0, NULL, 'אם בספרייה הראשית באתר היו <a href=\"%1$s\">הרשאות מתאימות לכתיבה</a>, וורדפרס היתה עושה את השינויים הנחוצים באופן אוטומטי. במקום זאת, צריך ליצור קובץ %2$s בספרייה הראשית, ולהדביק בו את השורות הבאות. יש ללחוץ על התיבה הבאה וללחוץ %3$s כדי לסמן הכל. את הקוד יש להכניס לקובץ %2$s.', NULL, '', 0, '2019-08-27 12:05:14'),
(4942, 4949, 'he', 0, NULL, 'אם אין ברירה ואתם חייבים לערוך את התוסף הזה ישירות, עשו שימוש במנהל קבצים כדי להעתיק את הקובץ הקיים לקובץ עם שם חדש. כך תוכלו לשחזר לגרסה תקינה אם משהו ישתבש.', NULL, '', 0, '2019-08-27 12:05:14'),
(4943, 4950, 'he', 0, NULL, 'אם כבר יש לך עמוד מדיניות פרטיות, אפשר לבחור אותו כאן למטה. במידה ולא, נא ליצור עמוד שכזה.', NULL, '', 0, '2019-08-27 12:05:14'),
(4944, 4951, 'he', 0, NULL, 'פעילות בתעשייה הנמצאת תחת רגולציה או תחת חוקי פרטיות נוספים, ייתכן ויהיה צורך לחשוף כאן את המידע הזה.', NULL, '', 0, '2019-08-27 12:05:14'),
(4945, 4952, 'he', 0, NULL, 'אם ברצונך להשתמש במנהל הקישורים, התקן את התוסף <a href=\"%s\">מנהל הקישורים</a>.', NULL, '', 0, '2019-08-27 12:05:14'),
(4946, 4953, 'he', 0, NULL, 'אם תשנה זאת, נשלח אימייל לכתובת החדשה כדי לאשר אותה. <strong>הכתובת החדשה לא תהיה פעילה עד שהיא תאושר.</strong>', NULL, '', 0, '2019-08-27 12:05:14'),
(4947, 4954, 'he', 0, NULL, 'אם תחליטו לבצע את השינויים בכל זאת, עשו שימוש במנהל קבצים כדי להעתיק את הקובץ הקיים לקובץ עם שם חדש. כך תוכלו לשחזר לגרסה תקינה אם משהו ישתבש.', NULL, '', 0, '2019-08-27 12:05:14'),
(4948, 4955, 'he', 0, NULL, 'מחיקת קישור תמחק אותו לצמיתות, לקישורים אין עדיין פח.', NULL, '', 0, '2019-08-27 12:05:14'),
(4949, 4956, 'he', 0, NULL, 'אם שכחת אם פרטי ההתחברות, יש ליצור קשר עם חברת האכסון.', NULL, '', 0, '2019-08-27 12:05:14'),
(4950, 4957, 'he', 0, NULL, 'אם אינך רוצה להשתמש יותר באתר %s, ניתן למחוק אותו באמצעות הטופס הבא. בעת לחיצה על <strong>מחק אתר לצמיתות</strong> תישלח הודעת אימייל עם קישור לאישור המחיקה. לחיצה על הקישור תאשר את המחיקה והאתר ימחק לצמיתות.', NULL, '', 0, '2019-08-27 12:05:14'),
(4951, 4958, 'he', 0, NULL, 'אם אינך רוצה להציג תמונת כותרת יש ללחוץ על הכפתור \"הסר תמונת כותרת\" בתחתית העמוד. אם בהמשך תרצה להציג תמונת כותרת, כל שתצטרך לעשות הוא לבחור תמונה ולשמורה שינויים.', NULL, '', 0, '2019-08-27 12:05:14'),
(4952, 4959, 'he', 0, NULL, 'אם אינך רוצה להעלות תמונה, ניתן לבחור תמונה מתוך התמונות הבאות, או להציג תמונה אקראית.', NULL, '', 0, '2019-08-27 12:05:14'),
(4953, 4960, 'he', 0, NULL, 'אם אתה עורך או מפרסם מאמר, קובץ \'עוגיה\' נוסף יישמר בדפדפן שלך. קובץ \'עוגיה\' זה אינו כולל נתונים אישיים ופשוט מציין את מזהה הפוסט של המאמר. הוא יפוג לאחר יום אחד.', NULL, '', 0, '2019-08-27 12:05:14'),
(4954, 4961, 'he', 0, NULL, 'אם נתקלם בעיה כלשהי או זקוקים לתמיכה נוספת, ייתכן שהמתנדבים בפורום התמיכה של WordPress.org יוכלו לעזור.', NULL, '', 0, '2019-08-27 12:05:14'),
(4955, 4962, 'he', 0, NULL, 'אם יש לך תוסף בקובץ &lrm;.zip , ניתן להעלות אותו ולהתקין אותו ידנית.', NULL, '', 0, '2019-08-27 12:05:14'),
(4956, 4963, 'he', 0, NULL, 'אם יש לך בכונן הקשיח תבנית בפורמט &lrm;.zip, ניתן להעלות ולהתקין אותה.', NULL, '', 0, '2019-08-27 12:05:14'),
(4957, 4964, 'he', 0, NULL, 'אם יש לך חשבון באתר זה, או שהשארת תגובות באתר, באפשרותך לבקש לקבל קובץ של הנתונים האישיים שאנו מחזיקים לגביך, כולל כל הנתונים שסיפקת לנו. באפשרותך גם לבקש שנמחק כל מידע אישי שאנו מחזיקים לגביך. הדבר אינו כולל נתונים שאנו מחויבים לשמור למטרות מנהליות, משפטיות או ביטחוניות.', NULL, '', 0, '2019-08-27 12:05:14'),
(4958, 4965, 'he', 0, NULL, 'אם סימנת תוספים מועדפים באתר WordPress.org, ניתן לראות אותם כאן.', NULL, '', 0, '2019-08-27 12:05:14'),
(4959, 4966, 'he', 0, NULL, 'אם סימנת תבניות מועדפות באתר WordPress.org, ניתן לראות אותן כאן.', NULL, '', 0, '2019-08-27 12:05:14'),
(4960, 4967, 'he', 0, NULL, 'If you have posts or comments in another system, WordPress can import those into this site. To get started, choose a system to import from below:', NULL, '', 0, '2019-08-27 12:05:14'),
(4961, 4968, 'he', 0, NULL, 'אם עדיין לא יצרת שום תפריט, יש ללחוץ על הקישור <strong>&#8217;הוספת תפריט חדש&#8217; </strong> כדי להתחיל.', NULL, '', 0, '2019-08-27 12:05:14'),
(4962, 4969, 'he', 0, NULL, 'אם ברצונכם לקבל מושג מה זמין, ניתן לגשת לתוספים המובחרים ולתוספים הפופולריים בעזרת הקישורים בחלק העליון. הם מתעדכנים באופן תדיר.', NULL, '', 0, '2019-08-27 12:05:14'),
(4963, 4970, 'he', 0, NULL, 'אם ידוע לך מה מבוקשך, עדיף להשתמש בחיפוש. במסך החיפוש ניתן לחפש בספריית התוספים של וורדפרס על פי מילות מפתח, יוצרים או תגיות מסוימות. ניתן גם לחפש בספריית התוספים על ידי בחירה בתגיות הנפוצות. תגית שמופיעה בכתב גדול יותר מסמלת שיש יותר תוספים שקשורים לתגית זו.', NULL, '', 0, '2019-08-27 12:05:14'),
(4964, 4971, 'he', 0, NULL, 'בכתיבת תגובה באתר שלנו, באפשרותך להחליט אם לאפשר לנו לשמור את השם שלך, כתובת האימייל שלך וכתובת האתר שלך בקבצי עוגיות (cookies). השמירה תתבצע לנוחיותך, על מנת שלא יהיה צורך למלא את הפרטים שלך שוב בכתיבת תגובה נוספת. קבצי העוגיות ישמרו לשנה.', NULL, '', 0, '2019-08-27 12:05:14'),
(4965, 4972, 'he', 0, NULL, 'במידה ותגיב/י על תוכן באתר, התגובה והנתונים אודותיה יישמרו ללא הגבלת זמן, כדי שנוכל לזהות ולאשר את כל התגובות העוקבות באופן אוטומטי.', NULL, '', 0, '2019-08-27 12:05:14'),
(4966, 4973, 'he', 0, NULL, 'במידת הצורך, ניתן ליצור מבנה מותאם לכתובות ה-URL של הקטגוריות והתגיות. לדוגמא, שימוש ב-<code>topics</code> כבסיס לקטגוריה יצור קישורי קטגוריה במבנה הבא: <code>%s/topics/uncategorized/</code>. אם השדות יישארו ריקים, יעשה שימוש בהגדרות ברירת המחדל.', NULL, '', 0, '2019-08-27 12:05:14'),
(4967, 4974, 'he', 0, NULL, 'אם צריך להתקין מחדש את גרסה %s, ניתן לעשות זאת כאן:', NULL, '', 0, '2019-08-27 12:05:14'),
(4968, 4975, 'he', 0, NULL, 'אם הבחנת בהודעה שהכותרות שכבר נשלחו, בעיות בהזנות סינדיקציה או בבעיות אחרות, נסה לכבות או למחוק את התוסף.', NULL, '', 0, '2019-08-27 12:05:14'),
(4969, 4976, 'he', 0, NULL, 'יש מספר אפשרויות מוגדרות מראש, וכל אחת מהאפשרויות להתאמה אישית באמצעות תגים מיוחדים, עם סימני אחוז <code>%</code>.', NULL, '', 0, '2019-08-27 12:05:14'),
(4970, 4977, 'he', 0, NULL, 'אם תיצור איתנו קשר, אנו נדאג שבעיה זו לא תחזור על עצמה שוב.', NULL, '', 0, '2019-08-27 12:05:14'),
(4971, 4978, 'he', 0, NULL, 'אם תכננת לבקר באחד האתרים שלכם ובטעות הגעת לכאן, הנה כמה קיצורי דרך שיעזרו לך למצוא את דרכך.', NULL, '', 0, '2019-08-27 12:05:14'),
(4972, 4979, 'he', 0, NULL, 'אם שינית את ההרשאות על הקובץ %s באופן זמני רק כדי לשנות את כללי שכתוב הכתובות, חשוב לזכור להחזיר את ההרשאות למצב הקודם אחרי שמירת השינויים.', NULL, '', 0, '2019-08-27 12:05:14'),
(4973, 4980, 'he', 0, NULL, 'אם באופן זמני שינית את הרשאות הכתיבה של ספריית השורש לניתנת לכתיבה, על מנת ליצור את הקובץ %s באופן אוטומטי, אל תשכח להחזיר את ההרשאות לקדמותן בסיום התהליך.', NULL, '', 0, '2019-08-27 12:05:14'),
(4974, 4981, 'he', 0, NULL, 'בהעלאה של תמונות לאתר, מומלץ להימנע מהעלאת תמונות עם נתוני מיקום מוטבעים (EXIF GPS). המבקרים באתר יכולים להוריד ולחלץ את כל נתוני מיקום מהתמונות באתר.', NULL, '', 0, '2019-08-27 12:05:14'),
(4975, 4982, 'he', 0, NULL, 'אם האתר שלך קיים למטרות מסחריות, ומתבצע בו איסוף או עיבוד מורכבים יותר של נתונים אישיים, יש לציין את המידע הבא במדיניות הפרטיות שלך, בנוסף לסעיפים הקודמים.', NULL, '', 0, '2019-08-27 12:05:14'),
(4976, 4983, 'he', 0, NULL, 'אם אתה מבקר בעמוד ההתחברות של האתר, נגדיר קובץ עוגיה זמני על מנת לקבוע האם הדפדפן שלך מקבל קבצי עוגיות. קובץ עוגיה זה אינו מכיל נתונים אישיים והוא נמחק בעת סגירת הדפדפן.', NULL, '', 0, '2019-08-27 12:05:14'),
(4977, 4984, 'he', 0, NULL, 'על מנת לאפשר למשתמשי האתר להירשם בעצמם, בניגוד לרישום ידני המתבצע על יד הנהלת האתר, לחצו על כפתור החברות. ניתן להגדיר תפקיד ברירת מחדל לנרשמים חדשים, בין אם מדובר במשתמשים שנרשמו בעצמם או במשתמשים בנוצרו על ידי הנהלת האתר.', NULL, '', 0, '2019-08-27 12:05:14'),
(4978, 4985, 'he', 0, NULL, 'להמרת קטגוריות לתגיות (או להפך), עשו שימוש ב<a href=\"%s\">ממיר קטגוריות ותגיות</a> הזמין במסך היבוא.', NULL, '', 0, '2019-08-27 12:05:14'),
(4979, 4986, 'he', 0, NULL, 'אם ברצונך לייצא רשימה שימושית של כל המידע במסך זה, ניתן להשתמש בלחצן הבא כדי להעתיק אותו ללוח. לאחר מכן ניתן להדביק אותו לקובץ טקסט ולשמור אותו במחשב, או להדביק אותו באימייל ולשתף עם מהנדס תמיכה או עם מפתח של תוסף או תבנית.', NULL, '', 0, '2019-08-27 12:05:14'),
(4980, 4987, 'he', 0, NULL, 'אם ברצונכם להתקין תוסף שהורדתם ממקור חיצוני, יש ללחוץ על כפתור העלאת הקבצים, לבחור קובץ zip ובתום ההעלאה להפעיל את התוסף.', NULL, '', 0, '2019-08-27 12:05:14'),
(4981, 4988, 'he', 0, NULL, 'אם בוצעו שינויים בקבצי התוסף, הם ימחקו כשהתוסף יעודכן. כדאי לחשוב על כתיבת תוסף משלך, הקישורים בהמשך הם התחלה מצויינת.', NULL, '', 0, '2019-08-27 12:05:14'),
(4982, 4989, 'he', 0, NULL, 'כדי להסיר וידג\'טים מהסרגל הצדדי מבלי שההגדרות שלהם תמחקנה, יש לגרור אותם לאזור הווידג\'טים הלא פעילים.', NULL, '', 0, '2019-08-27 12:05:14'),
(4983, 4990, 'he', 0, NULL, 'להתקנת רשת אתרים במסד נתונים אחד, שנו שדה זה.', NULL, '', 0, '2019-08-27 12:05:14'),
(4984, 4991, 'he', 0, NULL, 'כדי לראות תוספים נוספים, יש ללחוץ על \"תוסף חדש\" כדי לדפדף או לחפש תוספים נוספים מתוך <a href=\"%s\">ספריית התוספים של וורדפרס</a>. הספרייה מציעה אלפי תוספים חינמיים, המפותחים על ידי מפתחים חיצוניים, ותואמים לתנאי הרישוי של וורדפרס.', NULL, '', 0, '2019-08-27 12:05:14'),
(4985, 4992, 'he', 0, NULL, 'אם ברצונכם לראות תבניות נוספת, יש ללחוץ על הכפתור \"התקנת תבניות\" ומשם לדפדף או לחפש תבניות מתוך <a href=\"%s\">ספריית התבניות של וורדפרס</a>. התבניות בספרייה תוכננו ופותחו על ידי צדדים שלישיים, ותואמים את רישיון השימושים של וורדפרס. אהה, והן בחינם!', NULL, '', 0, '2019-08-27 12:05:14'),
(4986, 4993, 'he', 0, NULL, 'אילו היו <a href=\"%2$s\">הרשאות כתיבה</a> לקובץ %1$s, המערכת הייתה עושה זאת בצורה אוטומטית. אבל מכיוון שאין הרשאות כתיבה, יש להדביק את חוקי ה־mod_rewrite האלה בתוך הקובץ %1$s ידנית. לחץ בתוך השדה ואז על %3$s כדי לבחור הכול.', NULL, '', 0, '2019-08-27 12:05:14'),
(4987, 4994, 'he', 0, NULL, 'אם לקובץ %1$s היו <a href=\"%2$s\">הרשאות כתיבה מתאימות</a>, השינויים הנחוצים היו מתבצעים באופן אוטומטי. מכיוון שאין לקובץ %1$s הרשאות כתיבה, יש להעתיק לתוכו את השורות הבאות באופן ידנית. לחצו %3$s כדי לבחור הכל, והכינסו את הקוד לתוך %4$s בקובץ %1$s.', NULL, '', 0, '2019-08-27 12:05:14'),
(4988, 4995, 'he', 0, NULL, 'אם התבנית מכילה יותר מתמונת כותרת אחת כברירת מחדל, או שהעלית יותר מתמונה אחת, וורדפרס מאפשרת להציג תמונה אקראית בכל עמוד באתר. לחיצה על הכפתור \"אקראי\" לצד תמונות ברירת המחדל תפעיל תכונה זו.', NULL, '', 0, '2019-08-27 12:05:14'),
(4989, 4996, 'he', 0, NULL, 'אם אתר האינטרנט שלך מספק שירות הכולל תהליכי החלטה אוטומטיים - לדוגמה, מתן אשראי ללקוחות או צבירת הנתונים שלהם בפרופיל לצורך שימוש בפרסום - עליך לציין שפעולה זו מתבצעת ולכלול מידע אודות האופן שבו נעשה שימוש במידע הנצבר, אילו החלטות מתקבלות באמצעות נתונים צבורים אלה, ואילו זכויות יש למשתמשים בנוגע בהחלטות שיעשו ללא התערבות אנושית.', NULL, '', 0, '2019-08-27 12:05:14'),
(4990, 4997, 'he', 0, NULL, 'אם אתר האינטרנט שלך מקבל נתונים אודות משתמשים מצדדים שלישיים, כולל מפרסמים, מידע זה חייב להיכלל בסעיף של מדיניות הפרטיות שלך העוסק בנתוני צד שלישי.', NULL, '', 0, '2019-08-27 12:05:14'),
