(5025, 5032, 'he', 0, NULL, 'בנוסף לפירוט הנתונים האישיים הנאספים באתר, עליך לציין מדוע הוא נאסף. הסברים אלו חייבים לציין את הבסיס המשפטי לאיסוף הנתונים ולהחזקה או להסכמה הפעילה שהמשתמש נתן לאיסוף.', NULL, '', 0, '2019-08-27 12:05:14'),
(5026, 5033, 'he', 0, NULL, 'סביר להניח, כי פרטים אלה סופקו על ידי חברת האכסון. אם אין לך את המידע הזה, ניתן לפנות אל חברת האכסון. אם יש ברשותך את כל הפרטים ניתן להמשיך לשלב הבא...', NULL, '', 0, '2019-08-27 12:05:14'),
(5027, 5034, 'he', 0, NULL, 'ברוב המקרים, וורדפרס תתקין בעצמה באופן אוטומטי עדכוני תחזוקה ואבטחה.', NULL, '', 0, '2019-08-27 12:05:14'),
(5028, 5035, 'he', 0, NULL, 'בגרסאות קודמות של וורדפרס, כלי היבוא היו מובנים במערכת. מאחר מרבית המשתמשים לא עשו בהם שימוש תקוף, כלי היבוא הופרדו מהמערכת והפכו לתוספים חיצוניים הניתנים להורדה מספריית התוספים.', NULL, '', 0, '2019-08-27 12:05:14'),
