(5031, 5038, 'he', 0, NULL, 'בתגובה על: %s', NULL, '', 0, '2019-08-27 12:05:14'),
(5032, 5039, 'he', 0, NULL, 'בטור \"מאת\" מופיע שם המחבר, כתובת האימייל, כתובת האתר, וכתובת ה-IP. לחיצה על כתובת ה-IP תציג את כל התגובות האחרות שפורסמו מאותה כתובת. זו שיטה בסיסית אך יעילה לזיהוי מגיבים אנונימיים.', NULL, '', 0, '2019-08-27 12:05:14'),
(5033, 5040, 'he', 0, NULL, 'בטור <strong>תגובה</strong>, רחיפה מעל התגובה תציג פעולות שניתן לבצע כמו לאשר תגובה, להגיב לתגובה, לערוך תגובה, לסמן כזבל או למחוק אותה.', NULL, '', 0, '2019-08-27 12:05:14'),
(5034, 5041, 'he', 0, NULL, 'בטור <strong>בתגובה על</strong>, ישנם שלושה אלמנטים. הטקסט הוא השם של הפוסט בו נכתבה התגובה. הקישור \"הצג פוסט\" מוביל לפוסט באתר. הבועה הקטנה מציגה את מספר התגובות המאושרות. אם הבועה אפורה, כל התגובות מאושרות. אם הבועה כחולה, קיימות תגובות הממתינות לאישור. לחיצה על הבועה תציג רק את התגובות ששייכות לאותו הפוסט.', NULL, '', 0, '2019-08-27 12:05:14'),
(5035, 5042, 'he', 0, NULL, 'בטור <strong>תאריך</strong>, מוצג התאריך והשעה בה פורסמה התגובה. לחיצה על קישור התאריך יוביל אל התגובה באתר.', NULL, '', 0, '2019-08-27 12:05:14'),
(5036, 5043, 'he', 0, NULL, 'בכותרת טקסט ניתן לבחור האם להציג את הטקסט או להסתיר אותו. כמו כן ניתן לבחור את צבע הטקסט על ידי לחיצה על הכפתור בחר צבע ובחירת צבע או הזנת ערך אקסדצימלי, כגון &#8220;#ff0000&#8221; לצבע אדום.', NULL, '', 0, '2019-08-27 12:05:14'),
(5037, 5044, 'he', 0, NULL, 'בסעיף זה עליך להסביר לכמה זמן נשמרים הנתונים אישיים שנאספים או מעובדים על-ידי אתר האינטרנט.  לדוגמה, ניתן לפרט שרשומות של טופס יצירת קשר ישמרו במשך שישה חודשים, רשומות Analytics במשך שנה ורשומות רכישה של לקוחות במשך עשר שנים.', NULL, '', 0, '2019-08-27 12:05:14'),
(5038, 5045, 'he', 0, NULL, 'בסעיף זה עליך להסביר אילו אמצעים נטלת כדי להגן על הנתונים אודות המשתמשים שלך. למשל, אמצעים טכניים כגון הצפנה; אמצעי אבטחה כגון אימות דו-שלבי; ופעילויות כגון הדרכת הצוות בנושא הגנת נתונים. אם בוצעה הערכה מקצועית בנושא הפרטיות (Privacy Impact Assessment), ניתן להזכיר זאת כאן.', NULL, '', 0, '2019-08-27 12:05:14'),
(5039, 5046, 'he', 0, NULL, 'בסעיף זה עליך להסביר את התכנון להתמודדות עם חדירה לנתונים, פוטנציאלית או אמיתית. למשל מערכות לדיווח פנימי, מנגנוני יצירת קשר, או תכניות איתור באגים פומביות (bug bounties).', NULL, '', 0, '2019-08-27 12:05:14'),
(5040, 5047, 'he', 0, NULL, 'בסעיף זה עליך להסביר אילו זכויות יש למשתמשים על הנתונים שלהם וכיצד הם יכולים להפעיל זכויות אלה.', NULL, '', 0, '2019-08-27 12:05:14'),
(5041, 5048, 'he', 0, NULL, 'בסעיף זה יש לפרט את כל נתוני האתר המועברים אל מחוץ לאיחוד האירופי ולתאר את האמצעים שבאמצעותם מוגנים נתונים אלה בהתאם לתקני הגנת הנתונים האירופיים. הדבר יכול לכלול את חברת האכסון, חברת אחסון בענן, או שירותי צד שלישי אחרים.', NULL, '', 0, '2019-08-27 12:05:14'),
(5042, 5049, 'he', 0, NULL, 'בסעיף זה עליך לציין את כל ספקי הצד השלישי אתם משותפים נתוני אתר, כולל שותפים, שירותים מבוססי ענן, שירותי סליקה ותשלום וספקי שירות של צד שלישי. יש לציין אילו נתונים אתה משתף אתם ומדוע. במידת האפשר, יש לקשר למדיניות הפרטיות שלהם.', NULL, '', 0, '2019-08-27 12:05:14'),
(5043, 5050, 'he', 0, NULL, 'בסעיף זה עליך לציין אילו נתונים אישיים נאספים ממשתמשים וממבקרים באתר. למשל: נתונים אישיים כגון שם, כתובת אימייל, או העדפות חשבון אישיות; נתוני עסקאות, כגון מידע על רכישות; ונתונים טכניים, כגון מידע אודות קבצי cookie.', NULL, '', 0, '2019-08-27 12:05:14'),
(5044, 5051, 'he', 0, NULL, 'בסעיף זה עליך לציין את כתובת ה-URL של האתר שלך, כמו גם את שם החברה, הארגון או היחיד המפעיל את האתר, ומידע מדויק ליצירת קשר.', NULL, '', 0, '2019-08-27 12:05:14'),
(5045, 5052, 'he', 0, NULL, 'בסעיף זה יש לפרט כיצד ניתן ליצור קשר בנושאים הקשורים לפרטיות. אם יש בארגונך קצין הגנת נתונים (Data Protection Officer), יש לפרט כאן את שמו/ה ואת פרטי הקשר המלאים שלו/ה.', NULL, '', 0, '2019-08-27 12:05:14'),
(5046, 5053, 'he', 0, NULL, 'בסעיף קטן זה עליך לפרט את קבצי העוגיות (cookies) בהם משתמש אתר האינטרנט שלך, כולל אלו שנוצרים על-ידי התוספים, אתרי המדיה החברתית המוטמעים, ושירותי ניתוח הנתונים (analytics). הרשימה כבר כוללת את העוגיות אשר וורדפרס מתקינה כברירת מחדל.', NULL, '', 0, '2019-08-27 12:05:14'),
(5047, 5054, 'he', 0, NULL, 'בסעיף קטן זה עליך לציין באיזו חבילה או שירות ניתוח נתונים (analytics) נעשה שימוש באתר, כיצד משתמשים יכולים לבחור שלא יתבצע מעקב אחריהם,  ולהוסיף קישור למדיניות הפרטיות של ספק השירות במידה ויש כזה.', NULL, '', 0, '2019-08-27 12:05:14'),
(5048, 5055, 'he', 0, NULL, 'בסעיף זה יש לציין איזה מידע נלכד באמצעות הערות. יש לציין איזה מידע וורדפרס אוספת כברירת מחדל.', NULL, '', 0, '2019-08-27 12:05:14'),
(5049, 5056, 'he', 0, NULL, 'בסעיף קטן זה עליך לציין איזה מידע עשויים לחשוף משתמשים שיכולים להעלות קבצי מדיה. כל הקבצים שמועלים לאתר בדרך כלל נגישים לציבור.', NULL, '', 0, '2019-08-27 12:05:14'),
