(5106, 5113, 'he', 0, NULL, 'ניתן לחסום את כל, או חלק, מהתקשורת לאתרים ולשירותים אחרים. אך אם המערכת מוגדרת בצורה שגויה, הדבר עשוי למנוע הפעלה של תוספים ותבניות.', NULL, '', 0, '2019-08-27 12:05:14'),
(5107, 5114, 'he', 0, NULL, 'הגדרות אלה אינן חוסמות את הגישה לאתר, מנועי החיפוש רשאים לכבד (או לא) את בקשת האתר.', NULL, '', 0, '2019-08-27 12:05:14'),
(5108, 5115, 'he', 0, NULL, 'באחריותך לכתוב מדיניות פרטיות מקיפה עדכנית ומדויקת, ולוודא שהיא משקפת את כל הדרישות המשפטיות המקומיות והבינלאומיות בנוגע לפרטיות.', NULL, '', 0, '2019-08-27 12:05:14'),
(5109, 5116, 'he', 0, NULL, 'זוהתה גרסה לא בטוחה של %s. שימוש בגרסאות ישנות אינו בטוח. כדי להפיק את המיטב מוורדפרס, מומלץ לשדרג את הדפדפן לגרסה עדכנית.', NULL, '', 0, '2019-08-27 12:05:14'),
