(5392, 5399, 'he', 0, NULL, 'מבנה קישורים קובע איך תראה כתובת ה-URL לכל אחד מהדפים באתר (פוסטים, עמודים, קטגוריות, תגיות, ארכיונים). במילים אחרות, מבנה קישור הוא הכתובת רשת של דף האינטרנט. כתובת ה-URL לכל דף אמורה להיות קבוע ואין לשנותה.', NULL, '', 0, '2019-08-27 12:05:14'),
(5393, 5400, 'he', 0, NULL, 'מבנה קישורים יכול להכיל מידע שימושי כגון תאריך פרסום, כותרת, או גורמים אחרים. ניתן לבחור מבין המבנים המומלצים או לבנות מבנה מותאם.', NULL, '', 0, '2019-08-27 12:05:14'),
