(5398, 5405, 'he', 0, NULL, 'נתונים אישיים אינם רק הנתונים שנוצרים ישירות מפעילות המשתמש באתר שלך. נתונים אישיים נוצרים גם מתהליכים כגון טפסי יצירת קשר, תגובות, קבצי עוגיות (Cookies), ניתוח נתונים (analytics), והטבעת תוכן של צד שלישי.', NULL, '', 0, '2019-08-27 12:05:14'),
