(5403, 5410, 'he', 0, NULL, 'יש לבדוק את האתר עכשיו. זה אפשרי, כי הכל אמור לעבוד. אם זה אומר שצריך לעדכן, יש לעשות כך:', NULL, '', 0, '2019-08-27 12:05:14'),
(5404, 5411, 'he', 0, NULL, 'יש לערוך את תוכן מדיניות הפרטיות של האתר, תוך הקפדה על מחיקת ההצעות וההסברים והוספה של תוכן רלוונטי לתבנית ולתוספים המופעלים באתר. לאחר פרסום מדיניות הפרטיות, מומלץ להוסיף אותו לתפריט הניווט.', NULL, '', 0, '2019-08-27 12:05:14'),
