(5463, 5470, 'he', 0, NULL, 'ניתן להרחיב את אפשרויות של וורדפרס באמצעות תוספים. אם תרצו להתקין תוספים בצורה אוטומטית עשו זאת באמצעות <a href=\"%1$s\">ספריית התוספים של וורדפרס</a> או באמצעות העלאת קובץ zip על ידי לחיצה על כפתור ההוספה בראש העמוד.', NULL, '', 0, '2019-08-27 12:05:14'),
(5464, 5471, 'he', 0, NULL, 'תוספים מרחיבים את הפונקציונליות של האתר בדברים כמו טפסי יצירת קשר, מסחר אלקטרוני ועוד. כלומר, יש להם גישה עמוקה לאתר, לכן חיוני לשמור עליהם מעודכנים.', NULL, '', 0, '2019-08-27 12:05:14'),
(5465, 5472, 'he', 0, NULL, 'תוספים מתחברים לוורדפרס ומרחיבים את הפונקציונאליות שלה. תוספים אינם חלק מהליבה של וורדפרס והם מפותחים על ידי אלפי מפתחים מרחבי העולם. כל התוספים ב<a href=\"%s\">ספריית התוספים של וורדפרס</a> תואמים לרשיון השימוש של וורדפרס.', NULL, '', 0, '2019-08-27 12:05:14'),
