(5851, 5858, 'he', 0, NULL, 'ניתן לראות איך יראה האתר עם כל אחת מהתבניות בעזרת תצוגה מקדימה של התבנית ואף להתאים אותה לצרכים שלכם, לפני שמחילים את השינוי על האתר כולו. יש ללחוץ או לרחף על התבנית ולאחר מכן ללחוץ על כפתור תצוגה מקדימה, כדי להציג את האתר עם התבנית הרלוונטית. כפתור תצוגה מקדימה מופיע גם בחלק התחתון של מסך הפרטים של התבנית.', NULL, '', 0, '2019-08-27 12:05:14'),
