(5879, 5886, 'he', 0, NULL, 'הווידג\'טים שניתן להוסיף לסרגל הצדדי נמצאים תחת \"ווידג\'טים זמינים\". ההגדרות של כל ווידג\'ט יופיעו אחרי גרירתו לסרגל הצדדי הרצוי.', NULL, '', 0, '2019-08-27 12:05:14'),
(5880, 5887, 'he', 0, NULL, 'הקישור לממיר הקטגוריות והתגיות במסך זה מעביר למסך התקנת תוסף היבוא הנ\"ל. אחרי התקנת בתוסף, יש להפעיל אותו. התוסף מאפשר לבחור להמיר תגיות לקטגוריות או להפך.', NULL, '', 0, '2019-08-27 12:05:14'),
(5881, 5888, 'he', 0, NULL, 'במסך ההתאמה האישית ניתן לראות תצוגה מקדימה של השינויים באתר, לפני שמחילים את השינויים בפועל. ניתן לנווט לעמודים שונים באתר בתצוגה המקדימה. ברכיבים שניתנים לעריכה, מוצגים קיצורים לעריכה.', NULL, '', 0, '2019-08-27 12:05:14'),
(5882, 5889, 'he', 0, NULL, 'התפריט מתחת לעורך מפרט את פונקציות PHP שנמצאו בקובץ התוסף. לחיצה על חיפוש מובילה לדף אינטרנט עם תיעוד על הפונקציה.', NULL, '', 0, '2019-08-27 12:05:14'),
(5883, 5890, 'he', 0, NULL, 'האפשרויות הנוספות בהמשך העמוד קובעות את מבנה הקישורים לעמודי ארכיון של קטגוריות ותגיות. לדוגמה, כל עמודי הארכיון של הקטגוריה \"General\" יכולים להראות <code>/topics/general/</code> במקום <code>/category/general/</code>.', NULL, '', 0, '2019-08-27 12:05:14'),
(5884, 5891, 'he', 0, NULL, 'REST API מחזיר את התוצאה הלא צפויה הבאה: (%1$d) %2$s.', NULL, '', 0, '2019-08-27 12:05:14'),
(5885, 5892, 'he', 0, NULL, 'REST API לא התנהג כמצופה', NULL, '', 0, '2019-08-27 12:05:14'),
(5886, 5893, 'he', 0, NULL, 'REST API  לא עיבד כראוי את הפרמטר של השאילתה %s.', NULL, '', 0, '2019-08-27 12:05:14'),
(5887, 5894, 'he', 0, NULL, 'REST API נתקל בשגיאה', NULL, '', 0, '2019-08-27 12:05:14'),
(5888, 5895, 'he', 0, NULL, 'REST API נתקל בתוצאה לא צפויה', NULL, '', 0, '2019-08-27 12:05:14'),
(5889, 5896, 'he', 0, NULL, 'REST API זמין', NULL, '', 0, '2019-08-27 12:05:14'),
(5890, 5897, 'he', 0, NULL, 'REST API היא דרך נוספת בה וורדפרס, ויישומים אחרים, מתקשרים עם השרת. דוגמה אחת היא מסך עריכת הבלוקים, אשר מסתמך על זה כדי להציג ולשמור תכנים.', NULL, '', 0, '2019-08-27 12:05:14'),
(5891, 5898, 'he', 0, NULL, 'בקשת REST API נכשלה עקב שגיאה.', NULL, '', 0, '2019-08-27 12:05:14'),
(5892, 5899, 'he', 0, NULL, 'שרת SQL היא פיסת תוכנה הנדרשת לניהול מסד נתונים, בו וורדפרס משתמש כדי לאחסן את כל התוכן וההגדרות של האתר.', NULL, '', 0, '2019-08-27 12:05:14'),
(5893, 5900, 'he', 0, NULL, 'בדיקת בריאות אתר דורשת JavaScript.', NULL, '', 0, '2019-08-27 12:05:14'),
(5894, 5901, 'he', 0, NULL, 'עורך הטקסט מאפשר להוסיף פקודות HTML לתוכן הטקסטואלי. שימו לב לכך שבמעבר לעורך הטקסט, התגיות &lt;p&gt; ו-&lt;br&gt; מומרות לשורות חדשות כדי להפחית עומס. במהלך ההקלדה, רווח של שורה יחידה משמש במקום להקליד &lt;br&gt;, ורווח של שתי שורות משמש במקום תגית פסקה. במעבר חזרה אל העורך הויזואלי, יש המרה אוטומטית לתגיות HTML.', NULL, '', 0, '2019-08-27 12:05:14'),
(5895, 5902, 'he', 0, NULL, 'מסך התקנת התבניות דורש JavaScript.', NULL, '', 0, '2019-08-27 12:05:14'),
(5896, 5903, 'he', 0, NULL, 'המחלקה %s אינה קיימת.', NULL, '', 0, '2019-08-27 12:05:14'),
(5897, 5904, 'he', 0, NULL, 'צוות האכסון של וורדפרס שומר רשימה של המודולים האלה, אשר מומלצים ונדרשים, ב<a href=\"%1$s\" %2$s>במדריך של הצוות%3$s</a>.', NULL, '', 0, '2019-08-27 12:05:14'),
(5898, 5905, 'he', 0, NULL, 'צוות וורדפרס', NULL, '', 0, '2019-08-27 12:05:14'),
(5899, 5906, 'he', 0, NULL, 'כתובת האתר וכתובת ההתקנה של וורדפרס זהים בדרך כלל, אך לא תמיד. לדוגמה, ניתן לשמור את קבצי ההתקנה של וורדפרס בתת-ספרייה של הדומיין (למשל, example.com/wordpress).', NULL, '', 0, '2019-08-27 12:05:14'),
(5900, 5907, 'he', 0, NULL, 'צוות וורדפרס משווע לעזרתכם. אנא העבירו אימייל זה אל %s והצוות יעבוד מולכם כדי לוודא שהאתר עובד.', NULL, '', 0, '2019-08-27 12:05:14'),
(5901, 5908, 'he', 0, NULL, 'החברה א.א. שומדברים נוסדה בשנת 1971, והיא מספקת שומדברים איכותיים לציבור מאז. א.א. שומדברים ממוקמת בעיר תקוות-ים, מעסיקה מעל 2,000 אנשים ועושה כל מיני דברים מדהים עבור הקהילה התקוות-ימית.', NULL, '', 0, '2019-08-27 12:05:14'),
(5902, 5909, 'he', 0, NULL, 'התבנית לא תקינה. הופעלה תבנית ברירת המחדל.', NULL, '', 0, '2019-08-27 12:05:14'),
(5903, 5910, 'he', 0, NULL, 'כמות המידע שנדרש ממך להציג משתנה בהתאם לתקנות העסקיות המקומיות שלך. יתכן, לדוגמה, וחובה עליך להציג כתובת פיזית, כתובת העסק, או מספר הרישום של החברה שלך.', NULL, '', 0, '2019-08-27 12:05:14'),
(5904, 5911, 'he', 0, NULL, 'יחס ממדים קשור להיבט שבין הרוחב לגובה. ניתן לשמר את יחס ממדים על ידי החזקת מקש SHIFT לחוץ בעת שינוי גודל הבחירה. שימוש בתיבת הקלט מאפשר לציין את יחס הממדים, למשל 1:1 (ריבוע), 4:3, 16:9, וכו\'.', NULL, '', 0, '2019-08-27 12:05:14'),
