(5995, 6002, 'he', 0, NULL, 'שדה הכותרת ואזור עריכת הפוסט הגדול הם קבועים במקומם, אך באפשרותך לשנות את מיקום כל הקופסאות האחרות בעזרת גרירה ושחרור. כמו כן, באפשרותך לקבץ או להרחיב אותם על ידי הקלקה בשורת הכותרת של כל קופסה. שימוש בלשונית אפשרויות תצוגה מאפשר להציג קופסאות נוספות (תקציר, שליחת טראקבקים, שדות מיוחדים, דיון, מזהה לכתובת, מחבר) ולבחור פריסת מסך בטור אחד או שני טורים.', NULL, '', 0, '2019-08-27 12:05:14'),
