(5997, 6004, 'he', 0, NULL, 'לא ניתן לשדרג משום שוורדפרס %1$s זקוקה ל-MySQL בגרסה %2$s (או גרסה חדשה יותר), ובשרת זה יש MySQL בגרסה %3$s.', NULL, '', 0, '2019-08-27 12:05:14'),
(5998, 6005, 'he', 0, NULL, 'לא ניתן לשדרג משום שוורדפרס %1$s זקוקה ל-PHP בגרסה %2$s (או גרסה חדשה יותר) ול-MySQL בגרסה %3$s (או גרסה חדשה יותר). בשרת זה יש PHP בגרסה %4$s ו-MySQL בגרסה %5$s.', NULL, '', 0, '2019-08-27 12:05:14'),
(5999, 6006, 'he', 0, NULL, 'לא ניתן לשדרג משום שוורדפרס %1$s זקוקה ל-PHP בגרסה %2$s (או גרסה חדשה יותר), ובשרת זה יש PHP בגרסה %3$s.', NULL, '', 0, '2019-08-27 12:05:14'),
(6000, 6007, 'he', 0, NULL, 'לא ניתן להתקין את העדכון משום שלא ניתן להעתיק קבצים מסוימים. הדבר קורה בדרך כלל בגלל הרשאות קבצים לא עקביות.', NULL, '', 0, '2019-08-27 12:05:14'),
