(6009, 6016, 'he', 0, NULL, 'ספריית העלאות', NULL, '', 0, '2019-08-27 12:05:14'),
(6010, 6017, 'he', 0, NULL, 'שם המשתמש מכיל תווים שגויים.', NULL, '', 0, '2019-08-27 12:05:14'),
(6011, 6018, 'he', 0, NULL, 'הערך, %1$s, הופעל על ידי %2$s או שהוא נוסף לקובץ ההגדרות. פעולה זו תציג שגיאות באתר עצמו.', NULL, '', 0, '2019-08-27 12:05:14'),
