(6035, 6042, 'he', 0, NULL, 'תבניות מוסיפות לאתר מראה והתחושה. חשוב לשמור על תבניות מעודכנות כדי לשמור על האתר מאובטח.', NULL, '', 0, '2019-08-27 12:05:14'),
