(6042, 6049, 'he', 0, NULL, 'זוהו מספר פריטים שגויים בתפריט. יש לתקן או למחוק אותם.', NULL, '', 0, '2019-08-27 12:05:14'),
(6043, 6050, 'he', 0, NULL, 'ישנם שינויים שלא נשמרו והם ילכו לאיבוד. \'OK\' כדי לבטל, או \'Cancel\' כדי לחזור לעורך התמונות.', NULL, '', 0, '2019-08-27 12:05:14'),
(6044, 6051, 'he', 0, NULL, 'כרגע אין אירועים בסביבת %1$s. האם תרצה <a href=\"%2$s\">לארגן אירוע</a>?', NULL, '', 0, '2019-08-27 12:05:14'),
(6045, 6052, 'he', 0, NULL, 'כרגע אין אירועים מתוכננים באזור שלך. האם תרצה <a href=\"%s\">לארגן אירוע</a>?', NULL, '', 0, '2019-08-27 12:05:14'),
(6046, 6053, 'he', 0, NULL, 'קיימת גרסה חדשה של %1$s, אך היא לא עובדת עם גרסת ה-PHP באתר. <a href=\"%2$s\" %3$s>מידע נוסף על גרסה %4$s</a> או <a href=\"%5$s\">בצע שדרוג</a>.', NULL, '', 0, '2019-08-27 12:05:14'),
(6047, 6054, 'he', 0, NULL, 'קיימת גרסה חדשה של %1$s. <a href=\"%2$s\" %3$s>מידע נוסף על גרסה %4$s</a> או <a href=\"%5$s\" %6$s>בצע שדרוג</a>.', NULL, '', 0, '2019-08-27 12:05:14'),
(6048, 6055, 'he', 0, NULL, 'קיימת גרסה חדשה של %1$s. <a href=\"%2$s\" %3$s>מידע נוסף על גרסה %4$s</a>.', NULL, '', 0, '2019-08-27 12:05:14'),
(6049, 6056, 'he', 0, NULL, 'קיימת גרסה חדשה של %1$s. <a href=\"%2$s\" %3$s>מידע נוסף על גרסה %4$s</a>. <em>שדרוג אוטומטי אינו זמין לתוסף זה.</em>', NULL, '', 0, '2019-08-27 12:05:14'),
(6050, 6057, 'he', 0, NULL, 'קיימת גרסה חדשה של %1$s. <a href=\"%2$s\" %3$s>מידע נוסף על גרסה %4$s</a>. <em>שדרוג אוטומטי אינו זמין לתבנית זו.</em>', NULL, '', 0, '2019-08-27 12:05:14'),
(6051, 6058, 'he', 0, NULL, 'שינוי האימייל של המנהל אל %s ממתין לאישור.', NULL, '', 0, '2019-08-27 12:05:14'),
(6052, 6059, 'he', 0, NULL, 'שינוי האימייל שלך אל %s ממתין לאישור.', NULL, '', 0, '2019-08-27 12:05:14'),
(6053, 6060, 'he', 0, NULL, 'לפוסט זה יש גרסה שנשמרה אוטומטית והיא עשויה להיות חדשה יותר מגרסה זו. <a href=\"%s\">הצג גרסה שנשמרה אוטומטית</a>.', NULL, '', 0, '2019-08-27 12:05:14'),
(6054, 6061, 'he', 0, NULL, 'אין מספיק שטח דיסק להשלמת העדכון.', NULL, '', 0, '2019-08-27 12:05:14'),
(6055, 6062, 'he', 0, NULL, 'התרחשה שגיאה בעדכון הקובץ. יתכן שנדרש לבצע תיקון ולנסות לעדכן שוב.', NULL, '', 0, '2019-08-27 12:05:14'),
(6056, 6063, 'he', 0, NULL, 'אין צורך לשנות את קוד ה-CSS כאן &mdash; ניתן לערוך ולצפות בשינויים בקוד ה-CSR ישירות ב- <a href=\"%s\">עורך ה-CSS המובנה</a>.', NULL, '', 0, '2019-08-27 12:05:14'),
(6057, 6064, 'he', 0, NULL, 'התוספים יכולים להיות פעילים האתרים אחרים ברשת.', NULL, '', 0, '2019-08-27 12:05:14'),
(6058, 6065, 'he', 0, NULL, 'הגדרות אלה משנות היכן וכיצד נטענים חלקים שונים של וורדפרס.', NULL, '', 0, '2019-08-27 12:05:14'),
(6059, 6066, 'he', 0, NULL, 'ניתן לשנות את ההגדרות האלו עבור כל פוסט בנפרד', NULL, '', 0, '2019-08-27 12:05:14'),
(6060, 6067, 'he', 0, NULL, 'ההמלצות מבוססות על תוספים המותקנים באתר זה ובאתרים דומים אחרים.', NULL, '', 0, '2019-08-27 12:05:14'),
(6061, 6068, 'he', 0, NULL, 'אתרים אלו עשויים לאסוף נתונים אודותיך, להשתמש בקבצי \'עוגיות\', להטמיע מעקב של צד שלישי נוסף, ולנטר את האינטראקציה שלך עם תוכן מוטמע זה, לרבות מעקב אחר האינטראקציה שלך עם התוכן המוטמע, אם יש לך חשבון ואתה מחובר לאתר זה.', NULL, '', 0, '2019-08-27 12:05:14'),
(6062, 6069, 'he', 0, NULL, 'שלושה עשר סמלים חדשים הכוללים את אינסטגרם, סמלי באדיפרס, וסמלי כדור הארץ מסתובבים לכיסוי גלובלי. חפשו אותם בלוח הבקרה ותיהנה!', NULL, '', 0, '2019-08-27 12:05:14'),
(6063, 6070, 'he', 0, NULL, 'ל<a href=\"%1$s\">תבנית בת</a> זו נדרשת תבנית אם, %2$s.', NULL, '', 0, '2019-08-27 12:05:14');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES
(6064, 6071, 'he', 0, NULL, 'הכתובת משמשת לצורכי מערכת. אחרי שינוי הכתובת, ישלח אימייל לאישור השינוי. <strong>הכתובת החדשה לא תהיה בתוקף עד שתאושר.</strong>', NULL, '', 0, '2019-08-27 12:05:14'),
(6065, 6072, 'he', 0, NULL, 'עדכון מכוון מנהלים זה יאפשר תיקון בטוח וניהול של שגיאות חמורות מבלי להזדקק למפתח. הוא כולל טיפול טוב יותר בתקלות \"מסך לבן\" ומצב התאוששות המפסיק את פעילותם של תוספים ותבניות הגורמות לשגיאות.', NULL, '', 0, '2019-08-27 12:05:14'),
(6066, 6073, 'he', 0, NULL, 'לא ניתן לערוך יותר שינוי זה.', NULL, '', 0, '2019-08-27 12:05:14'),
(6067, 6074, 'he', 0, NULL, 'תבנית-בת זו מבוססת על תבנית-אם %s.', NULL, '', 0, '2019-08-27 12:05:14'),
(6068, 6075, 'he', 0, NULL, 'התגובה הזו אושרה כבר.', NULL, '', 0, '2019-08-27 12:05:14'),
(6069, 6076, 'he', 0, NULL, 'תגובה זו כבר נמצאת בפח.', NULL, '', 0, '2019-08-27 12:05:14'),
(6070, 6077, 'he', 0, NULL, 'התגובה הזו כבר סומנה כתגובת זבל.', NULL, '', 0, '2019-08-27 12:05:14'),
(6071, 6078, 'he', 0, NULL, 'התגובה הזו אושרה כבר', NULL, '', 0, '2019-08-27 12:05:14'),
(6072, 6079, 'he', 0, NULL, 'תגובה זו נמצאת בפח.', NULL, '', 0, '2019-08-27 12:05:14'),
(6073, 6080, 'he', 0, NULL, 'תגובה זו מסומנת כתגובת זבל', NULL, '', 0, '2019-08-27 12:05:14'),
(6074, 6081, 'he', 0, NULL, 'לא ניתן לערוך את התגובה כי היא נמצאת בפח. כדי לערוך את התגובה, יש לשחזר אותה מהפח. ', NULL, '', 0, '2019-08-27 12:05:14'),
(6075, 6082, 'he', 0, NULL, 'משמעות הדבר היא שהחיבורים אל WordPress.org נכשלים.', NULL, '', 0, '2019-08-27 12:05:14'),
(6076, 6083, 'he', 0, NULL, 'המידע נועד לאפשר שיפורים כללים לוודפרס, כולל הגנה על האתר שלכם באמצעות גילוי והתקנת עדכונים חשובים. הוא גם נועד לאפשר חישוב סטטיסטיקות, כגון אלו המוצגות <a href=\"%s\">בעמוד הסטטיסטיקות של WordPress.org</a>', NULL, '', 0, '2019-08-27 12:05:14'),
(6077, 6084, 'he', 0, NULL, 'טויטה זו נוצרה <a href=\"%s\">מהשינויים שלך בעיצוב שלא הופעלו</a>. ניתן לערוך את השינויים, אך אין חובה להפעיל אותם כאת. הטיוטה תופעל אוטומטית עם השינויים האלו.', NULL, '', 0, '2019-08-27 12:05:14'),
(6078, 6085, 'he', 0, NULL, 'פורמט זה נקרא WordPress eXtended RSS, או WXR. הוא מכיל את כל הפוסטים, התגובות, השדות המיוחדים, הקטגוריות והתגיות באתר.', NULL, '', 0, '2019-08-27 12:05:14'),
(6079, 6086, 'he', 0, NULL, 'כלי היבוא אינו מותקן. ניתן להתקין כלי יבוא דרך <a href=\"%s\">האתר הראשי</a>.', NULL, '', 0, '2019-08-27 12:05:14'),
(6080, 6087, 'he', 0, NULL, 'תבנית זו מבוססת על תבנית %s.', NULL, '', 0, '2019-08-27 12:05:14'),
(6081, 6088, 'he', 0, NULL, 'קובץ זה נמצא בתבנית הראשית.', NULL, '', 0, '2019-08-27 12:05:14'),
(6082, 6089, 'he', 0, NULL, 'זהו עמוד לדוגמה. הוא שונה מפוסט רגיל בבלוג מכיוון שהוא יישאר במקום אחד ויופיע בתפריט הניווט באתר (ברוב התבניות). רוב האנשים מתחילים עם עמוד אודות המציג אותם למבקרים חדשים באתר. הנה תוכן לדוגמה:', NULL, '', 0, '2019-08-27 12:05:14'),
(6083, 6090, 'he', 0, NULL, 'זה לא רק תוסף, הוא מסמל את התקווה ואת ההתלהבות של דור שלם בשתי מילים משירו המפורסם ביותר של לואיס ארמסטרונג: ​​שלום, דולי. כאשר התוסף מופעל ניתן לראות באופן אקראי מלים מתוך <cite>שלום, דולי</cite> בכל עמוד בממשק הניהול בפינה הימנית העליונה.', NULL, '', 0, '2019-08-27 12:05:14'),
(6084, 6091, 'he', 0, NULL, 'הפריט כבר נמחק.', NULL, '', 0, '2019-08-27 12:05:14'),
(6085, 6092, 'he', 0, NULL, 'זו גרסה מקומית של וורדפרס, הכוללת תרגומים והתאמות לשפה העברית. רצוי להמתין עם השדרוג עד שתצא גרסה מקומית מעודכנת.', NULL, '', 0, '2019-08-27 12:05:14'),
