(6104, 6111, 'he', 0, NULL, 'מסך זה משמש לניהול תבניות המותקנות כרגע באתר. מלבד תבניות ברירת המחדל הכלולות בהתקנה וורדפרס שלך, כל התבניות האחרות תוכננו ופותחו על ידי מפתחי צד שלישי.', NULL, '', 0, '2019-08-27 12:05:14'),
