(6107, 6114, 'he', 0, NULL, 'מסך זה מציג רשימה של המשתמשים הקיימים באתר. כל משתמש מוגדר על ידי הנהלת האתר באחד מחמשת התפקידים הבאים: מנהל, עורך, כותב, תורם, מנוי. משתמשים עם תפקידים אחרים מאשר מנהל יראו פחות אפשרויות בלוח הבקרה כאשר הם מחוברים, בהתאם לתפקידם.', NULL, '', 0, '2019-08-27 12:05:14'),
(6108, 6115, 'he', 0, NULL, 'תוספים אלה מאפשרים לייבא תכנים מאתרים אחרים. התוספים מסודרים לפי הפלטפורמה בה הם תומכים - לדוגמה, התוסף לייבוא מ-Blogger מאפשר לייבא תכנים מתוך Blogger.', NULL, '', 0, '2019-08-27 12:05:14'),
(6109, 6116, 'he', 0, NULL, 'מסך זה מאפשר גישה לכל הפוסטים באתר. ניתן להתאים את אפשרויות תצוגת המסך כדי שיתאים לצורת העבודה שלך.', NULL, '', 0, '2019-08-27 12:05:14'),
(6110, 6117, 'he', 0, NULL, 'במסך זה אפשרויות לשליטה על ניהול התצוגה של התגובות וקישורים לפוסטים/עמודים. למעשה יש כל כך הרבה אפשרויות עד שאין פה מספיק מקום לפרט את כולן. השתמשו בקישור התיעוד כדי לקבל מידע על כל הגדרות הדיון.', NULL, '', 0, '2019-08-27 12:05:14'),
(6111, 6118, 'he', 0, NULL, 'מסך זה מציג למשתמש בודד את כל האתרים שלו ברשת, ומאפשר לו לקבוע אתר ראשי. ניתן להשתמש בקישורים מתחת לכל אתר כדי לעבור לאתר עצמו או ללוח הבקרה שלו.', NULL, '', 0, '2019-08-27 12:05:14'),
(6112, 6119, 'he', 0, NULL, 'סרגל צדדי זה אינו זמין עוד והוא אינו מוצג באף מקום באתר. כדי להסירו לחלוטין יש להעביר את כל הוידג\'טים להלן.', NULL, '', 0, '2019-08-27 12:05:14'),
