(6139, 6146, 'he', 0, NULL, 'להוספת קישורים, <strong>יש ללחוץ על תפריט הקישורים, להזין כתובת וטקסט ולהוסיף לתפריט</strong>', NULL, '', 0, '2019-08-27 12:05:14'),
