(6141, 6148, 'he', 0, NULL, 'ניתן להוסיף משתמשים חדשים לאתר בעזרת הכפתור \"משתמש חדש\".', NULL, '', 0, '2019-08-27 12:05:14'),
(6142, 6149, 'he', 0, NULL, 'להוספת משתמש חדש לאתר, יש למלא את הטופס במסך הזה וללחוץ על כפתור \"הוסף משתמש חדש\".', NULL, '', 0, '2019-08-27 12:05:14'),
(6143, 6150, 'he', 0, NULL, 'כדי לאפשר למערכת לבצע תיקונים אוטומטיים במסד הנתונים, יש להוסיף את הקוד הבא לקובץ %s. אחרי הוספת הקוד יש לטעון מחדש עמוד זה.', NULL, '', 0, '2019-08-27 12:05:14'),
(6144, 6151, 'he', 0, NULL, 'לשיוך תפריטים למיקומים שונים בתבנית, <strong>בחר תפריט לכל מיקום</strong>. בסיום לחץ על הכפתור <strong>שמור שינויים</strong>.', NULL, '', 0, '2019-08-27 12:05:14'),
(6145, 6152, 'he', 0, NULL, 'כדי לחתוך את התמונה, יש ללחוץ עליה ולגרור אותה כדי לבחור את האזור שישאר.', NULL, '', 0, '2019-08-27 12:05:14'),
(6146, 6153, 'he', 0, NULL, 'כדי למחוק פריטי מדיה, יש ללחוץ על לחצן הבחירה המרובה בחלק העליון של המסך. ביחרו את כל הפריטים שברצונכם למחוק, ולאחר מכן ליחצו על לחצן המחיקה. לחיצה על ביטול הבחירה תחזיר אתכם לספריית המדיה.', NULL, '', 0, '2019-08-27 12:05:14'),
(6147, 6154, 'he', 0, NULL, 'לשפר את התוכנה ולשחרר את הגרסה המשופרת לאחרים.', NULL, '', 0, '2019-08-27 12:05:14'),
