(6149, 6156, 'he', 0, NULL, 'כדי לערוך תפריט קיים, <strong>יש לבחור תפריט</strong>', NULL, '', 0, '2019-08-27 12:05:14'),
(6150, 6157, 'he', 0, NULL, 'כדי לשפר את אבטחת האתר, מומלץ להסיר תבניות שאינן בשימוש. יש לשמור את %1$s, תבנית ברירת המחדל של וורדפרס, %2$s, התבנית הנוכחית ו-%3$s, תבנית האם שלה.', NULL, '', 0, '2019-08-27 12:05:14'),
(6151, 6158, 'he', 0, NULL, 'כדי לשפר את אבטחת האתר, מומלץ להסיר תבניות שאינן בשימוש. יש לשמור את התבנית הנוכחית,%1$s, ואת %2$s, תבנית האם שלה.', NULL, '', 0, '2019-08-27 12:05:14'),
(6152, 6159, 'he', 0, NULL, 'להתקנת תבנית ניתן לראות איך היא תראה עם התוכן של האתר ולהתאים את אפשרות התבנית לאתר. לחיצה על כפתור ההתקנה תתקין את התבנית אוטומטית באתר. בתום התהליך, ניתן יהיה להפעיל את תבנית או להציג תצוגה מקדימה שלה.', NULL, '', 0, '2019-08-27 12:05:14'),
(6153, 6160, 'he', 0, NULL, 'כדי לנווט בין גרסאות, <strong>יש לגרור את הסמן ימינה ושמאלה</strong> או <strong>להשתמש בכפתור הקודם והבא</strong>.', NULL, '', 0, '2019-08-27 12:05:14'),
(6154, 6161, 'he', 0, NULL, 'כדי לבצע את הפעולה, המערכת צריכה להתחבר לשרת.', NULL, '', 0, '2019-08-27 12:05:14'),
(6155, 6162, 'he', 0, NULL, 'כדי לפרסם תכנים באמצעות האימייל, צריך חשבון אימייל עם גישת POP3. כל הודעה שתשלח לאימייל זה תפורסם באתר, אז כדאי שהכתובת תישאר סודית. הנה כמה שמות אקראיים וקשים לניחוש שאפשר להשתמש בהם בכתובת: %1$s, %2$s, %3$s.', NULL, '', 0, '2019-08-27 12:05:14'),
(6156, 6163, 'he', 0, NULL, 'להפיץ מחדש.', NULL, '', 0, '2019-08-27 12:05:14'),
