(6351, 6358, 'he', 0, NULL, 'כללנו את הסעיפים המומלצים. תחת כל כותרת סעיף הוספנו סיכום קצר של המידע שעליך לספק, בתור התחלה. חלק מהסעיפים כוללים הצעה לתוכן הסעיף, ובאחרים יש להשלים את התוכן בהתאם לתוספים ולערכת העיצוב באתר.', NULL, '', 0, '2019-08-27 12:05:14'),
