(6371, 6378, 'he', 0, NULL, 'ברוכים הבאים לוורדפרס. לפני שמתחילים בתהליך ההתקנה, יש להזין הגדרות של מסד הנתונים.', NULL, '', 0, '2019-08-27 12:05:14'),
(6372, 6379, 'he', 0, NULL, 'ברוכים הבאים לוורדפרס. זה הפוסט הראשון באתר. ניתן למחוק או לערוך אותו, ולהתחיל לכתוב.', NULL, '', 0, '2019-08-27 12:05:14'),
(6373, 6380, 'he', 0, NULL, 'ברוכים הבאים לתהליך \"התקנת-וורדפרס-בחמש-דקות\" המפורסם! עליך רק למלא את שדות המידע להלן ותוך רגעים ספורים תעמוד מולך מערכת ניהול התוכן המדהימה ביותר בתבל!', NULL, '', 0, '2019-08-27 12:05:14'),
(6374, 6381, 'he', 0, NULL, 'ברוכים הבאים ללוח הבקרה של וורדפרס! מסך זה יוצג עם ההתחברות לאתר, הוא נותן גישה לכל תכונות הניהול באתר. ניתן לקבל עזרה עבור כל מסך על ידי לחיצה על הלשונית עזרה.', NULL, '', 0, '2019-08-27 12:05:14'),
(6375, 6382, 'he', 0, NULL, 'קבלת החלטות אוטומטיות ו/או יצירת פרופילים שאנו עושים עם נתוני המשתמשים שלנו', NULL, '', 0, '2019-08-27 12:05:14'),
(6376, 6383, 'he', 0, NULL, 'אילו הליכי פרצת נתונים יש לנו', NULL, '', 0, '2019-08-27 12:05:14'),
