(6382, 6389, 'he', 0, NULL, 'מה לעשות עם התכנים של המשתמש?', NULL, '', 0, '2019-08-27 12:05:14'),
(6383, 6390, 'he', 0, NULL, 'מאילו גופי צד-שלישי אנו מקבלים מידע', NULL, '', 0, '2019-08-27 12:05:14'),
(6384, 6391, 'he', 0, NULL, 'מה חדש', NULL, '', 0, '2019-08-27 12:05:14'),
(6385, 6392, 'he', 0, NULL, 'מה דעתך?', NULL, '', 0, '2019-08-27 12:05:14'),
(6386, 6393, 'he', 0, NULL, 'מה ההבדל בין קטגוריות לתגיות? תגיות הן כמו מילות מפתח שקשורות לפוסט, וכשתגיות חוזרות על עצמן במספר פוסטים, ניתן להשתמש בהן כשיטה לניווט באתר ולאיתור פוסטים. לעומת זאת, קטגוריות הן כמו אזורים מוגדרים מראש באתר, והפוסטים שנמצאים בכל אזור חולקים מכנה משותף כלשהו. אם האתר הוא כמו ספר, אפשר לחשוב על הקטגוריות כעל תוכן העניינים, ועל התגיות כעל האינדקס.', NULL, '', 0, '2019-08-27 12:05:14'),
(6387, 6394, 'he', 0, NULL, 'תגובות שמכילות אחת מהמילים האלה בתוכן, בשם, בכתובת ה-URL, בכתובת האימייל או בכתובת ה-IP, תועברנה אל ה<a href=\"edit-comments.php?comment_status=moderated\">תגובות שממתינות לאישור</a>. מילה או כתובת IP אחת בכל שורה. ניתן להשתמש גם בחלקי מילים, כך ששימוש במילה \"פרס\" תחסום גם תגובה עם המילה \"וורדפרס\".', NULL, '', 0, '2019-08-27 12:05:14'),
(6388, 6395, 'he', 0, NULL, 'תגובות שמכילות אחת מהמילים האלה בתוכנן, בשמן, בכתובת ה-URL, בכתובת האימייל או בכתובת ה-IP יעברו לפח. מילה או IP אחד בכל שורה. ניתן להשתמש גם בחלקי מילים - לדוגמה, \"פרס\" תחסום כל תגובה עם המילה \"וורדפרס\".', NULL, '', 0, '2019-08-27 12:05:14'),
(6389, 6396, 'he', 0, NULL, 'אלו השדות שניתן למלא בעת הוספת קטגוריה בעמוד זה:', NULL, '', 0, '2019-08-27 12:05:14'),
(6390, 6397, 'he', 0, NULL, 'אלו השדות שניתן למלא בעת הוספת תגיות בעמוד זה:', NULL, '', 0, '2019-08-27 12:05:14'),
(6391, 6398, 'he', 0, NULL, 'בעת החלפת תבניות, בדרך כלל קיימים הבדלים בכמות סרגלי הצד, הווידג\'טים ומיקומם. לעתים הבדלים אלה גורמים לתהליך החלפת התבנית להיות פחות חלק. אם חסרים ווידג\'טים אחרי החלפת תבנית, יש לגלול לתחתית המסך לאזור הווידג\'טים הבלתי-פעילים, שם נשמרים כל הווידג\'טים וההגדרות שלהם.', NULL, '', 0, '2019-08-27 12:05:14'),
(6392, 6399, 'he', 0, NULL, 'כאשר תצוגה מקדימה על מסך קטן, ניתן להשתמש באייקון המזעור בקצה התחתון של אזור התאמת העיצוב. זה יתן יותר מקום לתצוגה מקדימה של האתר עם תבנית הרלוונטית. כדי להחזיר את אזור התאמת העיצוב, יש ללחוץ על האייקון שוב כדי להרחיב.', NULL, '', 0, '2019-08-27 12:05:14'),
(6393, 6400, 'he', 0, NULL, 'כאשר הגדרה זו בתוקף, תזכורת מוצגת בתיבת \"מבט כללי\" בלוח הבקרה שאומר, \"מנועי חיפוש מתבקשים לא לאנדקס את האתר\" כדי להזכיר שהאתר לא נסרק.', NULL, '', 0, '2019-08-27 12:05:14'),
(6394, 6401, 'he', 0, NULL, 'כאשר משתמשים בעריכה קבוצתית, ניתן לשנות מידע (קטגוריות, מפרסם וכו\') עבור כל הפריטים שנבחרו. על מנת להעביר פריט מתוך קבוצה, יש ללחוץ על האיקס לצד שם הפריט בעריכה הקבוצתית.', NULL, '', 0, '2019-08-27 12:05:14'),
(6395, 6402, 'he', 0, NULL, 'כאשר המבקרים משאירים תגובות באתר אנו אוספים את הנתונים המוצגים בטופס התגובה, ובנוסף גם את כתובת ה-IP של המבקר, ואת מחרוזת ה-user agent של הדפדפן שלו כדי לסייע בזיהוי תגובות זבל.', NULL, '', 0, '2019-08-27 12:05:14'),
(6396, 6403, 'he', 0, NULL, 'אם השתמשת בתגיות <code>%category%</code> או <code>%tag%</code> בקישורים, שם הקטגוריה או התגית שבחרת עבור הפוסט יופיעו בקישור אליו. אם בחרת מספר קטגוריות או תגיות עבור פוסט אחד, בקישור הקבוע שלו יופיעו התגית או הקטגוריה עם המספר הסידורי הנמוך ביותר. ', NULL, '', 0, '2019-08-27 12:05:14'),
(6397, 6404, 'he', 0, NULL, 'כלי היצוא מייצר קובץ XML שמכיל את כל תוכן האתר, ומאפשר לשמור אותו במחשב לצורכי גיבוי או העברה לאתר אחר.', NULL, '', 0, '2019-08-27 12:05:14'),
(6398, 6405, 'he', 0, NULL, 'כאשר תתחבר, אנחנו גם נגדיר מספר \'עוגיות\' על מנת לשמור את פרטי ההתחברות שלך ואת בחירות התצוגה שלך. עוגיות התחברות תקפות ליומיים, ועוגיות אפשרויות מסך תקפות לשנה. אם תבחר באפשרות &quot;זכור אותי&quot;, פרטי ההתחברות שלך יהיו תקפים למשך שבועיים. אם תתנתק מהחשבון שלך, עוגיות ההתחברות יימחקו.', NULL, '', 0, '2019-08-27 12:05:14'),
(6399, 6406, 'he', 0, NULL, 'בכל פעם שיפורסם פוסט חדש, המערכת תודיע לשירותי העדכון הבאים. לפרטים נוספים ורשימה של <a href=\"%s\">שירותי עדכון</a> בקודקס. להזנת שירותים מרובים, הוסיפו כתובת אחת בכל שורה.', NULL, '', 0, '2019-08-27 12:05:14'),
(6400, 6407, 'he', 0, NULL, 'ברגע שעדכון דרך כפתור ״עדכן עכשיו״ בלוח הבקרה יצליח, אנחנו נעלים את השגיאה הזו בניסיונות הבאים.', NULL, '', 0, '2019-08-27 12:05:14'),
(6401, 6408, 'he', 0, NULL, 'להיכן אנו שולחים את המידע שלך', NULL, '', 0, '2019-08-27 12:05:14'),
(6402, 6409, 'he', 0, NULL, 'במהלך בדיקת האירועים המתוזמנים של האתר, הוחזרה השגיאה הבאה: %s', NULL, '', 0, '2019-08-27 12:05:14'),
(6403, 6410, 'he', 0, NULL, 'במהלך עריכת קובץ %1$s, קחו רגע כדי לבדוק שהוזנו 8 מפתחות ושהם יחודיים. ניתן לייצר אותם באמצעות <a href=\"%2$s\">מנגנון המפתחות הייחודיים של WordPress.org</a>.', NULL, '', 0, '2019-08-27 12:05:14'),
(6404, 6411, 'he', 0, NULL, 'במהלך השדרוג האתר יכנס למצב תחזוקה. כשהשדרוג יסתיים האתר ימשיך לפעול כרגיל.', NULL, '', 0, '2019-08-27 12:05:14'),
(6405, 6412, 'he', 0, NULL, 'מי אנחנו', NULL, '', 0, '2019-08-27 12:05:14'),
(6406, 6413, 'he', 0, NULL, 'עם מי אנו חולקים את המידע שלך', NULL, '', 0, '2019-08-27 12:05:14'),
(6407, 6414, 'he', 0, NULL, 'וידג\'ט: %s', NULL, '', 0, '2019-08-27 12:05:14'),
(6408, 6415, 'he', 0, NULL, 'וידג\'טים הם יחידות תוכן עצמאיות שאפשר להציג באזורים התומכים בכך בתבנית (בדרך כלל, אזורים אלה נקראים \"סרגלי צד\", אבל לעתים קרובות הם מופיעים גם בתחתית העמוד). ניתן לגרור וידג\'טים מרשימת הווידג\'טים אל הסרגל הצדדי המתאים.', NULL, '', 0, '2019-08-27 12:05:14'),
(6409, 6416, 'he', 0, NULL, 'ניתן להשתמש בכל ווידג\'ט מספר פעמים, ובמידת הצורך, אפשר להעניק לווידג\'טים כותרות.', NULL, '', 0, '2019-08-27 12:05:14'),
(6410, 6417, 'he', 0, NULL, 'עם תוספת של Webpack ו-Babel בתצורת החבילה של @wordpress/scripts, מפתחים לא יצטרכו עוד לדאוג להגדרת כלים מורכבים כדי לכתוב JavaScript מודרני.', NULL, '', 0, '2019-08-27 12:05:14'),
(6411, 6418, 'he', 0, NULL, 'מספר מילים: %s', NULL, '', 0, '2019-08-27 12:05:14'),
