(6420, 6427, 'he', 0, NULL, 'וורדפרס &lsaquo; עדכון', NULL, '', 0, '2019-08-27 12:05:14'),
(6421, 6428, 'he', 0, NULL, 'וורדפרס 5.2 מספק כלים חזקים יותר לזיהוי ותיקון בעיות תצורה וטעויות קריטיות. בין אם אתה מפתח המסייע ללקוחות שלך או שאתה מנהל את האתר לבדך. כלים אלה יכולים לעזור לך לקבל את המידע הנכון כאשר אתה צריך אותו.', NULL, '', 0, '2019-08-27 12:05:14'),
(6422, 6429, 'he', 0, NULL, 'חדשות וורדפרס', NULL, '', 0, '2019-08-27 12:05:14'),
