(6426, 6433, 'he', 0, NULL, 'גרסת וורדפרס', NULL, '', 0, '2019-08-27 12:05:14'),
(6427, 6434, 'he', 0, NULL, 'המערכת יכולה לנסות לבצע אופטימיזציה למסד הנתונים. התיקונים והשיפורים יכולים להמשך זמן מה ובזמן זה מסד הנתונים יהיה נעול.', NULL, '', 0, '2019-08-27 12:05:14'),
(6428, 6435, 'he', 0, NULL, 'המערכת יודעת למצוא ולתקן בעיות מוכרות במסד הנתונים. התיקון יכול לארוך זמן מה, אז כדאי להתאזר בסבלנות.', NULL, '', 0, '2019-08-27 12:05:14'),
(6429, 6436, 'he', 0, NULL, 'תיקון מסד נתונים', NULL, '', 0, '2019-08-27 12:05:14'),
(6430, 6437, 'he', 0, NULL, 'עדכוני פיתוח של וורדפרס נחסמים על ידי הקבוע %s.', NULL, '', 0, '2019-08-27 12:05:14'),
(6431, 6438, 'he', 0, NULL, 'עדכוני פיתוח של וורדפרס נחסמים על ידי הפילטר %s.', NULL, '', 0, '2019-08-27 12:05:14'),
(6432, 6439, 'he', 0, NULL, 'מיקום ספריית וורדפרס', NULL, '', 0, '2019-08-27 12:05:14'),
(6433, 6440, 'he', 0, NULL, 'גודל ספריית וורדפרס', NULL, '', 0, '2019-08-27 12:05:14'),
(6434, 6441, 'he', 0, NULL, 'אנחנו שמחים כשאנשים מדברים על וורדפרס, אך אנחנו מבקשים להישמע להנחיות שלנו לגבי <a href=\"%s\">השימוש בסימן הרשום</a>.', NULL, '', 0, '2019-08-27 12:05:14'),
(6435, 6442, 'he', 0, NULL, 'וורדפרס הותקנה. תודה ובהצלחה!', NULL, '', 0, '2019-08-27 12:05:14'),
(6436, 6443, 'he', 0, NULL, 'שדרוג וורדפרס הושלם! עתה יש לעדכן את מסד הנתונים.', NULL, '', 0, '2019-08-27 12:05:14'),
(6437, 6444, 'he', 0, NULL, 'וורדפרס זיהתה שהאתר פועל בגרסה לא מאובטחת של PHP.', NULL, '', 0, '2019-08-27 12:05:14'),
(6438, 6445, 'he', 0, NULL, 'וורדפרס זיהתה שהאתר פועל בגרסה מיושנת של PHP.', NULL, '', 0, '2019-08-27 12:05:14'),
(6439, 6446, 'he', 0, NULL, 'וורדפרס היא תוכנה חופשית, והיא מופצת ב<a href=\"%s\">רישיון GPL</a>. ', NULL, '', 0, '2019-08-27 12:05:14'),
(6440, 6447, 'he', 0, NULL, 'זו הגרסה העדכנית ביותר של וורדפרס.', NULL, '', 0, '2019-08-27 12:05:14'),
(6441, 6448, 'he', 0, NULL, 'וורדפרס נוצרה על ידי צוות נלהב של אנשים <a href=\"%1$s\">מכל רחבי העולם</a>. רוצה להשתתף? <a href=\"%2$s\">כדאי להתחיל כאן</a>.', NULL, '', 0, '2019-08-27 12:05:14'),
(6442, 6449, 'he', 0, NULL, 'וורדפרס נוצרה על ידי אנשים בעלי תשוקה מכל רחבי העולם.', NULL, '', 0, '2019-08-27 12:05:14'),
(6443, 6450, 'he', 0, NULL, 'המערכת אינה מודיעה ל<a href=\"%1$s\">שרותי עדכון</a> בגלל <a href=\"%2$s\">הגדרות הנראות</a> של האתר.', NULL, '', 0, '2019-08-27 12:05:14'),
(6444, 6451, 'he', 0, NULL, 'וורדפרס מאפשרת ליצור מבנה קישורים מותאם. הדבר משפר את האסתטיקה, השימושיות והתאימות קדימה של הקישורים. קיימות <a href=\"%s\">מספר תגיות</a> בהן ניתן להשתמש לבניית מבנה הקישורים, או לחליפין להשתמש במבנים המומלצים.', NULL, '', 0, '2019-08-27 12:05:14'),
(6445, 6452, 'he', 0, NULL, 'לוורדפרס נדרשת גרסא %2$s או יותר של %1$s. יש ליצור קשר עם שירות האחסון שלך בנושא זה.', NULL, '', 0, '2019-08-27 12:05:14'),
(6446, 6453, 'he', 0, NULL, 'גרסאות אבטחה והתחזוקה של וורדפרס נחסמו על ידי הקבוע %s.', NULL, '', 0, '2019-08-27 12:05:14'),
(6447, 6454, 'he', 0, NULL, 'גרסאות אבטחה והתחזוקה של וורדפרס נחסמו על ידי הפילטר %s.', NULL, '', 0, '2019-08-27 12:05:14'),
(6448, 6455, 'he', 0, NULL, 'תיקון אוטומטי של שגיאות קינון בתגיות XHTML', NULL, '', 0, '2019-08-27 12:05:14'),
