(6453, 6460, 'he', 0, NULL, 'התמיכה של וורדפרס ב-utf8mb4 דורשת MariaDB גרסה %s ומעלה. יש ליצור קשר עם מנהל השרת.', NULL, '', 0, '2019-08-27 12:05:14'),
(6454, 6461, 'he', 0, NULL, 'התמיכה של וורדפרס ב-utf8mb4 דורשת ספריית לקוח (%1$s) של MySQL גרסה %2$s ומעלה. יש ליצור קשר עם מנהל השרת.', NULL, '', 0, '2019-08-27 12:05:14'),
