(6456, 6463, 'he', 0, NULL, 'עמוד התוסף בספריית התוספים', NULL, '', 0, '2019-08-27 12:05:14'),
(6457, 6464, 'he', 0, NULL, 'WordPress.org נגיש', NULL, '', 0, '2019-08-27 12:05:14'),
