(6462, 6469, 'he', 0, NULL, 'X - לבוגרים יותר', NULL, '', 0, '2019-08-27 12:05:14'),
(6463, 6470, 'he', 0, NULL, 'XFN הוא קיצור של <a href=\"http://gmpg.org/xfn/\">XHTML Friends Network</a>, זהו מידע אופציונאלי. מאפייני XFN מאפשרים להגדיר את הקשר בינך לבין בעלי האתר/העמוד שאליו מפנה הקישור, אך מידע זה לא מוצג באתר בצורה מפורשת.', NULL, '', 0, '2019-08-27 12:05:14'),
(6464, 6471, 'he', 0, NULL, 'Y/m/d G:i:s', NULL, '', 0, '2019-08-27 12:05:14'),
(6465, 6472, 'he', 0, NULL, 'כן, למחוק את הקבצים האלה', NULL, '', 0, '2019-08-27 12:05:14'),
(6466, 6473, 'he', 0, NULL, 'כן, למחוק את הקבצים האלה והמידע שלהם', NULL, '', 0, '2019-08-27 12:05:14'),
(6467, 6474, 'he', 0, NULL, 'כן, אני רוצה להחליף סיסמה', NULL, '', 0, '2019-08-27 12:05:14'),
(6468, 6475, 'he', 0, NULL, 'יש גם כמה תוספים או תבניות עם עדכונים זמינים. לעדכן אותם עכשיו:', NULL, '', 0, '2019-08-27 12:05:14'),
(6469, 6476, 'he', 0, NULL, 'מומלץ לא לערוך תוספים מתוך לוח הבקרה של וורדפרס. עריכה מלוח הבקרה עלולה לגרום לאי תאימות, להפלת אתר, ולכן שהשינויים ימחקו בשדרוגים עתידיים.', NULL, '', 0, '2019-08-27 12:05:14'),
(6470, 6477, 'he', 0, NULL, 'נראה שמתבצעת כעת עריכה ישירה של התבנית בלוח הבקרה של וורדפרס. אנחנו ממליצים בחום לא לעשות זאת, מכיוון שזה עלול לפגוע באתר ולהפסיק את פעולתו. שינויים שמתבצעים כאן גם עלולים להמחק בעדכונים עתידיים. אם יש צורך בשינויים מעבר לקוד-CSS, אנו ממליצים ליצור <a href=\"%s\">תבנית בת</a> במקום.', NULL, '', 0, '2019-08-27 12:05:14'),
(6471, 6478, 'he', 0, NULL, 'ביקשת לאשר לפרסום את התגובה הבאה:', NULL, '', 0, '2019-08-27 12:05:14'),
(6472, 6479, 'he', 0, NULL, 'הינך עומד למחוק את הקובץ %s.', NULL, '', 0, '2019-08-27 12:05:14'),
(6473, 6480, 'he', 0, NULL, 'ביקשת למחוק את התגובה הבאה:', NULL, '', 0, '2019-08-27 12:05:14'),
(6474, 6481, 'he', 0, NULL, 'למחוק את הקישור\n\'%s\'?', NULL, '', 0, '2019-08-27 12:05:14'),
(6475, 6482, 'he', 0, NULL, 'למחוק את התבנית \'%s\'?', NULL, '', 0, '2019-08-27 12:05:14'),
(6476, 6483, 'he', 0, NULL, 'אתה עומד להתקין את וורדפרס %s <strong>באנגלית (EN).</strong> ישנה אפשרות שעדכון זה יהרוס תרגומים קיימים. אולי עדיף להמתין לשחרור גירסה מקומית בשפתך.', NULL, '', 0, '2019-08-27 12:05:14'),
(6477, 6484, 'he', 0, NULL, 'ביקשת לסמן את התגובה הבאה כתגובת זבל:', NULL, '', 0, '2019-08-27 12:05:14'),
(6478, 6485, 'he', 0, NULL, 'הינך עומד למחוק את התגובה הבאה:', NULL, '', 0, '2019-08-27 12:05:14'),
