INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES
(6481, 6488, 'he', 0, NULL, 'גישה לאתר זה מתבצעת באמצעות HTTPS, אך <a href=\"%s\">כתובת וורדפרס</a> אינה עושה שימוש ב-HTTPS כברירת מחדל.', NULL, '', 0, '2019-08-27 12:05:14'),
(6482, 6489, 'he', 0, NULL, 'אתה עורך את הפוסט שמציג את הפוסטים האחרונים.', NULL, '', 0, '2019-08-27 12:05:14'),
(6483, 6490, 'he', 0, NULL, 'האתר מפעיל את הגרסה העדכנית ביותר של וורדפרס. כל הכבוד!', NULL, '', 0, '2019-08-27 12:05:14'),
(6484, 6491, 'he', 0, NULL, 'אתה נמצא במצב התאוששות. משמעות הדבר היא שיתכן וקיימת שגיאה בתבנית או בתוסף כלשהו. כדי לצאת ממצב התאוששות, יש להתנתק או השתמש בכפתור היציאה. <a href=\"%s\">יציאה ממצב התאוששות</a>', NULL, '', 0, '2019-08-27 12:05:14'),
(6485, 6492, 'he', 0, NULL, 'המשתמש נותק מכל ההתקנים האחרים.', NULL, '', 0, '2019-08-27 12:05:14'),
(6486, 6493, 'he', 0, NULL, 'הינך מחובר באזור זה.', NULL, '', 0, '2019-08-27 12:05:14'),
(6487, 6494, 'he', 0, NULL, 'האתר עושה שימוש בתוסף מערכת %1$s, מה שאומר שמסד הנתונים %2$s אינו בשימוש.', NULL, '', 0, '2019-08-27 12:05:14'),
(6488, 6495, 'he', 0, NULL, 'גרסת פיתוח של וורדפרס &rlm;(&lrm;%1$s). נא לא לשכוח <a href=\"%2$s\">לעדכן</a>.', NULL, '', 0, '2019-08-27 12:05:14'),
(6489, 6496, 'he', 0, NULL, 'זו גרסת הפיתוח של וורדפרס. תוספים אלה, גם הם תחת פיתוח. <a href=\"%s\">למידע נוסף</a>.', NULL, '', 0, '2019-08-27 12:05:14'),
(6490, 6497, 'he', 0, NULL, 'אתה משתמש בגרסת פיתוח של וורדפרס. ניתן לעדכן לגרסה הלילית האחרונה באופן אוטומטי:', NULL, '', 0, '2019-08-27 12:05:14'),
(6491, 6498, 'he', 0, NULL, 'הדפדפן שלך אינו בטוח!', NULL, '', 0, '2019-08-27 12:05:14'),
(6492, 6499, 'he', 0, NULL, 'הינך משתמש במעלה הקבצים של הדפדפן. מעלה הקבצים של וורדפרס מאפשר בחירת קבצים מרובים ויכולת גרירה ושחרור. <a href=\"#\">החלף למעלה קבצים מרובים</a>.', NULL, '', 0, '2019-08-27 12:05:14'),
(6493, 6500, 'he', 0, NULL, 'הינך משתמש במעלה הקבצים של וורדפרס המאפשר להעלות קבצים מרובים. <a href=\"%1$s\" target=\"%2$s\">החלף למעלה הקבצים של הדפדפן</a>.', NULL, '', 0, '2019-08-27 12:05:14'),
(6494, 6501, 'he', 0, NULL, 'ניסית לגשת ללוח הבקרה של  \"%1$s\", אך אין לך הרשאות באתר זה. אם לדעתך צריכות להיות לך הרשאות ללוח הבקרה של \"%1$s\", אנא פנה למנהל הרשת.', NULL, '', 0, '2019-08-27 12:05:14'),
(6495, 6502, 'he', 0, NULL, 'ניסית לערוך קובץ שלא קיים. אולי הוא נמחק?', NULL, '', 0, '2019-08-27 12:05:14'),
(6496, 6503, 'he', 0, NULL, 'ניסית לערוך פריט שלא קיים. אולי הוא נמחק?', NULL, '', 0, '2019-08-27 12:05:14'),
(6497, 6504, 'he', 0, NULL, 'ניסיתי לעדכן פריט שאיננו קובץ מצורף. יש לחזור אחורה ולנסות שנית.', NULL, '', 0, '2019-08-27 12:05:14'),
(6498, 6505, 'he', 0, NULL, 'ניתן לחפש תבניות לפי מילות מפתח, מחברים, תגיות או לבצע סינון מתקדם לפי רשימת קריטריונים.', NULL, '', 0, '2019-08-27 12:05:14'),
(6499, 6506, 'he', 0, NULL, 'אם יש לך במחשב תבנית בקובץ ZIP, ניתן להעלות אותה באמצעות הקישור \"להעלות\" שבראש העמוד, או להעלות אותה ישירות לשרת בעזרת תוכנת FTP, אל הספרייה %s.', NULL, '', 0, '2019-08-27 12:05:14'),
(6500, 6507, 'he', 0, NULL, 'כאן ניתן להוסיף קישורים שיוצגו באתר - בדרך כלל בתוך <a href=\"%s\">וידג\'טים</a>. לצורך הדגמה, במהלך ההתקנה נוצרו קישורים למספר אתרים שקשורים לוורדפרס בעברית.', NULL, '', 0, '2019-08-27 12:05:14'),
(6501, 6508, 'he', 0, NULL, 'אין צורך למלא את כל השדות במסך הזה כדי לערוך או להוסיף קישורים. רק שם הקישור והכתובת הם שדות חובה.', NULL, '', 0, '2019-08-27 12:05:14'),
(6502, 6509, 'he', 0, NULL, 'ניתן לדפדף בתוספים המועדפים של המשתמש, על ידי לחיצה על קישור המועדפים והזנת פרטי ההתחברות לאתר WordPress.org.', NULL, '', 0, '2019-08-27 12:05:14'),
(6503, 6510, 'he', 0, NULL, 'ניתן לבחור צבע רקע על ידי לחיצה על ידי כפתור בחירת הצבעים ובחירת צבע מסויים או הקלדת ערך אקסדצימלי כגון &#8220;#ff0000&#8221; לצבע אדום.', NULL, '', 0, '2019-08-27 12:05:14'),
(6504, 6511, 'he', 0, NULL, 'ניתן לשלוט על תצוגת התכנים בקבצי RSS, לשלוט על כמות התכנים המקסימלית שתוצג והאם להציג תוכן מלא את תקצירים.', NULL, '', 0, '2019-08-27 12:05:14'),
(6505, 6512, 'he', 0, NULL, 'ניתן ליצור פוסטים גם באמצעות סימניית \"<a href=\"%s\">פרסם את זה</a>\".', NULL, '', 0, '2019-08-27 12:05:14'),
(6506, 6513, 'he', 0, NULL, 'ניתן גם למחוק פריטים בודדים ולגשת למסך העריכה דרך חלון התצוגה.', NULL, '', 0, '2019-08-27 12:05:14'),
(6507, 6514, 'he', 0, NULL, 'ניתן גם לערוך או למחוק מספר פוסטים. יש לבחור את הפוסטים ולבצע עליהם עריכה קבוצתית.', NULL, '', 0, '2019-08-27 12:05:14'),
(6508, 6515, 'he', 0, NULL, 'ניתן גם להטמיע תכנים מאתרים נפוצים רבים, כגון: טוויטר, יוטיוב, פליקר ועוד, באמצעות הדבקת כתובת ה-URL בשורה חדשה בעורך הויזואלי. למידע נוסף אודות <a href=\"https://codex.wordpress.org/Embeds\">אפשרויות ההטמעה של וורדפרס</a>.', NULL, '', 0, '2019-08-27 12:05:14'),
(6509, 6516, 'he', 0, NULL, 'בעמוד זה ניתן גם לסנן תגובות בתפריט מצב, או לשנות את תאריך התגובה.', NULL, '', 0, '2019-08-27 12:05:14'),
(6510, 6517, 'he', 0, NULL, 'ניתן לבצע את אותן הפעולות, כולל צמצום הרשימה באמצעות מסננים, באמצעות קישורי הפעולה המופיעים כאשר מרחפים מעל הפריטים, או באמצעות עריכה קבוצתית.', NULL, '', 0, '2019-08-27 12:05:14'),
(6511, 6518, 'he', 0, NULL, 'ניתן לשייך מילות מפתח לפוסטים בעזרת <strong>תגיות</strong>. בניגוד לקטגוריות, לתגיות אין היררכיה, משמע שאין קשר בין תגית אחת לאחרת.', NULL, '', 0, '2019-08-27 12:05:14'),
(6512, 6519, 'he', 0, NULL, 'באפשרותך להקצות מקומות לתפריטים שונים בתבנית על ידי <strong>בחירת ההגדרות הרצויות</strong> בחלק התחתון של עורך התפריט. כדי להקצות לכל תבנית מיקום בתפריטים בבת אחת, יש להיכנס ללשונית <strong>ניהול מיקומים</strong> בחלק העליון של המסך.', NULL, '', 0, '2019-08-27 12:05:14'),
(6513, 6520, 'he', 0, NULL, 'ניתן לשנות את המידע שמוצג בעמוד זה בלשונית אפשרויות תצוגה. ', NULL, '', 0, '2019-08-27 12:05:14'),
(6514, 6521, 'he', 0, NULL, 'מלבד הפרופיל האישי, ניתן לשנות בעמוד זה גם מספר הגדרות אישיות, כמו השימוש בעורך הוויזואלי, ערכת הצבעים של לוח הבקרה, ועוד. אפשר להסתיר את סרגל הכלים בעת צפייה באתר, אבל אי אפשר להסתיר אותו בלוח הבקרה.', NULL, '', 0, '2019-08-27 12:05:14'),
(6515, 6522, 'he', 0, NULL, 'ניתן לשנות את צלמית המשתמש ב<a href=\"%s\">גרבאטר</a>.', NULL, '', 0, '2019-08-27 12:05:14'),
(6516, 6523, 'he', 0, NULL, 'ניתן לבחור מתמונות ברירת המחדל של התבנית, או לבחור כל תמונה אחרת. כמו כן, ניתן להגדיר את תצוגת כותרת האתר ותיאור האתר.', NULL, '', 0, '2019-08-27 12:05:14'),
(6517, 6524, 'he', 0, NULL, 'ניתן לבחור מבין אחת מתמונות הכותרת שכבר העלאת, או להציג בכל פעם תמונה שונה מתוכן, באקראי.', NULL, '', 0, '2019-08-27 12:05:14'),
(6518, 6525, 'he', 0, NULL, 'ניתן לבחור מה יוצג בעמוד הראשי באתר. אפשר להציג את הפוסטים האחרונים באתר בסדר כרונולוגי (בלוג קלאסי), או עמוד סטטי מסויים. כדי להגדיר עמוד סטטי בתור עמוד ראשי, תחילה יש ליצור לפחות שני <a href=\"%s\">עמודים</a>. האחד ישמש עמוד הראשי והשני ישמש לעמוד בו יוצגו הפוסטים.', NULL, '', 0, '2019-08-27 12:05:14'),
(6519, 6526, 'he', 0, NULL, 'ניתן לבחור אם לאפשר לרובוטים, שירותי פינג ועכבישים לסרוק את האתר. אם ברצונך לגרום לשירותים אילו להתעלם מהאתר, יש להקליק על תיבת הסימון ליד &#8220; אפשר למנועי חיפוש לאנדקס את האתר &#8221; ולהקליק על כפתור שמירת השינויים בתחתית המסך. שימו לב שהאתר ממשיך להיות זמין ברשת, הפעולה רק מבקשת ממנועי חיפוש שלא לאנדקס את תכניו.', NULL, '', 0, '2019-08-27 12:05:14'),
(6520, 6527, 'he', 0, NULL, 'ניתן ליצור קבוצות של קישורים בעזרת קטגוריות קישורים. קטגוריות הקישורים נפרדים מקטגוריות הפוסטים והשמות שלהם חייבים להיות יחודיים.', NULL, '', 0, '2019-08-27 12:05:14'),
(6521, 6528, 'he', 0, NULL, 'ניתן ליצור את הקובץ %s באופן ידני ולהדביק לתוכו את הטקסט הבא.', NULL, '', 0, '2019-08-27 12:05:14'),
(6522, 6529, 'he', 0, NULL, 'ישנן מספר אפשרויות להתאמת התצוגה במסך זה:', NULL, '', 0, '2019-08-27 12:05:14'),
(6523, 6530, 'he', 0, NULL, 'ניתן לשנות את מראה העמוד באמצעות לשונית אפשרויות התצוגה.', NULL, '', 0, '2019-08-27 12:05:14'),
(6524, 6531, 'he', 0, NULL, 'ניתן להתאים את התצוגה במסך זה בכמה דרכים:', NULL, '', 0, '2019-08-27 12:05:14'),
(6525, 6532, 'he', 0, NULL, 'ניתן לשנות את מראה האתר בלי שום ניסיון בפיתוח תבניות, על ידי בחירת רקעים מותאמים. אפשר לבחור צבע רקע או תמונת רקע.', NULL, '', 0, '2019-08-27 12:05:14'),
(6526, 6533, 'he', 0, NULL, 'ניתן למחוק קטגוריות קישור בעריכה הקבוצתית, אך פעולה זו אינה מוחקת את הקישורים בתוך הקטגוריה. במקום זאת, הפעולה מקטלגת את הקישורים בקטגוריית ברירת המחדל.', NULL, '', 0, '2019-08-27 12:05:14'),
(6527, 6534, 'he', 0, NULL, 'ניתן לערוך את התמונה תוך שמירת התוצאה בתמונה המוקטנת. לדוגמא, אם ברצונך למזער תמונה מרובעת \nהמציגה רק חלק מהתמונה המקורית.', NULL, '', 0, '2019-08-27 12:05:14'),
(6528, 6535, 'he', 0, NULL, 'ניתן לערוך תגובות אחרי שהן התפרסמו - לדוגמה, אם יש בהן שגיאות כתיב או טעויות בולטות דומות.', NULL, '', 0, '2019-08-27 12:05:14'),
(6529, 6536, 'he', 0, NULL, 'ניתן להפעיל מצב כתיבה נטולת הפרעות באמצעות האייקון בצד שמאל. מאפיין זה אינו נתמך בדפדפנים ישנים או מסכים קטנים, וכי המאפיין יופעל דרך אפשרויות תצוגה.', NULL, '', 0, '2019-08-27 12:05:14'),
(6530, 6537, 'he', 0, NULL, 'ניתן לייצא את תוכן האתר כדי לייבא אותו לאתר אחר. הייצוא ישמר בקובץ XML בפורמט WXR אשר כולל פוסטים, עמודים, תגובות, שדות מיוחדים, קטגוריות ותגיות.', NULL, '', 0, '2019-08-27 12:05:14'),
(6531, 6538, 'he', 0, NULL, 'ניתן לסנן את רשימת הפוסטים על ידי סטטוס הפוסט. הדבר נעשה באמצעות הקישורים מעל רשימת הפוסטים. ברירת המחדל היא להציג את כל הפוסטים, אך ניתן להציג פוסטים בסטטוס ספציפי.', NULL, '', 0, '2019-08-27 12:05:14'),
(6532, 6539, 'he', 0, NULL, 'ניתן לסנן את רשימת המשתמשים לפי תפקידים. במצב ברירת המחדל מוצגים כל המשתמשים.', NULL, '', 0, '2019-08-27 12:05:14'),
(6533, 6540, 'he', 0, NULL, 'ישנן תבניות נוספות שניתן להשתמש בהן באתר זה - בלשונית התקנת התבניות. תבניות מגיעות <a href=\"%s\">מספריית התבניות של וורדפרס</a>. הספרייה מציעה אלפי תבניות חינאמיות, המפותחות על ידי מפתחים חיצוניים, ותואמות לתנאי הרישוי של וורדפרס.', NULL, '', 0, '2019-08-27 12:05:14'),
(6534, 6541, 'he', 0, NULL, 'ניתן למצוא פרטים נוספים ולבצע שינויים במסך התוספים.', NULL, '', 0, '2019-08-27 12:05:14'),
(6535, 6542, 'he', 0, NULL, 'ניתן למצוא פרטים נוספים ולבצע שינויים במסך התבניות.', NULL, '', 0, '2019-08-27 12:05:14'),
(6536, 6543, 'he', 0, NULL, 'ניתן למצוא תוספים חדשים להתקנה על ידי חיפוש או ניווט בספריית התוספים, הישר מלוח הבקרה של האתר.', NULL, '', 0, '2019-08-27 12:05:14'),
(6537, 6544, 'he', 0, NULL, 'בלשונית אפשרויות תצוגה ניתן להציג או להסתיר טורים בהתאם לצורך, ולקבוע כמה פוסטים יוצגו בכל עמוד.', NULL, '', 0, '2019-08-27 12:05:14'),
(6538, 6545, 'he', 0, NULL, 'ניתן להציג או להסתיר טורים לפי הצורך. אפשר גם להחליט כמה משתמשים יוצגו בכל עמוד. לשם כך יש להשתמש בלשונית אפשרויות התצוגה.', NULL, '', 0, '2019-08-27 12:05:14'),
(6539, 6546, 'he', 0, NULL, 'ניתן להכניס קבצי מדיה לתוכן על ידי לחיצה על כפתור הוספת המדיה מעל העורך. לחיצה על התמונה תציג פקודות נוספות כגון אפשרויות יישור תמונה, עריכה או מחיקה.', NULL, '', 0, '2019-08-27 12:05:14'),
(6540, 6547, 'he', 0, NULL, 'ניתן להתנתק מכל ההתקנים האחרים, כגון טלפון נייד או מחשב ציבורי, על ידי לחיצה על כפתור התנתקות מכל ההתקנים האחרים.', NULL, '', 0, '2019-08-27 12:05:14'),
(6541, 6548, 'he', 0, NULL, 'ניהול התגובות זהה לניהול פוסטים ותכנים אחרים באתר. במסך זה ניתן לבצע התאמות תצוגה בדומה לשאר המסכים, ולבצע עריכה מהירה ו/או עריכות קבוצתיות.', NULL, '', 0, '2019-08-27 12:05:14'),
(6542, 6549, 'he', 0, NULL, 'ניתן לסנן את הרשימה לפי סוג הקובץ או לפי התאריך, באמצעות התפריטים מעל הטבלה.', NULL, '', 0, '2019-08-27 12:05:14'),
(6543, 6550, 'he', 0, NULL, 'ניתן לראות תצוגה מקדימה של הרקע במסך <a href=\"%1$s\">התאמה אישית</a>.', NULL, '', 0, '2019-08-27 12:05:14'),
(6544, 6551, 'he', 0, NULL, 'ניתן לראות תצוגה מקדימה של תמונת כותרת במסך <a href=\"%1$s\">התאמה אישית</a>.', NULL, '', 0, '2019-08-27 12:05:14'),
(6545, 6552, 'he', 0, NULL, 'ניתן לשנות את גודל התמונה המקורית באופן יחסי. לתוצאות הטובות ביותר, הגדרת קנה מידה צריך להתבצע לפני החיתוך או הסיבוב. תמונות ניתן רק להקטין, לא להגדיל.', NULL, '', 0, '2019-08-27 12:05:14'),
(6546, 6553, 'he', 0, NULL, 'ניתן להציג ברשימה רק פוסטים מקטגוריות מסוימות או מחודשים מסוימים באמצעות התפריטים שמעל הרשימה, או להציג את הפוסטים לפי מחברים, קטגוריות או תגיות על ידי לחיצה על שם המחבר, על הקטגוריה או על התגית הרלבנטית בתוך הרשימה.', NULL, '', 0, '2019-08-27 12:05:14'),
(6547, 6554, 'he', 0, NULL, 'ניתן לבחור תמונה שתוצג בראש האתר, על ידי העלאת תמונה מהמחשב או בחירת תמונה מספריית המדיה של וורדפרס. אחרי בחירת התמונה, ניתן יהיה לחתוך ולהתאים אותה לאתר.', NULL, '', 0, '2019-08-27 12:05:14'),
(6548, 6555, 'he', 0, NULL, 'ניתן לבחור את השפה שברצונך להשתמש בה בלוח הבקרה של וורדפרס, מבלי להשפיע על שפת האתר שהמבקרים רואים.', NULL, '', 0, '2019-08-27 12:05:14'),
(6549, 6556, 'he', 0, NULL, 'ניתן להגדיר תמונת כותרת לאתר. יש להעלות תמונה, לחתוך אותה לגודל המתאים, ותמונת הכותרת תוצג באופן מיידי באתר. לחליפין, ניתן להשתמש בתמונה שכבר קיימת בספריית המדיה, על ידי לחיצה על הכפתור \"בחר תמונה\".', NULL, '', 0, '2019-08-27 12:05:14'),
(6550, 6557, 'he', 0, NULL, 'בעמוד זה ניתן לקבוע את הממדים של תמונות בפוסטים ובעמודים, אך תמיד ניתן לעקוף הגדרות אלה ולהציג תמונות בגודל המקורי שלהן.', NULL, '', 0, '2019-08-27 12:05:14'),
(6551, 6558, 'he', 0, NULL, 'ניתן לבחור שפה, ואם השרת לא מונע כתיבת קבצים, קבצי התרגום ויותקנו אוטומטית וישנו את שפת המערכת.', NULL, '', 0, '2019-08-27 12:05:14'),
(6552, 6559, 'he', 0, NULL, 'ניתן להמשיך להשתמש בוורדפרס, אך ייתכן שאתרים חדשים ברשת לא יהיו נגישים. אם הגדרות ה-DNS תקינות ולדעתך יש בעיה אחרת בבדיקה של תוכנית ההתקנה, אפשר פשוט להתעלם מהודעה זו ולהמשיך הלאה.', NULL, '', 0, '2019-08-27 12:05:14'),
(6553, 6560, 'he', 0, NULL, 'וורדפרס מאפשרת לפרסם תכנים במספר דרכים. במסך זה ניתן להגדיר הגדרות פרסום תוכן המשפיעות על כל אפשרויות הפרסום. במקטע העליון קובעים את עורך התוכן בלוח הבקרה, ואילו במקטעים התחתונים ניתן להגדיר אפשרויות פרסום באמצעות כלים חיצוניים. למידע נוסף על כל אחת מהשיטות הפרסום, ראו תיעוד.', NULL, '', 0, '2019-08-27 12:05:14'),
(6554, 6561, 'he', 0, NULL, 'ניתן לעדכן ל<a href=\"%1$s\">וורדפרס %2$s</a> אוטומטית:', NULL, '', 0, '2019-08-27 12:05:14'),
(6555, 6562, 'he', 0, NULL, 'ניתן להעלות ולהוסיף קבצי מדיה (תמונות, שמע, מסמכים ועוד) על ידי לחיצה על כפתור הוספת מדיה. ניתן לבחור תמונות וקבצים אחרים שכבר הועלו לספריית המדיה בעבר, או להעלות קבצי מדיה חדשים כדי להוסיף אותם לעמוד או פוסט. כדי ליצור גלריית תמונות, יש לבחור את התמונות שברצונך להוסיף ולחץ כפתור &#8220;צור גלריה חדשה&#8221;.', NULL, '', 0, '2019-08-27 12:05:14'),
(6556, 6563, 'he', 0, NULL, 'ניתן להעלות קבצי מדיה ללא יצירת פוסטים או עמודים. פעולה זו מאפשרת לשמור קבצים לשימוש עתידי בפוסטים, עמודים וכו\'. ניתן גם ליצור קישור ישירות לקבצי המדיה מתוך עמודי התוכן. ישנן שלוש אפשרויות להעלאת הקבצים:', NULL, '', 0, '2019-08-27 12:05:14'),
(6557, 6564, 'he', 0, NULL, 'ניתן להשתמש בקטגוריות כדי לארגן פוסטים לפי קבוצות לפי מאפיינים משותפים שונים. אלא אם כן שינית את ברירת המחדל בעמוד <a href=\"%s\">הגדרות כתיבה</a>, קטגורית ברירת המחדל היא \"כללי\", ולקטגוריה זו משוייכים כל הפוסטים שלא בחרת עבורם קטגוריה אחרת במפורש.', NULL, '', 0, '2019-08-27 12:05:14'),
(6558, 6565, 'he', 0, NULL, 'ניתן לבחור תמונה אחת מתוך התמונות הבאות, או להציג בכל פעם תמונה אקראית.', NULL, '', 0, '2019-08-27 12:05:14'),
(6559, 6566, 'he', 0, NULL, 'ניתן להשתמש בפקדים הבאים כדי לארגן את לוח הבקרה ולהתאים את התצוגה.', NULL, '', 0, '2019-08-27 12:05:14'),
(6560, 6567, 'he', 0, NULL, 'בעורך התוספים ניתן לבצע שינויים בכל התוספים המותקנים באתר. עם זאת, השינויים עשויים להימחק בעת שדרוג התוסף ששונה.', NULL, '', 0, '2019-08-27 12:05:14'),
