(6562, 6569, 'he', 0, NULL, 'ניתן לצפות בכל הפוסטים של משתמש מסוים בלחיצה על המספר מתחת לטור הפוסטים.', NULL, '', 0, '2019-08-27 12:05:14'),
(6563, 6570, 'he', 0, NULL, 'ניתן להציג את הפוסטים ברשימה פשוטה או עם התיאורים באמצעות לשונית אפשרויות המסך.', NULL, '', 0, '2019-08-27 12:05:14'),
